INSERT INTO `zt_bug` VALUES ('59', '1', '2', '62', '0', '0', '0', '0', '0', '0', '0', '#13538-【核保结果页】核保失败提示“被保人的姓名(营业个人)与保费计算时(杨青)不一致”', '', '3', '0', 'codeerror', 'windows', '', '', '', '[步骤]\r\n1.填写信息页，车辆性质选择营业-个人用车，且被保人姓名为“营业个人”\r\n2.报价成功，返回到填写信息页，修改车辆性质为营业-企业用车\r\n3.核保成功，撤销\r\n4.填写信息页，车辆性质修改为营业-个人用车，且被保人姓名修改为“杨青”\r\n5.去核保\r\n[结果]\r\n核保失败提示“被保人的姓名(营业个人)与保费计算时(杨青)不一致”。保费计算接口与核保结果传的被保人信息不一致\r\n[期望]\r\n核保成功', 'closed', '', '1', '0', '0000-00-00 00:00:00', null, 'fanqiao', '2017-10-12 00:00:00', '', 'Closed', '2017-10-16 00:00:00', '0000-00-00', 'liuxw', 'fixed', '', '2017-10-16 00:00:00', 'fanqiao', '2017-10-16 00:00:00', '0', '', '0', '0', '0', '0', 'fanqiao', '2017-10-16 00:00:00', '0');
