INSERT INTO `zt_bug` VALUES ('65', '1', '2', '63', '0', '0', '0', '0', '0', '0', '0', '#13527-【填写信息页】企业选址选择后取消，再次弹出企业选址弹窗，显示上次选择的信息', '', '3', '0', 'codeerror', 'windows', '', '', '', '[步骤]\r\n1.填写信息页，点击企业选址行\r\n2.弹出选择地址弹窗，选中一个地区，点击弹窗上的取消按钮\r\n3.弹窗关闭，再次点击企业选址行\r\n4.弹出选择地址弹窗，查看页面显示\r\n[结果]\r\n显示上次选择的地址\r\n[期望]\r\n显示最初的值，地址为请选择', 'closed', '', '1', '0', '0000-00-00 00:00:00', null, 'fanqiao', '2017-10-12 00:00:00', '', 'Closed', '2017-10-16 00:00:00', '0000-00-00', 'wxiaolong	', 'fixed', '', '2017-10-13 00:00:00', 'fanqiao', '2017-10-16 00:00:00', '0', '', '0', '0', '0', '0', 'fanqiao', '2017-10-16 00:00:00', '0');
