INSERT INTO `zt_doccontent` VALUES ('1', '1', '接入众安保险需求文档V1.0.docx', '', '<p><span style=\"font-family:\'微软雅黑\', \'sans-serif\';\">广东地区看车公司目前给车辆投保主要是通过安盛天平，需要接入多家保险公司丰富用户选择。本文档为接入众安保险需要改动的功能点。</span></p><p><span style=\"font-family:\'微软雅黑\', \'sans-serif\';\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><span style=\"font-family:\'微软雅黑\', \'sans-serif\';\">同时接入多家保险公司时，通常有两种模式。比价模式：先报价再选择保险公司，报价结果之前流程一样，报价结果后选择不同的保险公司进行核保。直接投保模式：先选择保险公司再投保，每个保险公司流程不一样。</span></p><p><br /></p>', '52', 'html', '1');
