INSERT INTO `zt_history` VALUES ('52', '198', 'spec', '<p class=\"MsoListParagraph\" style=\"margin-left:39pt;text-indent:0cm;\">包含：车架号、发动机号、初登日期、品牌型号、是否过户、是否按揭、交强险起保日期、商业险起保日期<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:57pt;text-indent:-57pt;\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\ni.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>车架号<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:-21pt;\"><span>A.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>默认展现“请输入<span>17</span>位车架号”<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:-21pt;\"><span>B.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>手动输入<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:-21pt;\"><span>a)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>调用键盘<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:0cm;\"><span>iOS</span>为英文<span>+</span>数字二合一键盘；<span>Android</span>和其他系统为系统默认键盘<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:-21pt;\"><span>b)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>输入限制<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:120pt;text-indent:-21pt;\">Ø&nbsp; 输入类型<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:120pt;text-indent:0cm;\"><span>26</span>个英文字母<span>+</span>纯数字；其他字符输入也不显示<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:120pt;text-indent:-21pt;\">Ø&nbsp; 输入字数限制<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:120pt;text-indent:0cm;\"><span>17</span>位，超出后输入无展现<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:120pt;text-indent:-21pt;\">Ø&nbsp; 英文大小写自动转换<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:120pt;text-indent:0cm;\">小写字母输入自动转换成大写字母<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:-21pt;\"><span>c)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>输入完成显示<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:120pt;text-indent:-21pt;\">Ø&nbsp; 当第一个输入进去，自动清掉默认展现值；<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:120pt;text-indent:-21pt;\">Ø&nbsp; 右对齐<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:120pt;text-indent:-21pt;\">Ø&nbsp; 折行<span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent:126pt;\">在限定展现范围内（以UI图为准），如遇屏幕太小，则自动折行<span></span></p>\n<p class=\"MsoNormal\"><span>&nbsp;</span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:57pt;text-indent:-57pt;\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\nii.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>发动机号<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:-21pt;\"><span>A.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>无默认展现<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:-21pt;\"><span>B.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>手动输入<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:-21pt;\"><span>a)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>调用键盘<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:0cm;\"><span>iOS</span>为英文<span>+</span>数字二合一键盘；<span>Android</span>和其他系统为系统默认键盘<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:-21pt;\"><span>b)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>输入限制<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:120pt;text-indent:-21pt;\">Ø&nbsp; 输入类型<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:120pt;text-indent:0cm;\"><span>26</span>个英文字母<span>+</span>纯数字；其他字符输入也不显示<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:120pt;text-indent:-21pt;\">Ø&nbsp; 输入字数限制<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:120pt;text-indent:0cm;\">最长13位，超出后输入无展现<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:120pt;text-indent:-21pt;\">Ø&nbsp; 英文大小写自动转换<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:120pt;text-indent:0cm;\">小写字母输入自动转换成大写字母<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:-21pt;\"><span>c)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>输入完成显示<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:120pt;text-indent:-21pt;\">Ø&nbsp; 当第一个输入进去，自动清掉默认展现值；<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:120pt;text-indent:-21pt;\">Ø&nbsp; 右对齐<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:120pt;text-indent:-21pt;\">Ø&nbsp; 折行<span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent:126pt;\">在限定展现范围内，如遇屏幕太小，则自动折行<span></span></p>\n<p class=\"MsoNormal\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:0cm;\"><span>&nbsp;</span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:57pt;text-indent:-57pt;\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\niii.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>初登日期<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:-21pt;\"><span>A.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>默认展现：“请选择”<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:-21pt;\"><span>B.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>点击通栏，触发选择控件，样式为如下地址：（以<span>iOS</span>为例）<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-inden