d\"><p>int</p>\n</td>\n<td class=\"confluenceTd\"><p>错误码</p>\n</td>\n</tr><tr><td class=\"confluenceTd\"><p>message</p>\n</td>\n<td class=\"confluenceTd\"><p>String</p>\n</td>\n<td class=\"confluenceTd\"><p>错误信息</p>\n</td>\n</tr><tr><td class=\"confluenceTd\"><p>result</p>\n</td>\n<td class=\"confluenceTd\"><p>String</p>\n</td>\n<td class=\"confluenceTd\"><p>券码核销详情</p>\n</td>\n</tr></tbody></table></div>\n<p><br /></p>\n<h2 style=\"color:#333333;font-size:20px;font-weight:normal;\">结果示例</h2>\n<p><strong>JSON</strong>&nbsp;<br />\n{<br />\n\"ok\": true,<br />\n\"returncode\": 0,<br />\n\"message\": \"OK\",<br />\n\"result\": \"券码核销成功\"<span class=\"confluence-anchor-link conf-macro output-inline\">&nbsp;</span><br />\n}</p>\n</div>\n<div style=\"margin:10px 0px;padding:10px 0px;color:#333333;font-family:Arial, sans-serif;\"><div class=\"no-print\" style=\"margin:0px;padding:0px;font-size:13px;\"></div>\n</div>', '');
