INSERT INTO `zt_storyspec` VALUES ('17', '1', '图片上传接口V1.0.0', '<h2 style=\"color:#333333;font-size:20px;font-weight:normal;font-family:Arial, sans-serif;\">1.接口说明</h2>\n<hr /><pre>图片上传接口</pre>\n<h2 style=\"color:#333333;font-size:20px;font-weight:normal;font-family:Arial, sans-serif;\">2.接口地址</h2>\n<hr /><p style=\"color:#333333;font-family:Arial, sans-serif;\">image/upload</p>\n<p style=\"color:#333333;font-family:Arial, sans-serif;\">请求方式：POST&nbsp;multipart/form-data</p>\n<h2 style=\"color:#333333;font-size:20px;font-weight:normal;font-family:Arial, sans-serif;\">4.请求参数</h2>\n<hr /><div class=\"table-wrap\" style=\"margin:10px 0px 0px;padding:0px;color:#333333;font-family:Arial, sans-serif;\"><table class=\"confluenceTable tablesorter tablesorter-default stickyTableHeaders\" style=\"margin:0px;padding:0px;\"><tbody><tr class=\"tablesorter-headerRow\"><th class=\"confluenceTh tablesorter-header sortableHeader tablesorter-headerUnSorted\" style=\"vertical-align:top;background:#F0F0F0 no-repeat right center;color:#333333;\"><div class=\"tablesorter-header-inner\" style=\"margin:0px;padding:0px;\">参数名称</div>\n</th>\n<th class=\"confluenceTh tablesorter-header sortableHeader tablesorter-headerUnSorted\" style=\"vertical-align:top;background:#F0F0F0 no-repeat right center;color:#333333;\"><div class=\"tablesorter-header-inner\" style=\"margin:0px;padding:0px;\">数据类型</div>\n</th>\n<th class=\"confluenceTh tablesorter-header sortableHeader tablesorter-headerUnSorted\" style=\"vertical-align:top;background:#F0F0F0 no-repeat right center;color:#333333;\"><div class=\"tablesorter-header-inner\" style=\"margin:0px;padding:0px;\">是否必填</div>\n</th>\n<th class=\"confluenceTh tablesorter-header sortableHeader tablesorter-headerUnSorted\" style=\"vertical-align:top;background:#F0F0F0 no-repeat right center;color:#333333;\"><div class=\"tablesorter-header-inner\" style=\"margin:0px;padding:0px;\">说明</div>\n</th>\n</tr></tbody><tbody><tr><td class=\"confluenceTd\">file</td>\n<td cl