INSERT INTO `zt_storyspec` VALUES ('18', '1', '我的团队V1.0.0', '<h2 style=\"color:#333333;font-size:20px;font-weight:normal;font-family:Arial, sans-serif;\">接口说明</h2>\n<p style=\"color:#333333;font-family:Arial, sans-serif;\">获取我（B端用户）的团队</p>\n<h2 style=\"color:#333333;font-size:20px;font-weight:normal;font-family:Arial, sans-serif;\">接口地址</h2>\n<div class=\"table-wrap\" style=\"margin:10px 0px 0px;padding:0px;color:#333333;font-family:Arial, sans-serif;\"><table class=\"wrapped confluenceTable\" style=\"margin:0px;\"><tbody><tr><td class=\"confluenceTd\"><p>&nbsp;</p>\n</td>\n<td class=\"confluenceTd\"><p>&nbsp;</p>\n</td>\n</tr><tr><td class=\"confluenceTd\"><p>接口协议</p>\n</td>\n<td class=\"confluenceTd\"><p>HTTP</p>\n</td>\n</tr><tr><td class=\"confluenceTd\"><p>接口地址</p>\n</td>\n<td class=\"confluenceTd\"><p>buser/myteam</p>\n</td>\n</tr><tr><td class=\"confluenceTd\"><p>请求方式</p>\n</td>\n<td class=\"confluenceTd\"><p>GET</p>\n</td>\n</tr><tr><td class=\"confluenceTd\"><p>参数格式</p>\n</td>\n<td class=\"confluenceTd\"><p>URL参数</p>\n</td>\n</tr></tbody></table></div>\n<h2 style=\"color:#333333;font-size:20px;font-weight:normal;font-family:Arial, sans-serif;\">测试环境</h2>\n<p style=\"color:#333333;font-family:Arial, sans-serif;\"><br /></p>\n<h2 style=\"color:#333333;font-size:20px;font-weight:normal;font-family:Arial, sans-serif;\">请求参数</h2>\n<h2 style=\"color:#333333;font-size:20px;font-weight:normal;font-family:Arial, sans-serif;\">无（后台会从公用组件里取用户唯一标识）</h2>\n<p style=\"color:#333333;font-family:Arial, sans-serif;\"><br /></p>\n<h2 style=\"color:#333333;font-size:20px;font-weight:normal;font-family:Arial, sans-serif;\">返回结果</h2>\n<div class=\"table-wrap\" style=\"margin:10px 0px 0px;padding:0px;color:#333333;font-family:Arial, sans-serif;\"><table class=\"wrapped confluenceTable\" style=\"margin:0px;\"><tbody><tr><td class=\"confluenceTd\"><p><strong>属性名称</strong></p>\n</td>\n<td class=\"confluenceTd\"><p><strong>属性类型</strong></p>\n</td>\n<td class=\"confluenceTd\"><p><stro