INSERT INTO `zt_storyspec` VALUES ('20', '1', '手机号-密码登陆V1.0.0', '<h3 style=\"color:#333333;font-family:Arial, sans-serif;\">接口说明：</h3>\n<p style=\"color:#333333;font-family:Arial, sans-serif;\"><br />\n根据手机号、密码，进行登陆；适用于F端用户，如果手机号、密码正确，登陆成功，设置token，返回用户id，如果失败，返回提示信息</p>\n<h3 style=\"color:#333333;font-family:Arial, sans-serif;\">接口地址：</h3>\n<p style=\"color:#333333;font-family:Arial, sans-serif;\">/user/loginByPassword</p>\n<h3 style=\"color:#333333;font-family:Arial, sans-serif;\">请求类型：</h3>\n<p style=\"color:#333333;font-family:Arial, sans-serif;\">post，get均可。</p>\n<h3 style=\"color:#333333;font-family:Arial, sans-serif;\">接口参数：</h3>\n<h3 style=\"color:#333333;font-family:Arial, sans-serif;\">phone&nbsp;&nbsp; – 接受短信的手机号</h3>\n<h3 style=\"color:#333333;font-family:Arial, sans-serif;\">password&nbsp;&nbsp;&nbsp;&nbsp; – 密码</h3>\n<p style=\"color:#333333;font-family:Arial, sans-serif;\"><br />\n请求实例：&nbsp;&nbsp;&nbsp; /user/loginByPassword?phone=13939098867&amp;password=123456</p>\n<div class=\"table-wrap\" style=\"margin:10px 0px 0px;padding:0px;color:#333333;font-family:Arial, sans-serif;\"><table class=\"confluenceTable\" style=\"margin:0px;\"><tbody><tr><td colspan=\"1\" class=\"confluenceTd\">ok</td>\n<td colspan=\"1\" class=\"confluenceTd\">true(目前不做结果的判断)</td>\n</tr><tr><td class=\"confluenceTd\">\n<pre>returncode</pre>\n</td>\n<td class=\"confluenceTd\">0代表成功，1代表失败</td>\n</tr><tr><td colspan=\"1\" class=\"confluenceTd\">\n<pre>message</pre>\n</td>\n<td colspan=\"1\" class=\"confluenceTd\">提示信息（失败时的各种提示信息）</td>\n</tr><tr><td class=\"confluenceTd\">\n<pre>result</pre>\n</td>\n<td class=\"confluenceTd\">用户id</td>\n</tr></tbody></table></div>\n<p style=\"color:#333333;font-family:Arial, sans-serif;\"><br /></p>\n<p style=\"color:#333333;font-family:Arial, sans-serif;\">返回值：</p>\n<div class=\"table-wrap\" style=\"margin:10px 0px 0px;padding:0px;color:#333333;font-family:Arial, sans-serif;\"><table class=\"confluenceTable\" style=\"margin:0px;\"><tbody><tr><td class=\"confluenceTd\"><p>{<br />\n&nbsp;&nbsp;\"ok\":&nbsp;true,<br />\n&nbsp;&nbsp;\"returncode\":&nbsp;0,<br />\n&nbsp;&nbsp;\"message\":&nbsp;\"验证成功\",<br />\n&nbsp;&nbsp;\"result\":&nbsp;1<br />\n}</p>\n</td>\n</tr></tbody></table></div>', '');
INSERT INTO `zt_storyspec` VALUES ('21', '1', '手机号-验证码登陆V1.0.0', '<h3 style=\"color:#333333;font-family:Arial, sans-serif;\">接口说明：</h3>\n<p style=\"color:#333333;font-family:Arial, sans-serif;\"><br />\n根据手机号，验证码，进行登陆（适用于B端和C端）；</p>\n<p style=\"color:#333333;font-family:Arial, sans-serif;\">如果用户类型为2（C端用户），先做验证码的验证，然后判断该手机号是否已经注册过，如果注册过，则登陆成功，设置token，如果没注册过，则先进行注册，后设置登陆token，返回用户的id。</p>\n<p style=\"color:#333333;font-family:Arial, sans-serif;\"><br />\n如果用户类型为1（B端用户），先做验证码的验证，然后判断该手机号是否已经注册过，如果注册过，则登陆成功，设置token，返回用户id，如果没有注册过，直接返回验成功，不返回用户id，需要补充用户名，分销码等信息之后，再进行保持操作。</p>\n<h3 style=\"color:#333333;font-family:Arial, sans-serif;\">接口地址：</h3>\n<p style=\"color:#333333;font-family:Arial, sans-serif;\">/user/loginByCode</p>\n<h3 style=\"color:#333333;font-family:Arial, sans-serif;\">请求类型：</h3>\n<p style=\"color:#333333;font-family:Arial, sans-serif;\">post，get均可。</p>\n<h3 style=\"color:#333333;font-family:Arial, sans-serif;\">接口参数：</h3>\n<h3 style=\"color:#333333;font-family:Arial, sans-serif;\">phone&nbsp;&nbsp; – 接受短信的手机号</h3>\n<h3 style=\"color:#333333;font-family:Arial, sans-serif;\">code&nbsp;&nbsp;&nbsp;&nbsp; –&nbsp; 验证码</h3>\n<h3 style=\"color:#333333;font-family:Arial, sans-serif;\">userType&nbsp; – 用户类型（1B端用户，2:C端用户）</h3>\n<p style=\"color:#333333;font-family:Arial, sans-serif;\"><br />\n请求实例：&nbsp;&nbsp;&nbsp; /user/loginByCode?phone=13939098867&amp;code=1234&amp;userType=1</p>\n<div class=\"table-wrap\" style=\"margin:10px 0px 0px;padding:0px;color:#333333;font-family:Arial, sans-serif;\"><table class=\"wrapped confluenceTable\" style=\"margin:0px;\"><tbody><tr><td colspan=\"1\" class=\"confluenceTd\">ok</td>\n<td colspan=\"1\" class=\"confluenceTd\">true(目前不做结果的判断)</td>\n</tr><tr><td class=\"confluenceTd\">\n<pre>returncode</pre>\n</td>\n<td class=\"confluenceTd\">0代表成功，1代表失败</td>\n</tr><tr><td colspan=\"1\" class=\"confluenceTd\">\n<pre>message</pre>\n</td>\n<td colspan=\"1\" class=\"confluenceTd\">提示信息（失败时的各种提示信息）</td>\n</tr><tr><td class=\"confluenceTd\"