INSERT INTO `zt_storyspec` VALUES ('25', '1', '根据用户id获取用户信息V1.0.0', '<div class=\"wiki-content\" style=\"margin:0px;padding:0px;color:#333333;font-family:Arial, sans-serif;\"><h3 style=\"color:#333333;\">接口说明：</h3>\n<p><br />\n根据用户id获取用户信息 。</p>\n<h3 style=\"color:#333333;\">接口地址：</h3>\n<p>/user/getUser</p>\n<h3 style=\"color:#333333;\">请求类型：</h3>\n<p>post，get均可。</p>\n<h3 style=\"color:#333333;\">接口参数：</h3>\n<h3 style=\"color:#333333;\">userId&nbsp;&nbsp; – 用户id</h3>\n<p><br />\n请求实例：&nbsp;&nbsp;&nbsp; /user/getUser?userId=13</p>\n<div class=\"table-wrap\" style=\"margin:10px 0px 0px;padding:0px;\"><table class=\"wrapped confluenceTable\" style=\"margin:0px;\"><tbody><tr><td colspan=\"1\" class=\"confluenceTd\">ok</td>\n<td colspan=\"1\" class=\"confluenceTd\">true(目前不做结果的判断)</td>\n</tr><tr><td class=\"confluenceTd\">\n<pre>returncode</pre>\n</td>\n<td class=\"confluenceTd\">0代表成功，1代表失败</td>\n</tr><tr><td colspan=\"1\" class=\"confluenceTd\">\n<pre>message</pre>\n</td>\n<td colspan=\"1\" class=\"confluenceTd\">提示信息（失败时的各种提示信息）</td>\n</tr><tr><td class=\"confluenceTd\">\n<pre>result</pre>\n</td>\n<td class=\"confluenceTd\">用户信息（user）</td>\n</tr></tbody></table></div>\n<p><br /></p>\n<p>返回值：</p>\n<p>{<br />\n&nbsp;&nbsp;\"ok\":&nbsp;true,<br />\n&nbsp;&nbsp;\"returncode\":&nbsp;0,<br />\n&nbsp;&nbsp;\"message\":&nbsp;\"验证成功\",<br />\n&nbsp;&nbsp;\"result\": {</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; id:1,</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; userName:\"zhangsan\",</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; inviteCode:234566,</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; mobile:\"13939098867\",</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; userType:\"1,2,\",</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; idNo:\"\",</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; commissionRate:\"\",</p>\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; status:0</p>\n<p>&nbsp;}<br />\n}</p>\n</div>\n<div style=\"margin:10px 0px;padding:10px 0px;color:#333333;font-family:Arial, sans-serif;\"><div class=\"no-print\" style=\"margin:0px;padding:0px;font-size:13px;\"></div>\n</div>', '');
INSERT INTO `zt_storyspec` VALUES ('26', '1', '获取手机短信验证码V1.0.0', '<h3 style=\"color:#333333;font-family:Arial, sans-serif;\">接口说明：</h3>\n<p style=\"color:#333333;font-family:Arial, sans-serif;\">输入手机号，获取4位的随机验证码。</p>\n<h3 style=\"color:#333333;font-family:Arial, sans-serif;\">接口地址：</h3>\n<p style=\"color:#333333;font-family:Arial, sans-serif;\">/user/getSmsCode</p>\n<h3 style=\"color:#333333;font-family:Arial, sans-serif;\">请求类型：</h3>\n<p style=\"color:#333333;font-family:Arial, sans-serif;\">post，get均可。</p>\n<h3 style=\"color:#333333;font-family:Arial, sans-serif;\">接口参数：</h3>\n<h3 style=\"color:#333333;font-family:Arial, sans-serif;\">phone&nbsp;&nbsp; – 接受短信的手机号</h3>\n<p style=\"color:#333333;font-family:Arial, sans-serif;\"><br />\n请求实例：&nbsp;&nbsp;&nbsp; /user/getSmsCode?phone=13939098867</p>\n<div class=\"table-wrap\" style=\"margin:10px 0px 0px;padding:0px;color:#333333;font-family:Arial, sans-serif;\"><table class=\"confluenceTable tablesorter tablesorter-default stickyTableHeaders\" style=\"margin:0px;padding:0px;\"><tbody><tr class=\"tablesorter-headerRow\"><th class=\"confluenceTh tablesorter-header sortableHeader tablesorter-headerUnSorted\" style=\"vertical-align:top;background:#F0F0F0 no-repeat right center;color:#333333;\"><div class=\"tablesorter-header-inner\" style=\"margin:0px;padding:0px;\">字段</div>\n</th>\n<th class=\"confluenceTh tablesorter-header sortableHeader tablesorter-headerUnSorted\" style=\"vertical-align:top;background:#F0F0F0 no-repeat right center;color:#333333;\"><div class=\"tablesorter-header-inner\" style=\"margin:0px;padding:0px;\">含义</div>\n</th>\n</tr></tbody><tbody><tr><td colspan=\"1\" class=\"confluenceTd\">ok</td>\n<td colspan=\"1\" class=\"confluenceTd\">true(目前不做结果的判断)</td>\n</tr><tr><td class=\"confluenceTd\">\n<pre>returncode</pre>\n</td>\n<td class=\"confluenceTd\">0代表成功，1代表失败</td>\n</tr><tr><td colspan=\"1\" class=\"confluenceTd\">\n<pre>message</pre>\n</td>\n<td colspan=\"1\" class=\"confluenceTd\">提示信息（失败时的各种提示信息）</td>\n</tr><tr><td class=\"confluenceTd\">\n<pre>result</pre>\n</td>\n<td class=\"confluenceTd\">null</td>\n</tr></tbody></table></div>\n<p style=\"color:#333333;font-family:Arial, sans-serif;\"><br />\n返回值：</p>\n<div class=\"code panel pdl conf-macro output-block\" style=\"margin:10px 0px;padding:0px;color:#333333;font-family:Arial, sans-serif;\"><div class=\"codeContent panelContent pdl\" style=\"margin:0px;padding:0px;\"><div style=\"margin:0px;padding:0px;\"><div class=\"syntaxhighlighter sh-confluence nogutter java\" style=\"margin:0px;padding:0px;font-size:1em;\"><table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"border:0px;height:auto;margin:0px;padding:0px;width:962px;font-family:Consolas;\" class=\"ke-zeroborder\"><tbody><tr><td class=\"code\" style=\"border:0px;background:0px center;vertical-align:baseline;font-family:Consolas;\"><div class=\"container\" style=\"margin:15px 0px 0px;padding:0px 0px 15px;background:0px center;border:0px;vertical-align:baseline;\"><div class=\"line number1 index0 alt2\" style=\"margin:0px;padding:0px 1em 0px 0px;background:0px center;border:0px;vertical-align:baseline;\">{</div>\n<div class=\"line number2 index1 alt1\" style=\"margin:0px;padding:0px 1em 0px 0px;background:0px center;border:0px;vertical-align:baseline;\">&nbsp;&nbsp;\"ok\":&nbsp;true,</div>\n<div class=\"line number3 index2 alt2\" style=\"margin:0px;padding:0px 1em 0px 0px;background:0px center;border:0px;vertical-align:baseline;\">&nbsp;&nbsp;\"returncode\":&nbsp;0,</div>\n<div class=\"line number4 index3 alt1\" style=\"margin:0px;padding:0px 1em 0px 0px;background:0px center;border:0px;vertical-align:baseline;\">&nbsp;&nbsp;\"message\":&nbsp;\"验证码发送成功\",</div>\n<div class=\"line number5 index4 alt2\" style=\"margin:0px;padding:0px 1em 0px 0px;background:0px center;border:0px;vertical-align:baseline;\">&nbsp;&nbsp;\"result\":&nbsp;null</div>\n<div class=\"line number6 index5 alt1\" style=\"margin:0px;padding:0px 1em 0px 0px;background:0px center;border:0px;vertical-align:baseline;\">}</div>\n</div>\n</td>\n</tr></tbody></table></div>\n</div>\n</div>\n</div>', '');
INSERT INTO `zt_storyspec` VALUES ('27', '1', '补充分销码信息V1.0.0', '<h3 style=\"color:#333333;font-family:Arial, sans-serif;\">接口说明：</h3>\n<p style=\"color:#333333;font-family:Arial, sans-serif;\"><br />\n用于B端手机号、验证码登陆时，用户还没注册，完善分销码，用户名之后保存信息</p>\n<h3 style=\"color:#333333;font-family:Arial, sans-serif;\">接口地址：</h3>\n<p style=\"color:#333333;font-family:Arial, sans-serif;\">/user/saveUser</p>\n<h3 style=\"color:#333333;font-family:Arial, sans-serif;\">请求类型：</h3>\n<p style=\"color:#333333;font-family:Arial, sans-serif;\">post，get均可。</p>\n<h3 style=\"color:#333333;font-family:Arial, sans-serif;\">接口参数：</h3>\n<h3 style=\"color:#333333;font-family:Arial, sans-serif;\">phone&nbsp;&nbsp; –&nbsp;&nbsp; 接受短信的手机号</h3>\n<h3 style=\"color:#333333;font-family:Arial, sans-serif;\">userName&nbsp;&nbsp;&nbsp; – 用户名</h3>\n<h3 style=\"color:#333333;font-family:Arial, sans-serif;\">inviteCode&nbsp;&nbsp;– 上级分销码(6位的字母和数字随机组合)</h3>\n<h3 style=\"color:#333333;font-family:Arial, sans-serif;\">code&nbsp;– 验证通过的验证码，方便二次验证，防止随意调用改接口进行数据保存。</h3>\n<p style=\"color:#333333;font-family:Arial, sans-serif;\"><br />\n请求实例：&nbsp;&nbsp;&nbsp; /user/saveUser?phone=13939098867&amp;userName=123456&amp;inviteCode=abc123</p>\n<div class=\"table-wrap\" style=\"margin:10px 0px 0px;padding:0px;color:#333333;font-family:Arial, sans-serif;\"><table class=\"wrapped confluenceTable\" style=\"margin:0px;\"><tbody><tr><td colspan=\"1\" class=\"confluenceTd\">ok</td>\n<td colspan=\"1\" class=\"confluenceTd\">true(目前不做结果的判断)</td>\n</tr><tr><td class=\"confluenceTd\">\n<pre>returncode</pre>\n</td>\n<td class=\"confluenceTd\">0代表成功，1代表失败</td>\n</tr><tr><td colspan=\"1\" class=\"confluenceTd\">\n<pre>message</pre>\n</td>\n<td colspan=\"1\" class=\"confluenceTd\">提示信息（失败时的各种提示信息）</td>\n</tr><tr><td class=\"confluenceTd\">\n<pre>result</pre>\n</td>\n<td class=\"confluenceTd\">用户id</td>\n</tr></tbody></table></div>\n<p style=\"color:#333333;font-family:Arial, sans-serif;\"><br /></p>\n<p style=\"color:#333333;font-family:Arial, sans-serif;\">返回值：</p>\n<div class=\"table-wrap\" style=\"margin:10px 0px 0px;padding:0px;color:#333333;font-family:Arial, sans-serif;\"><table class=\"wrapped confluenceTable\" style=\"margin:0px;\"><tbody><tr><td class=\"confluenceTd\"><p>{<br />\n&nbsp;&nbsp;\"ok\":&nbsp;true,<br />\n&nbsp;&nbsp;\"returncode\":&nbsp;0,<br />\n&nbsp;&nbsp;\"message\":&nbsp;\"保存成功\",<br />\n&nbsp;&nbsp;\"result\":&nbsp;1<br />\n}</p>\n</td>\n</tr></tbody></table></div>', '');
