div class=\"container\" style=\"margin:15px 0px 0px;padding:0px 0px 15px;background:0px center;border:0px;vertical-align:baseline;\"><div class=\"line number1 index0 alt2\" style=\"margin:0px;padding:0px 1em;background:0px center;border:0px;vertical-align:baseline;\">#zookeeper</div>\n<div class=\"line number2 index1 alt1\" style=\"margin:0px;padding:0px 1em;background:0px center;border:0px;vertical-align:baseline;\">zookeeper.connection=172.31.5.7:2181,172.31.5.8:2181,172.31.5.9:2181</div>\n<div class=\"line number3 index2 alt2\" style=\"margin:0px;padding:0px 1em;background:0px center;border:0px;vertical-align:baseline;\">zookeeper.chRoot=servicecenter</div>\n<div class=\"line number4 index3 alt1\" style=\"margin:0px;padding:0px 1em;background:0px center;border:0px;vertical-align:baseline;\">zookeeper.sessionTimeoutMs=150000</div>\n<div class=\"line number5 index4 alt2\" style=\"margin:0px;padding:0px 1em;background:0px center;border:0px;vertical-align:baseline;\">zookeeper.connectionTimeoutMs=150000</div>\n<div class=\"line number6 index5 alt1\" style=\"margin:0px;padding:0px 1em;background:0px center;border:0px;vertical-align:baseline;\">&nbsp;</div>\n<div class=\"line number7 index6 alt2\" style=\"margin:0px;padding:0px 1em;background:0px center;border:0px;vertical-align:baseline;\">#serviceCenter</div>\n<div class=\"line number8 index7 alt1\" style=\"margin:0px;padding:0px 1em;background:0px center;border:0px;vertical-align:baseline;\">serviceCenter.configNode=/configuration/baseconfig.json</div>\n</div>\n</td>\n</tr></tbody></table></div>\n</div>\n</div>\n</div>\n<p style=\"color:#333333;font-family:Arial, sans-serif;\"><strong>调用示例：</strong></p>\n<div class=\"code panel pdl conf-macro output-block\" style=\"margin:10px 0px;padding:0px;color:#333333;font-family:Arial, sans-serif;\"><div class=\"codeContent panelContent pdl\" style=\"margin:0px;padding:0px;\"><div style=\"margin:0px;padding:0px;\"><div class=\"syntaxhighlighter sh-confluence nogutter java\" style=\"margin:0px;padding:0px;font-size:1em;\"><table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" style=\"border:0px;height:auto;margin:0px;padding:0px;width:1394px;font-family:Consolas;\" class=\"ke-zeroborder\"><tbody><tr><td class=\"code\" style=\"border:0px;background:0px center;vertical-align:baseline;font-family:Consolas;\"><div class=\"container\" style=\"margin:15px 0px 0px;padding:0px 0px 15px;background:0px center;border:0px;vertical-align:baseline;\"><div class=\"line number1 index0 alt2\" style=\"margin:0px;padding:0px 1em 0px 0px;background:0px center;border:0px;vertical-align:baseline;\">ShortMessageRpcServiceProxy.getSingleton().SendSMSImmediatelyForCheXian(\"13811933270\",\"您的验证码为4490，请在10分钟内完成验证。如非本人操作，请忽略本短信。买车险就上chexian.com。\",\"\");</div>\n<div><br /></div>\n</div>\n</td>\n</tr></tbody></table></div>\n</div>\n</div>\n</div>', '');
INSERT INTO `zt_storyspec` VALUES ('31', '1', '国都互联接口文档V1.0', '<p style=\"color:#333333;font-family:Arial, sans-serif;\"><a href=\"http://wiki.chexian.com/download/attachments/1671484/HTTP%E4%B8%8B%E8%A1%8C%E6%8E%A5%E5%8F%A3%E5%8D%8F%E8%AE%AE9007_20161012.pdf?version=1&amp;modificationDate=1509435302000&amp;api=v2\">HTTP下行接口协议9007_20161012.pdf</a></p>\n<div><br /></div>', '');
INSERT INTO `zt_storyspec` VALUES ('32', '1', '百悟科技接口文档V1.1.0', '<div class=\"page-metadata\" style=\"margin:-15px 0px 20px;padding:0px;font-size:12px;color:#707070;font-family:Arial, sans-serif;\"><ul style=\"margin-left:0px;\"><li class=\"page-metadata-modification-info\">由<span class=\"author\">&nbsp;<a href=\"http://wiki.chexian.com/display/~admin\" class=\"url fn confluence-userlink userlink-0\">陈飞</a></span>创建于<a class=\"last-modified\" href=\"http://wiki.chexian.com/pages/viewpreviousversions.action?pageId=1671488\">十月 31, 2017</a></li>\n</ul></div>\n<div class=\"assistive\" style=\"margin:-1px;padding:0px;border:0px;color:#333333;font-family:Arial, sans-serif;\"></div>\n<div class=\"wiki-content\" style=\"margin:0px;padding:0px;color:#333333;font-family:Arial, sans-serif;\"><p><a href=\"http://wiki.chexian.com/download/attachments/1671488/%E7%9F%AD%E4%BF%A1%E5%B9%B3%E5%8F%B0%E6%8E%A5%E5%8F%A3%E6%96%87%E6%A1%A3_V1.1.0.doc?version=1&amp;modificationDate=1509435434000&amp;api=v2\">短信平台接口文档_V1.1.0.doc</a></p>\n</div>', '');
INSERT INTO `zt_storyspec` VALUES ('33', '1', '账号规则', '<p class=\"MsoNormal\" style=\"text-indent:21pt;\">开通账号需提供字段：公司（必填）、城市（必填）、姓名（必填）、性别（选填）、身份证号（选填）、手机号（必填）。一期为开发往数据库插入账号，先不做后台管理账号页面。<span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\">账号名为<b>手机号</b>，开通账号后，生成默认密码：<b><span>anxinbao</span></b>。<span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\"><b>密码规则</b>：不少于<span>6</span>位字符，可包含数字、字母、<span>*&amp;</span>等特殊字符。<span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('34', '1', '登录', '<p class=\"MsoNormal\" style=\"text-indent:21pt;\">如下图所示：<span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\"><br /></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\"><b>特殊说明：<span></span></b></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\">1、手机号不存在时提示：此账号不存在；<span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\">2、手机号存在，密码错误时提示：密码错误；<span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\">3、密码连续输入错误<span>5</span>次，账号当天锁定。连续输入错误第<span>3</span>次时提示：密码错误，还有<span>2</span>次账号将锁定。<span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\">6、<span>token</span>有效期<span>7</span>天。即距上次登录<span>7</span>天时，账号自动退出。<span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('34', '2', '登录', '<p class=\"MsoNormal\" style=\"text-indent:21pt;\">如下图所示：<span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\"><img src=\"{3.png}\" alt=\"\" /></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\"><b>特殊说明：<span></span></b></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\">1、手机号不存在时提示：此账号不存在；<span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\">2、手机号存在，密码错误时提示：密码错误；<span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\">3、密码连续输入错误<span>5</span>次，账号当天锁定。连续输入错误第<span>3</span>次时提示：密码错误，还有<span>2</span>次账号将锁定。<span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\">6、<span>token</span>有效期<span>7</span>天。即距上次登录<span>7</span>天时，账号自动退出。<span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('35', '1', '购买', '<p><img src=\"{4.png}\" alt=\"\" /></p>\n<p><br /></p>\n<p class=\"MsoNormal\">包含轮播图、投保城市、车牌号、车辆性质、<span>4</span>个部分<span></span></p>\n<p class=\"MsoNormal\"><span>&nbsp;</span></p>\n<h4><span>0</span>、轮播图<span></span></h4>\n<p class=\"MsoListParagraph\" style=\"margin-left:42pt;text-indent:-21pt;\">l&nbsp; 轮播图可点击，点击跳转到<span>H5</span>、<span>webview</span>页面<span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent:42pt;\">图、文本内容待补充<span></span></p>\n<p class=\"MsoNormal\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\"><span>P.S. </span>当遇到网络不好需要较长时间加载时，先贴一张占位图<span></span></p>\n<h4><span>1</span>、投保城市<span></span></h4>\n<p class=\"MsoListParagraph\" style=\"margin-left:39pt;text-indent:-21pt;\">l&nbsp; 取自登录账号对应省<span>/</span>市（先略）<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:39pt;text-indent:-21pt;\">l&nbsp; 第一期先启动郑州，默认行驶城市为郑州<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:39pt;text-indent:-21pt;\">l&nbsp; 郑州无法修改<span></span></p>\n<h4><span>2</span>、车牌号<span></span></h4>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:-18pt;\"><span>1）&nbsp; </span>默认值<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:36pt;text-indent:0cm;\">默认为“豫<span>A</span>”<span>&nbsp; </span>，豫不可删除和修改，<span>A</span>可删除</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:36pt;text-indent:0cm;\"><br /></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:-18pt;\"><span>1）&nbsp; </span>输入<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:36pt;text-indent:0cm;\"><span>&nbsp;</span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:39pt;text-indent:-21pt;\">l&nbsp; 键盘<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:39pt;text-indent:0cm;\"><span>iOS</span>为英文<span>+</span>数字二合一键盘；<span>Android</span>和其他系统为系统默认键盘<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:39pt;text-indent:0cm;\"><span>&nbsp;</span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:39pt;text-indent:-21pt;\">l&nbsp; 输入限制<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:57pt;text-indent:-57pt;\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\ni.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>输入类型<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:57pt;text-indent:10.5pt;\"><span>26</span>个英文字母<span>+</span>纯数字；<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:39pt;text-indent:31.5pt;\">其他字符不让输入，如空格<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:57pt;text-indent:-57pt;\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\nii.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>输入字数限制<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:57pt;text-indent:0cm;\">不含首字（豫）输入部分共<span>6</span>字；如：<span>FB1773</span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:57pt;text-indent:0cm;\">超过<span>6</span>字外输入也不展示<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:57pt;text-indent:-57pt;\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\niii.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>英文大小写自动转换<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:57pt;text-indent:0cm;\">英文小写默认转化为大写<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:57pt;text-indent:0cm;\"><span>&nbsp;</span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:39pt;text-indent:-21pt;\">l&nbsp; 输入完展现<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:57pt;text-indent:0cm;\">左对齐，向<span>A</span>靠近<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:57pt;text-indent:0cm;\"><span>&nbsp;</span></p>\n<p class=\"MsoNormal\"><span>&nbsp;</span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:36pt;text-indent:0cm;\"><span>&nbsp;</span></p>\n<h4><span>3</span>、车辆性质<span></span></h4>\n<p class=\"MsoNormal\"><span>&nbsp;</span></p>\n<p class=\"MsoNormal\" style=\"margin-left:18pt;\">本版就默认“非营业<span>-</span>个人用车”，不允许修改，后期再新增其他性质<span></span></p>\n<p class=\"MsoNormal\" style=\"margin-left:18pt;\"><span>&nbsp;</span></p>\n<h4><span>4</span>、网络异常<span></span></h4>\n<p class=\"MsoNormal\" style=\"margin-left:39pt;\"><span>&nbsp;</span></p>\n<p class=\"MsoNormal\" style=\"margin-left:39pt;\">见“九、全局”<span></span></p>\n<h4><span>5</span>、下一步<span></span></h4>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\"><span>&nbsp;</span></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\">车牌号为空时，置灰，不可点击<span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\">不为空，亮起，可点击<span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\"><span>&nbsp;</span></p>\n<h4><span>6</span>、校验和提示<span></span></h4>\n<p class=\"MsoListParagraph\" style=\"margin-left:39pt;text-indent:-21pt;\">l&nbsp; 校验时机：点击“下一步”<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:39pt;text-indent:-21pt;\">l&nbsp; 校验内容：车牌号位数<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:39pt;text-indent:-21pt;\">l&nbsp; 错误定义：车牌号位数不足（输入已限制超长和输入内容情况）<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:39pt;text-indent:-21pt;\">l&nbsp; 提示：<span>toast</span>，<span>5</span>秒，居中，提示内容：请输入正确的车牌号<span></span></p>\n<p><br /></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:36pt;text-indent:0cm;\"><br /></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:36pt;text-indent:0cm;\"><br /></p>\n<p><br /></p>', '');
INSERT INTO `zt_storyspec` VALUES ('36', '1', '去投保', '<p><img src=\"{5.png}\" alt=\"\" /></p>\n<p></p><p class=\"MsoNormal\">包含轮播图、投保城市、车牌号、车辆性质、<span>4</span>个部分<span></span></p>\n', '');
INSERT INTO `zt_storyspec` VALUES ('37', '1', '0、轮播图', '<p class=\"MsoListParagraph\" style=\"margin-left:42pt;text-indent:-21pt;\">l&nbsp; 轮播图可点击，点击跳转到<span>H5</span>、<span>webview</span>页面<span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent:42pt;\">图、文本内容待补充<span></span></p>\n<p class=\"MsoNormal\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\"><span>P.S. </span>当遇到网络不好需要较长时间加载时，先贴一张占位图<span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('38', '1', '1、投保城市', '<p class=\"MsoListParagraph\" style=\"margin-left:39pt;text-indent:-21pt;\">l&nbsp; 取自登录账号对应省<span>/</span>市（先略）<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:39pt;text-indent:-21pt;\">l&nbsp; 第一期先启动郑州，默认行驶城市为郑州<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:39pt;text-indent:-21pt;\">l&nbsp; 郑州无法修改<span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('39', '1', '2、车牌号', '<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:-18pt;\"><span>1）&nbsp; </span>默认值<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:36pt;text-indent:0cm;\">默认为“豫<span>A</span>”<span>&nbsp; </span>，豫不可删除和修改，<span>A</span>可删除<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:36pt;text-indent:0cm;\"><img src=\"{6.png}\" alt=\"\" /></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:36pt;text-indent:0cm;\"></p><p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:-18pt;\"><span>2）&nbsp; </span>输入<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:36pt;text-indent:0cm;\"><span>&nbsp;</span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:39pt;text-indent:-21pt;\">l&nbsp; 键盘<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:39pt;text-indent:0cm;\"><span>iOS</span>为英文<span>+</span>数字二合一键盘；<span>Android</span>和其他系统为系统默认键盘<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:39pt;text-indent:0cm;\"><span>&nbsp;</span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:39pt;text-indent:-21pt;\">l&nbsp; 输入限制<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:57pt;text-indent:-57pt;\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\ni.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>输入类型<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:57pt;text-indent:10.5pt;\"><span>26</span>个英文字母<span>+</span>纯数字；<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:39pt;text-indent:31.5pt;\">其他字符不让输入，如空格<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:57pt;text-indent:-57pt;\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\nii.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>输入字数限制<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:57pt;text-indent:0cm;\">不含首字（豫）输入部分共<span>6</span>字；如：<span>FB1773</span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:57pt;text-indent:0cm;\">超过<span>6</span>字外输入也不展示<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:57pt;text-indent:-57pt;\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\niii.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>英文大小写自动转换<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:57pt;text-indent:0cm;\">英文小写默认转化为大写<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:57pt;text-indent:0cm;\"><span>&nbsp;</span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:39pt;text-indent:-21pt;\">l&nbsp; 输入完展现<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:57pt;text-indent:0cm;\">左对齐，向<span>A</span>靠近<span></span></p>\n', '');
INSERT INTO `zt_storyspec` VALUES ('40', '1', '3、车辆性质', '<p class=\"MsoNormal\" style=\"margin-left:18pt;\">本版就默认“非营业<span>-</span>个人用车”，不允许修改，后期再新增其他性质<span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('41', '1', '4、网络异常', '<p class=\"MsoNormal\" style=\"margin-left:39pt;\">见“九、全局”<span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('42', '1', '5、下一步', '<p class=\"MsoNormal\" style=\"text-indent:21pt;\">车牌号为空时，置灰，不可点击<span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\">不为空，亮起，可点击<span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('43', '1', '6、校验和提示', '<p class=\"MsoListParagraph\" style=\"margin-left:39pt;text-indent:-21pt;\">l&nbsp; 校验时机：点击“下一步”<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:39pt;text-indent:-21pt;\">l&nbsp; 校验内容：车牌号位数<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:39pt;text-indent:-21pt;\">l&nbsp; 错误定义：车牌号位数不足（输入已限制超长和输入内容情况）<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:39pt;text-indent:-21pt;\">l&nbsp; 提示：<span>toast</span>，<span>5</span>秒，居中，提示内容：请输入正确的车牌号<span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('44', '1', '填写信息', '<p><img src=\"{7.png}\" alt=\"\" /></p>\n<p><img src=\"{8.png}\" alt=\"\" /></p>\n<p><br /></p>\n<p></p><p class=\"MsoNormal\">整体说明<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:23.25pt;text-indent:0cm;\">本页包含三个表单部分：“车辆信息”、“车主信息”、“被保人信息”“保险起保日期”<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:23.25pt;text-indent:0cm;\">功能提供：保存功能、去选择（进行下一步）、<span>OCR</span>识别功能<span></span></p>\n\n<p><br /></p>', '');
INSERT INTO `zt_storyspec` VALUES ('45', '1', '1车辆信息', '<p class=\"MsoListParagraph\" style=\"margin-left:39pt;text-indent:0cm;\">包含：车架号、发动机号、初登日期、品牌型号、是否过户、是否按揭、交强险起保日期、商业险起保日期<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:57pt;text-indent:-57pt;\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\ni.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>车架号<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:-21pt;\"><span>A.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>默认展现“请输入<span>17</span>位车架号”<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:-21pt;\"><span>B.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>手动输入<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:-21pt;\"><span>a)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>调用键盘<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:0cm;\"><span>iOS</span>为英文<span>+</span>数字二合一键盘；<span>Android</span>和其他系统为系统默认键盘<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:-21pt;\"><span>b)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>输入限制<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:120pt;text-indent:-21pt;\">Ø&nbsp; 输入类型<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:120pt;text-indent:0cm;\"><span>26</span>个英文字母<span>+</span>纯数字；其他字符输入也不显示<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:120pt;text-indent:-21pt;\">Ø&nbsp; 输入字数限制<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:120pt;text-indent:0cm;\"><span>17</span>位，超出后输入无展现<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:120pt;text-indent:-21pt;\">Ø&nbsp; 英文大小写自动转换<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:120pt;text-indent:0cm;\">小写字母输入自动转换成大写字母<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:-21pt;\"><span>c)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>输入完成显示<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:120pt;text-indent:-21pt;\">Ø&nbsp; 当第一个输入进去，自动清掉默认展现值；<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:120pt;text-indent:-21pt;\">Ø&nbsp; 右对齐<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:120pt;text-indent:-21pt;\">Ø&nbsp; 折行<span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent:126pt;\">在限定展现范围内（以UI图为准），如遇屏幕太小，则自动折行<span></span></p>\n<p class=\"MsoNormal\"><span>&nbsp;</span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:57pt;text-indent:-57pt;\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\nii.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>发动机号<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:-21pt;\"><span>A.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>无默认展现<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:-21pt;\"><span>B.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>手动输入<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:-21pt;\"><span>a)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>调用键盘<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:0cm;\"><span>iOS</span>为英文<span>+</span>数字二合一键盘；<span>Android</span>和其他系统为系统默认键盘<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:-21pt;\"><span>b)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>输入限制<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:120pt;text-indent:-21pt;\">Ø&nbsp; 输入类型<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:120pt;text-indent:0cm;\"><span>26</span>个英文字母<span>+</span>纯数字；其他字符输入也不显示<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:120pt;text-indent:-21pt;\">Ø&nbsp; 输入字数限制<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:120pt;text-indent:0cm;\">最长13位，超出后输入无展现<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:120pt;text-indent:-21pt;\">Ø&nbsp; 英文大小写自动转换<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:120pt;text-indent:0cm;\">小写字母输入自动转换成大写字母<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:-21pt;\"><span>c)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>输入完成显示<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:120pt;text-indent:-21pt;\">Ø&nbsp; 当第一个输入进去，自动清掉默认展现值；<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:120pt;text-indent:-21pt;\">Ø&nbsp; 右对齐<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:120pt;text-indent:-21pt;\">Ø&nbsp; 折行<span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent:126pt;\">在限定展现范围内，如遇屏幕太小，则自动折行<span></span></p>\n<p class=\"MsoNormal\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:0cm;\"><span>&nbsp;</span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:57pt;text-indent:-57pt;\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\niii.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>初登日期<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:-21pt;\"><span>A.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>默认展现：“请选择”<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:-21pt;\"><span>B.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>点击通栏，触发选择控件，样式为如下地址：（以<span>iOS</span>为例）<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:0cm;\"><span><a href=\"https://modao.cc/workspace/apps/pB0601502EE1500950458258/preview\">https://modao.cc/workspace/apps/pB0601502EE1500950458258/preview</a></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:0cm;\"><span></span><img src=\"{9.png}\" alt=\"\" />部分<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:-21pt;\"><span>C.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>选择内容：当天以前数<span>15</span>年，调起后默认当天<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:-21pt;\"><span>D.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>选择完成后，显示样式如下（年<span>-</span>月<span>-</span>日）：<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:-21pt;\"><img src=\"{10.png}\" alt=\"\" /></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:0cm;\"><span></span><span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:57pt;text-indent:-57pt;\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\niv.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>品牌型号<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:-21pt;\"><span>A.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>默认值：请选择<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:-21pt;\"><span>B.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>点击通栏，触发搜索，样式地址如下：<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:0cm;\"><span>https://modao.cc/workspace/apps/pB0601502EE1500950458258/preview</span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:0cm;\"><span>&nbsp;<img src=\"{11.png}\" alt=\"\" /></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:0cm;\"><span></span><span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:-21pt;\"><span>a)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>默认样式：填写示例<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:-21pt;\"><span>b)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>输入键盘：统一调系统默认键盘<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:-21pt;\"><span>c)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>搜索触发：点击搜索图标<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:-21pt;\"><span>d)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>搜索结果<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:0cm;\">展现：年代款+厂牌型号+新车购置价</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:0cm;\">如：201011 北京奔驰牌SLN849 ¥480888<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:-21pt;\"><span>e)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>选择结果<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:0cm;\">通栏触发选择，跳转至“填写信息”页面<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:-21pt;\"><span>f)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>选择完成<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:0cm;\">展现“厂牌型号”，超长自动折段<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:0cm;\">如：北京奔驰牌<span>SLN849</span></p>\n<p class=\"MsoNormal\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:57pt;text-indent:-57pt;\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\nv.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>是否过户<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:-21pt;\"><span>A.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>开关默认：开启<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:-21pt;\"><span>B.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>联动显示过户日期，初始显示“请选择过户日期”，点击通栏触发选择日期控件，显示选择结果为：“年<span>-</span>月<span>-</span>日”，如“<span>2012-02-01</span>”，调起后默认选项为当天<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:-21pt;\"><span>C.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>开关关闭后，收起过户日期，原先若有选择日期也置于无效<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:0cm;\"><span>&nbsp;</span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:0cm;\"><span>&nbsp;</span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:57pt;text-indent:-57pt;\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\nvi.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>是否按揭<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:57pt;text-indent:0cm;\"><span>A</span>、开关默认：开启<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:57pt;text-indent:0cm;\"><span>B</span>、联动显示“第一受益人”，默认第一受益人为“上海融资租赁有限公司”（目前只有郑州，以后会分公司分地区分业务线），用户可修改第一受益人，<span><br /></span>点击通栏调系统默认键盘；输入位数最长<span>15</span>位，超长自动折行<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:57pt;text-indent:0cm;\"><span>&nbsp;</span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:57pt;text-indent:-57pt;\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\nvii.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>交强险起保日期<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:57pt;text-indent:0cm;\">默认显示“请选择”，通栏可点，调用选择控件，年月日选项，选择范围：明天起至<span>90</span>自然日后的年月日选项，如今天是<span>20170101</span>，那么选项为，<span>20170102-20170401</span>区间<span></span></p>\n调起控件后默认选项为当天', '');
INSERT INTO `zt_storyspec` VALUES ('46', '1', '2保险起保日期', '<p class=\"MsoListParagraph\" style=\"margin-left:56.45pt;text-indent:-21pt;\"><span>A.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>商业险起保日期<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:80.85pt;text-indent:-21pt;\">Ø&nbsp; 立即生效：默认开启<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:80.85pt;text-indent:-21pt;\"><img src=\"{12.png}\" alt=\"\" /></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:39pt;text-indent:0cm;\"><span></span><span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:57pt;text-indent:0cm;\">预约生效时间：无默认选项，但是调起选项以后默认第一选项为21:00，全部选项为9：00-21:00的整点</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:80.85pt;text-indent:-21pt;\">Ø&nbsp; 立即生效，关闭<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:57pt;text-indent:0cm;\">预约生效时间更换成“生效时间”，无默认选择，初始文案为：“请选择生效时间”，选择选项为，明天起至<span>90</span>自然日后的年月日选项，如今天是<span>20170101</span>，那么选项为，<span>20170102-20170401</span>区间<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:57pt;text-indent:0cm;\"><span>&nbsp;</span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:57pt;text-indent:0cm;\">选择完成后，保险起期右边复制一份精确到分的选择结果<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:57pt;text-indent:0cm;\">展示样式为：年<span>-</span>月<span>-</span>日<span>-</span>时<span>-</span>分，复制的这份不能修改，修改放在开关按钮下方的选择控件中<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:57pt;text-indent:0cm;\">立即生效是：当天日期<span>+</span>用户选择预约生效时分<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:57pt;text-indent:0cm;\">非立即生效时：用户选择时间（年月日）<span>+00:00</span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:57pt;text-indent:0cm;\"><span><img src=\"{13.png}\" alt=\"\" /><br /></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:57pt;text-indent:0cm;\"><span></span><span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('47', '1', '3.	车主信息', '<p class=\"MsoListParagraph\" style=\"margin-left:39pt;text-indent:0cm;\">包含：车主姓名、车主身份证、车主手机<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:77.7pt;text-indent:-21pt;\"><span>A.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>车主姓名<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:77.7pt;text-indent:0cm;\">调用系统默认键盘，输入位数控制<span>15</span>位，超出不显示，超长折行<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:77.7pt;text-indent:-21pt;\"><span>B.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>车主身份证<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:77.7pt;text-indent:0cm;\"><span>iOS</span>调用英文<span>+</span>数字键盘、其他系统调用默认键盘；输入位数控制<span>18</span>位，超出不显示，超长折行；只能输入英文和数字，其他的输入不显示<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:77.7pt;text-indent:-21pt;\"><span>C.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>手机号码<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:77.7pt;text-indent:0cm;\"><span>iOS</span>调用数字键盘，其他系统调用系统默认键盘；输入位数控制<span>11</span>位，只能输入数字，超长折行；<span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('48', '1', '4.	被保人信息', '<p class=\"MsoListParagraph\" style=\"margin-left:77.7pt;text-indent:-21pt;\"><span>A.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>开关默认打开<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:77.7pt;text-indent:-21pt;\"><span>B.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>开关关闭后，输入部分包含：被保人姓名、身份证号、手机号码<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:77.7pt;text-indent:0cm;\"><b>逻辑同“车主部分”<span></span></b></p>', '');
INSERT INTO `zt_storyspec` VALUES ('49', '1', 'OCR照片识别', '<p class=\"MsoListParagraph\" style=\"margin-left:39pt;text-indent:-21pt;\">l&nbsp; 操作流程</p>\n<p class=\"MsoNormal\" style=\"text-indent:42pt;\">按钮点击<span>-</span>选择上传方式<span>-</span>（访问照片授权）<span>-</span>选择照片<span>-</span>结果自动识别和显示<span>-</span>（修改）<span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\"><span>&nbsp;&nbsp;&nbsp; </span>相关页面说明如原型地址中的<span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\"><span></span><span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\"><span>&nbsp;&nbsp;&nbsp;<img src=\"{14.png}\" alt=\"\" /></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:39pt;text-indent:-21pt;\">l&nbsp; 识别对象<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:39pt;text-indent:0cm;\">行驶本、身份证<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:39pt;text-indent:-21pt;\">l&nbsp; 照片要求<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:39pt;text-indent:0cm;\">格式先不做要求，大小控制在<span>10M</span>（含）以下，超过<span>10M toast</span>提示“照片不能大于<span>10M</span>”<span>5</span>秒<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:39pt;text-indent:-21pt;\">l&nbsp; 识别内容<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:60pt;text-indent:-21pt;\"><span>A.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>行驶本<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:60pt;text-indent:0cm;\">车架号、发动机号、初登日期、品牌型号<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:60pt;text-indent:-21pt;\"><span>B.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>身份证<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:60pt;text-indent:0cm;\">姓名、身份证编号<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:39pt;text-indent:-21pt;\">l&nbsp; 识别结果显示<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:39pt;text-indent:0cm;\">直接覆盖在对应位置，可修改<span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('50', '1', '保存', '<p class=\"MsoListParagraph\" style=\"margin-left:39pt;text-indent:-21pt;\">l&nbsp; 信息都不<a></a><a>为空</a>（可看“<span>4</span>、信息校验和提示”中的为空定义）时，保存按钮亮起<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:39pt;text-indent:-21pt;\">l&nbsp; 信息有<span><a>为空</a></span>时，保存按钮置灰<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:39pt;text-indent:-21pt;\">l&nbsp; 保存结果<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:39pt;text-indent:0cm;\">需要先校验信息通过（参见“信息校验和提示”部分），校验不通过无法有保存结果<span>&amp;</span>提示对应错误<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:60pt;text-indent:-21pt;\"><span>A.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>成功：校验通过，保存成功如图提示用户，动作选项顾名思义；保存成功后在“订单中心”暂存栏里展现<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:60pt;text-indent:0cm;\"><span></span><span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:60pt;text-indent:0cm;\"><span><img src=\"{15.png}\" alt=\"\" />&nbsp;</span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:60pt;text-indent:-21pt;\"><span>B.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>失败：<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:60pt;text-indent:-21pt;\"><img src=\"{16.png}\" alt=\"\" /></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:60pt;text-indent:0cm;\"><span></span><span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:60pt;text-indent:0cm;\">动作选项顾名思义，再试一次如果还是失败继续展现上图，无策略控制<span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('51', '1', '去选择险种', '<p class=\"MsoListParagraph\" style=\"margin-left:49.5pt;text-indent:-21pt;\">l&nbsp; 信息都不<span><a>为空</a></span>时，按钮亮起；信息有为空时，保存按钮置灰<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:49.5pt;text-indent:-21pt;\">l&nbsp; 信息校验通过后，跳转到选择险种页面<span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('52', '1', '信息校验和提示', '<p class=\"MsoListParagraph\" style=\"margin-left:39pt;text-indent:-21pt;\">l&nbsp; 校验时机：点击“保存”<span>or</span>“去选择险种”按钮<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:39pt;text-indent:-21pt;\">l&nbsp; 校验内容<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:39pt;text-indent:0cm;\"><span>&nbsp;</span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:70.65pt;text-indent:-21pt;\"><span>A.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>为空验证：<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:70.65pt;text-indent:0cm;\">除了“关闭下的过户”、“关闭下的按揭”、“开关开启的被保险人”这几个情况外，其他的情况都需要做为空校验；<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:70.65pt;text-indent:0cm;\"><span>toast</span>提示<span>5</span>秒“<b>名称</b><b>+</b><b>不能为空</b>”，如车架号不能为空；当只有为空错误且有<b>多个为空时，按照页面从上到下，只提示第一个；</b><span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:70.65pt;text-indent:-21pt;\"><span>B.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>验证正确性<span></span></p>\n<table class=\"MsoTableGrid\" border=\"1\" cellspacing=\"0\" cellpadding=\"0\" style=\"border:none;\"><tbody><tr><td width=\"94\" valign=\"top\" style=\"background:#4F81BD;\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span style=\"font-family:\'宋体\';color:#FFFFFF;\">验证对象</span><span style=\"color:#FFFFFF;\"></span></p>\n</td>\n<td width=\"132\" valign=\"top\" style=\"background:#4F81BD;\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span style=\"font-family:\'宋体\';color:#FFFFFF;\">正确信息</span><span style=\"color:#FFFFFF;\"></span></p>\n</td>\n<td width=\"104\" valign=\"top\" style=\"background:#4F81BD;\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span style=\"font-family:\'宋体\';color:#FFFFFF;\">非正确信息</span><span style=\"color:#FFFFFF;\"></span></p>\n</td>\n<td width=\"113\" valign=\"top\" style=\"background:#4F81BD;\"><p class=\"MsoListParagraph\"><span style=\"font-family:\'宋体\';color:#FFFFFF;\">提示</span><span style=\"color:#FFFFFF;\"></span></p>\n<p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span style=\"color:#FFFFFF;\">Toast,5</span><span style=\"font-family:\'宋体\';color:#FFFFFF;\">秒，居中</span><span style=\"color:#FFFFFF;\"></span></p>\n</td>\n<td width=\"88\" valign=\"top\" style=\"background:#4F81BD;\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span style=\"font-family:\'宋体\';color:#FFFFFF;\">备注</span><span style=\"color:#FFFFFF;\"></span></p>\n</td>\n</tr><tr><td width=\"94\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span>&nbsp;</span></p>\n<p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span>&nbsp;</span></p>\n<p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span>&nbsp;</span></p>\n<p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span>&nbsp;</span></p>\n<p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span style=\"font-family:\'宋体\';\">车架号</span><span></span></p>\n</td>\n<td width=\"132\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span>1</span><span style=\"font-family:\'宋体\';\">）</span><span>17</span><span style=\"font-family:\'宋体\';\">位；</span><span></span></p>\n<p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span>2</span><span style=\"font-family:\'宋体\';\">）不能含</span><span>I</span><span style=\"font-family:\'宋体\';\">、</span><span>O</span><span style=\"font-family:\'宋体\';\">、</span><span>Q</span><span style=\"font-family:\'宋体\';\">字母</span><span></span></p>\n<p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span>3</span><span style=\"font-family:\'宋体\';\">）英文</span><span>+</span><span style=\"font-family:\'宋体\';\">数字组合</span><span></span></p>\n</td>\n<td width=\"104\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span>1</span><span style=\"font-family:\'宋体\';\">）少于</span><span>17</span><span style=\"font-family:\'宋体\';\">位</span><span></span></p>\n<p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span>2</span><span style=\"font-family:\'宋体\';\">）包含</span><span>I</span><span style=\"font-family:\'宋体\';\">、</span><span>O</span><span style=\"font-family:\'宋体\';\">、</span><span>Q</span><span style=\"font-family:\'宋体\';\">字母</span><span></span></p>\n<p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span>&nbsp;</span></p>\n</td>\n<td width=\"113\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span>1</span><span style=\"font-family:\'宋体\';\">）车架号不能低于</span><span>17</span><span style=\"font-family:\'宋体\';\">位</span><span></span></p>\n<p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span>2</span><span style=\"font-family:\'宋体\';\">）车架号不能含</span><span>I</span><span style=\"font-family:\'宋体\';\">、</span><span>O</span><span style=\"font-family:\'宋体\';\">、</span><span>Q</span><span style=\"font-family:\'宋体\';\">等字母</span><span></span></p>\n<p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span>&nbsp;</span></p>\n</td>\n<td width=\"88\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span style=\"font-family:\'宋体\';\">输入时已做超</span><span>17</span><span style=\"font-family:\'宋体\';\">位限制和非英文和数字限制；</span><span></span></p>\n<p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span style=\"font-family:\'宋体\';\">多种错误时，只提示数字小的</span><span></span></p>\n<p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span>&nbsp;</span></p>\n<p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span>&nbsp;</span></p>\n</td>\n</tr><tr><td width=\"94\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span style=\"font-family:\'宋体\';\">发动机号</span><span></span></p>\n</td>\n<td width=\"132\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span>1</span><span style=\"font-family:\'宋体\';\">）</span><span>4-16</span><span style=\"font-family:\'宋体\';\">位</span><span></span></p>\n<p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span>2</span><span style=\"font-family:\'宋体\';\">）数字和英文组合</span><span></span></p>\n</td>\n<td width=\"104\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span style=\"font-family:\'宋体\';background:#FFFF00;\">低于</span><span style=\"background:#FFFF00;\">4</span><span style=\"font-family:\'宋体\';background:#FFFF00;\">位</span><span style=\"background:#FFFF00;\"></span></p>\n<p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span style=\"background:#FFFF00;\"></span></p>\n</td>\n<td width=\"113\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span style=\"font-family:\'宋体\';\">请输入正确的发动机号</span><span></span></p>\n</td>\n<td width=\"88\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span style=\"font-family:\'宋体\';\">输入时已限制非数字和非英文；超</span><span>13</span><span style=\"font-family:\'宋体\';\">位限制</span><span></span></p>\n</td>\n</tr><tr><td width=\"94\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span style=\"font-family:\'宋体\';\">初登日期</span><span></span></p>\n</td>\n<td width=\"132\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span style=\"font-family:\'宋体\';\">无</span><span></span></p>\n</td>\n<td width=\"104\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span style=\"font-family:\'宋体\';\">无</span><span style=\"background:#FFFF00;\"></span></p>\n</td>\n<td width=\"113\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span style=\"font-family:\'宋体\';\">无</span><span></span></p>\n</td>\n<td width=\"88\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span>&nbsp;</span></p>\n</td>\n</tr><tr><td width=\"94\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span style=\"font-family:\'宋体\';\">品牌型号</span><span></span></p>\n</td>\n<td width=\"132\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span style=\"font-family:\'宋体\';\">无</span><span></span></p>\n</td>\n<td width=\"104\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span style=\"background:#FFFF00;\"></span></p>\n</td>\n<td width=\"113\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span>&nbsp;</span></p>\n</td>\n<td width=\"88\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span>&nbsp;</span></p>\n</td>\n</tr><tr><td width=\"94\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span style=\"font-family:\'宋体\';\">是否过户</span><span></span></p>\n</td>\n<td width=\"132\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span>1</span><span style=\"font-family:\'宋体\';\">）不过户</span><span></span></p>\n<p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span>2</span><span style=\"font-family:\'宋体\';\">）过户了并选择了日期</span><span></span></p>\n</td>\n<td width=\"104\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span style=\"font-family:\'宋体\';\">过户了但未选择日期</span><span style=\"background:#FFFF00;\"></span></p>\n</td>\n<td width=\"113\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span>&nbsp;</span><span style=\"font-family:\'宋体\';\">“请选择过户日期”</span><span></span></p>\n</td>\n<td width=\"88\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span>&nbsp;</span></p>\n</td>\n</tr><tr><td width=\"94\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span style=\"font-family:\'宋体\';\">是否按揭</span><span></span></p>\n</td>\n<td width=\"132\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span>1</span><span style=\"font-family:\'宋体\';\">）不按揭</span><span></span></p>\n<p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span>2</span><span style=\"font-family:\'宋体\';\">）按揭了写了受益人名字且名字为正确（</span><span>2-15</span><span style=\"font-family:\'宋体\';\">位）</span><span></span></p>\n</td>\n<td width=\"104\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span>1</span><span style=\"font-family:\'宋体\';\">）按揭未写过受益人名字</span><span></span></p>\n<p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span>2</span><span style=\"font-family:\'宋体\';\">）按揭写了名字但是长度</span><span>=1</span><span style=\"font-family:\'宋体\';\">个汉字</span><span></span></p>\n</td>\n<td width=\"113\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span>1</span><span style=\"font-family:\'宋体\';\">）请输入第一受益人</span><span></span></p>\n<p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span>2</span><span style=\"font-family:\'宋体\';\">）请填写正确的受益人名字</span><span></span></p>\n</td>\n<td width=\"88\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span style=\"font-family:\'宋体\';\">输入时做了长度超长限制；</span><span></span></p>\n</td>\n</tr><tr><td width=\"94\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span style=\"font-family:\'宋体\';\">交强险起保日期</span><span></span></p>\n</td>\n<td width=\"132\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span style=\"font-family:\'宋体\';\">选择了日期</span><span></span></p>\n</td>\n<td width=\"104\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span style=\"font-family:\'宋体\';\">不选</span><span></span></p>\n</td>\n<td width=\"113\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span style=\"font-family:\'宋体\';\">请选择交强险起保日期</span><span></span></p>\n</td>\n<td width=\"88\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span>&nbsp;</span></p>\n</td>\n</tr><tr><td width=\"94\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span style=\"font-family:\'宋体\';\">商业险起保日期</span><span></span></p>\n</td>\n<td width=\"132\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span style=\"font-family:\'宋体\';\">选择了日期</span><span></span></p>\n</td>\n<td width=\"104\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span style=\"font-family:\'宋体\';\">不选</span><span></span></p>\n</td>\n<td width=\"113\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span style=\"font-family:\'宋体\';\">请选择商业险起保日期</span><span></span></p>\n</td>\n<td width=\"88\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span>&nbsp;</span></p>\n</td>\n</tr><tr><td width=\"94\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span style=\"font-family:\'宋体\';\">车主姓名</span><span></span></p>\n</td>\n<td width=\"132\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span>4-30</span><span style=\"font-family:\'宋体\';\">个字节</span><span></span></p>\n<p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span>&nbsp;</span></p>\n</td>\n<td width=\"104\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span style=\"font-family:\'宋体\';\">少于</span><span>4</span><span style=\"font-family:\'宋体\';\">个字节（其实就是一个字）</span><span></span></p>\n</td>\n<td width=\"113\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span>&nbsp;</span><span style=\"font-family:\'宋体\';\">“请填写正确的车主姓名”</span><span></span></p>\n</td>\n<td width=\"88\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span style=\"font-family:\'宋体\';\">输入时做了长度超长限制；</span><span></span></p>\n</td>\n</tr><tr><td width=\"94\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span style=\"font-family:\'宋体\';\">车主身份证</span><span></span></p>\n</td>\n<td width=\"132\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span>1</span><span style=\"font-family:\'宋体\';\">）</span><span>18</span><span style=\"font-family:\'宋体\';\">位</span><span></span></p>\n<p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span>2</span><span style=\"font-family:\'宋体\';\">）字母和数字组合</span><span></span></p>\n</td>\n<td width=\"104\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span style=\"font-family:\'宋体\';\">低于</span><span>18</span><span style=\"font-family:\'宋体\';\">位</span><span></span></p>\n</td>\n<td width=\"113\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span style=\"font-family:\'宋体\';\">“请输入正确的车主身份证”</span><span></span></p>\n</td>\n<td width=\"88\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span style=\"font-family:\'宋体\';\">输入时做了长度超长限制和非字母非数字控制</span><span></span></p>\n</td>\n</tr><tr><td width=\"94\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span style=\"font-family:\'宋体\';\">车主手机</span><span></span></p>\n</td>\n<td width=\"132\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span>1</span><span style=\"font-family:\'宋体\';\">）</span><span>11</span><span style=\"font-family:\'宋体\';\">位</span><span></span></p>\n<p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span>2</span><span style=\"font-family:\'宋体\';\">）只能是纯数字</span><span></span></p>\n</td>\n<td width=\"104\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span style=\"font-family:\'宋体\';\">低于</span><span>11</span><span style=\"font-family:\'宋体\';\">位</span><span></span></p>\n</td>\n<td width=\"113\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span style=\"font-family:\'宋体\';\">“请输入正确的车主手机”</span><span></span></p>\n</td>\n<td width=\"88\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span style=\"font-family:\'宋体\';\">输入限制了只能输入数字和长度控制</span><span></span></p>\n</td>\n</tr><tr><td width=\"94\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span style=\"font-family:\'宋体\';\">被保险人</span><span></span></p>\n</td>\n<td width=\"132\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span>1</span><span style=\"font-family:\'宋体\';\">）开关开启</span><span></span></p>\n<p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span>2</span><span style=\"font-family:\'宋体\';\">）开关关闭后输入的信息有误</span><span></span></p>\n</td>\n<td width=\"104\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span style=\"font-family:\'宋体\';\">参照“车主名字”“车主身份证”“车主手机”</span><span></span></p>\n</td>\n<td width=\"113\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span style=\"font-family:\'宋体\';\">同理，但是将“车主”替换成“被保人”</span><span></span></p>\n</td>\n<td width=\"88\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span>&nbsp;</span></p>\n</td>\n</tr></tbody></table><p class=\"MsoListParagraph\" style=\"margin-left:70.65pt;text-indent:0cm;\"><span>&nbsp;</span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:70.65pt;text-indent:-21pt;\"><span>C.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>当<span>A</span>和<span>B</span>两种情况都存在时<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:70.65pt;text-indent:0cm;\"><span>&nbsp;</span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:70.65pt;text-indent:0cm;\">只提示一条原则，优先级<span>A&gt;B,</span>只提示<span>A</span>中在位置最靠上的<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:70.65pt;text-indent:0cm;\"><span>&nbsp;</span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:47.35pt;text-indent:-21pt;\">l&nbsp; 提示方式<span></span></p>\nToast\n提示，5秒，居中', '');
INSERT INTO `zt_storyspec` VALUES ('53', '1', '整体说明:险种分为商业险和交强险', '<p><img src=\"{17.png}\" alt=\"\" /></p>\n<p><img src=\"{18.png}\" alt=\"\" /></p>\n<p></p><p class=\"MsoNormal\">险种分为商业险和交强险<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:21pt;text-indent:-21pt;\">l&nbsp; 开关初始值<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:21pt;text-indent:0cm;\">商业险开关为默认打开，交强险开关默认关闭（上图交强打开仅仅为展示开启内容）<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:21pt;text-indent:-21pt;\">l&nbsp; 险种选择初始值<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:21pt;text-indent:0cm;\">所有险种（所有险种如上图和下方表格）初始没有默认选择，但是险种的保额有默认值（见下方表格），初始样式如“盗抢险”，<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:21pt;text-indent:0cm;\"><img src=\"{19.png}\" alt=\"\" /></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:21pt;text-indent:0cm;\"><span></span><span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:21pt;text-indent:-21pt;\">l&nbsp; 操作说明<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:21pt;text-indent:0cm;\">所有险种的操作最初开始只有右侧的对勾可进行操作，<span></span><span> <img src=\"{20.png}\" alt=\"\" /></span>，险种其他区域均不可操作，当点击了<img src=\"{21.png}\" alt=\"\" /><span></span>选择了该险种后，对勾变红<img src=\"{22.png}\" alt=\"\" /><span></span>表示选中（再次点击表示取消同时颜色变回去），默认该险种的不计（若有）选中，保额为默认保额（见下方表格），<span>and</span>不计可取消，效果如下<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:21pt;text-indent:0cm;\"><img src=\"{23.png}\" alt=\"\" /></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:21pt;text-indent:0cm;\"><img src=\"{24.png}\" alt=\"\" /></p>\n<p class=\"MsoNormal\" style=\"text-indent:31.5pt;\"><span></span><span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent:31.5pt;\"><span></span><span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:21pt;text-indent:-21pt;\">l&nbsp; 险种互斥规则<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:21pt;text-indent:0cm;\">除了三者、车上人员（司机和乘客）、盗抢外，其他的<b>商业险</b>都是车损的附加险</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:21pt;text-indent:0cm;\">如果用户没有购买车损险，而试图去购买除了三者、车上人员（司机和乘客）、盗抢外的其他商业险，toast居中5秒提示用户：“请先投保车损险”<span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent:31.5pt;\"><span>&nbsp;</span></p>\n<table class=\"MsoTableGrid\" border=\"1\" cellspacing=\"0\" cellpadding=\"0\" style=\"border:none;\"><tbody><tr><td width=\"114\" valign=\"top\" style=\"background:#4F81BD;\"><p class=\"MsoNormal\"><span style=\"font-family:\'宋体\';color:#FFFFFF;\">险种类别</span><span style=\"color:#FFFFFF;\"></span></p>\n</td>\n<td width=\"114\" valign=\"top\" style=\"background:#4F81BD;\"><p class=\"MsoNormal\"><span style=\"font-family:\'宋体\';color:#FFFFFF;\">险种名称</span><span style=\"color:#FFFFFF;\"></span></p>\n</td>\n<td width=\"114\" valign=\"top\" style=\"background:#4F81BD;\"><p class=\"MsoNormal\"><span style=\"font-family:\'宋体\';color:#FFFFFF;\">是否有不计</span><span style=\"color:#FFFFFF;\"></span></p>\n</td>\n<td width=\"114\" valign=\"top\" style=\"background:#4F81BD;\"><p class=\"MsoNormal\"><span style=\"font-family:\'宋体\';color:#FFFFFF;\">保额选项</span><span style=\"color:#FFFFFF;\"></span></p>\n</td>\n<td width=\"114\" valign=\"top\" style=\"background:#4F81BD;\"><p class=\"MsoNormal\"><span style=\"font-family:\'宋体\';color:#FFFFFF;\">默认保额选项</span><span style=\"color:#FFFFFF;\"></span></p>\n</td>\n</tr><tr><td width=\"114\" rowspan=\"11\" valign=\"top\"><p class=\"MsoNormal\"><span>&nbsp;</span></p>\n<p class=\"MsoNormal\"><span>&nbsp;</span></p>\n<p class=\"MsoNormal\"><span>&nbsp;</span></p>\n<p class=\"MsoNormal\"><span>&nbsp;</span></p>\n<p class=\"MsoNormal\"><span>&nbsp;</span></p>\n<p class=\"MsoNormal\"><span>&nbsp;</span></p>\n<p class=\"MsoNormal\"><span>&nbsp;</span></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\"><span style=\"font-family:\'宋体\';\">商业险</span><span></span></p>\n</td>\n<td width=\"114\" valign=\"top\"><p class=\"MsoNormal\"><span style=\"font-family:\'宋体\';\">车损险</span><span></span></p>\n</td>\n<td width=\"114\" valign=\"top\"><p class=\"MsoNormal\" style=\"text-indent:21pt;\"><span style=\"font-family:\'宋体\';\">有</span><span></span></p>\n</td>\n<td width=\"114\" valign=\"top\"><p class=\"MsoNormal\" style=\"text-indent:10.5pt;\"><span style=\"font-family:\'宋体\';\">接口给</span><span></span></p>\n</td>\n<td width=\"114\" valign=\"top\"><p class=\"MsoNormal\"><span>&nbsp;</span><span style=\"font-family:\'宋体\';\">接口给的保额</span><span></span></p>\n</td>\n</tr><tr><td width=\"114\" valign=\"top\"><p class=\"MsoNormal\"><span style=\"font-family:\'宋体\';\">三者险</span><span></span></p>\n</td>\n<td width=\"114\" valign=\"top\"><p class=\"MsoNormal\"><span>&nbsp;&nbsp;&nbsp; </span><span style=\"font-family:\'宋体\';\">有</span><span></span></p>\n</td>\n<td width=\"114\" valign=\"top\"><p class=\"MsoNormal\"><span>&nbsp; 5</span><span style=\"font-family:\'宋体\';\">万、</span><span>10</span><span style=\"font-family:\'宋体\';\">万、</span><span>15</span><span style=\"font-family:\'宋体\';\">万、</span><span>20</span><span style=\"font-family:\'宋体\';\">万、</span><span>30</span><span style=\"font-family:\'宋体\';\">万、</span><span>50</span><span style=\"font-family:\'宋体\';\">万、</span><span>100</span><span style=\"font-family:\'宋体\';\">万、</span><span>150</span><span style=\"font-family:\'宋体\';\">万、</span><span>200</span><span style=\"font-family:\'宋体\';\">万</span><span></span></p>\n</td>\n<td width=\"114\" valign=\"top\"><p class=\"MsoNormal\"><span>&nbsp;</span></p>\n<p class=\"MsoNormal\"><span>&nbsp;&nbsp;\n  20</span><span style=\"font-family:\'宋体\';\">万</span><span></span></p>\n</td>\n</tr><tr><td width=\"114\" valign=\"top\"><p class=\"MsoNormal\"><span style=\"font-family:\'宋体\';\">车上人员</span><span>-</span><span style=\"font-family:\'宋体\';\">司机险</span><span></span></p>\n</td>\n<td width=\"114\" valign=\"top\"><p class=\"MsoNormal\"><span>&nbsp;&nbsp;&nbsp; </span><span style=\"font-family:\'宋体\';\">有</span><span></span></p>\n</td>\n<td width=\"114\" valign=\"top\"><p class=\"MsoNormal\"><span>1</span><span style=\"font-family:\'宋体\';\">万</span><span>/</span><span style=\"font-family:\'宋体\';\">座、</span><span>2</span><span style=\"font-family:\'宋体\';\">万</span><span>/</span><span style=\"font-family:\'宋体\';\">座、</span><span>5</span><span style=\"font-family:\'宋体\';\">万</span><span>/</span><span style=\"font-family:\'宋体\';\">座、</span><span>10</span><span style=\"font-family:\'宋体\';\">万</span><span>/</span><span style=\"font-family:\'宋体\';\">座</span><span></span></p>\n</td>\n<td width=\"114\" valign=\"top\"><p class=\"MsoNormal\" style=\"text-indent:21pt;\"><span>1</span><span style=\"font-family:\'宋体\';\">万</span><span>/</span><span style=\"font-family:\'宋体\';\">座</span><span></span></p>\n</td>\n</tr><tr><td width=\"114\" valign=\"top\"><p class=\"MsoNormal\"><span style=\"font-family:\'宋体\';\">车上人员</span><span>-</span><span style=\"font-family:\'宋体\';\">乘客险</span><span></span></p>\n</td>\n<td width=\"114\" valign=\"top\"><p class=\"MsoNormal\" style=\"text-indent:21pt;\"><span style=\"font-family:\'宋体\';\">有</span><span></span></p>\n</td>\n<td width=\"114\" valign=\"top\"><p class=\"MsoNormal\"><span>1</span><span style=\"font-family:\'宋体\';\">万</span><span>/</span><span style=\"font-family:\'宋体\';\">座、</span><span>2</span><span style=\"font-family:\'宋体\';\">万</span><span>/</span><span style=\"font-family:\'宋体\';\">座、</span><span>5</span><span style=\"font-family:\'宋体\';\">万</span><span>/</span><span style=\"font-family:\'宋体\';\">座、</span><span>10</span><span style=\"font-family:\'宋体\';\">万</span><span>/</span><span style=\"font-family:\'宋体\';\">座</span><span></span></p>\n</td>\n<td width=\"114\" valign=\"top\"><p class=\"MsoNormal\" style=\"text-indent:21pt;\"><span>1</span><span style=\"font-family:\'宋体\';\">万</span><span>/</span><span style=\"font-family:\'宋体\';\">座</span><span></span></p>\n</td>\n</tr><tr><td width=\"114\" valign=\"top\"><p class=\"MsoNormal\"><span style=\"font-family:\'宋体\';\">盗抢险</span><span></span></p>\n</td>\n<td width=\"114\" valign=\"top\"><p class=\"MsoNormal\" style=\"text-indent:21pt;\"><span style=\"font-family:\'宋体\';\">有</span><span></span></p>\n</td>\n<td width=\"114\" valign=\"top\"><p class=\"MsoNormal\"><span style=\"font-family:\'宋体\';\">同</span> <span style=\"font-family:\'宋体\';\">“车损险”</span><span></span></p>\n</td>\n<td width=\"114\" valign=\"top\"><p class=\"MsoNormal\"><span style=\"font-family:\'宋体\';\">同</span> <span style=\"font-family:\'宋体\';\">“车损险”</span><span></span></p>\n</td>\n</tr><tr><td width=\"114\" valign=\"top\"><p class=\"MsoNormal\"><span style=\"font-family:\'宋体\';\">划痕险</span><span></span></p>\n</td>\n<td width=\"114\" valign=\"top\"><p class=\"MsoNormal\"><span>&nbsp;&nbsp;&nbsp; </span><span style=\"font-family:\'宋体\';\">有</span><span></span></p>\n</td>\n<td width=\"114\" valign=\"top\"><p class=\"MsoNormal\"><span>2000</span><span style=\"font-family:\'宋体\';\">、</span><span>5000</span><span style=\"font-family:\'宋体\';\">、</span><span>1</span><span style=\"font-family:\'宋体\';\">万、</span><span>2</span><span style=\"font-family:\'宋体\';\">万</span><span></span></p>\n</td>\n<td width=\"114\" valign=\"top\"><p class=\"MsoNormal\"><span>2000</span></p>\n</td>\n</tr><tr><td width=\"114\" valign=\"top\"><p class=\"MsoNormal\"><span style=\"font-family:\'宋体\';\">玻璃险</span><span></span></p>\n</td>\n<td width=\"114\" valign=\"top\"><p class=\"MsoNormal\"><span>&nbsp;</span></p>\n</td>\n<td width=\"114\" valign=\"top\"><p class=\"MsoNormal\"><span style=\"font-family:\'宋体\';\">国产、进口</span><span></span></p>\n</td>\n<td width=\"114\" valign=\"top\"><p class=\"MsoNormal\"><span style=\"font-family:\'宋体\';\">国产</span><span></span></p>\n</td>\n</tr><tr><td width=\"114\" valign=\"top\"><p class=\"MsoNormal\"><span style=\"font-family:\'宋体\';\">自燃险</span><span></span></p>\n</td>\n<td width=\"114\" valign=\"top\"><p class=\"MsoNormal\"><span>&nbsp;&nbsp;&nbsp; </span><span style=\"font-family:\'宋体\';\">有</span><span></span></p>\n</td>\n<td width=\"114\" valign=\"top\"><p class=\"MsoNormal\"><span>&nbsp;</span><span style=\"font-family:\'宋体\';\">无保额</span><span></span></p>\n</td>\n<td width=\"114\" valign=\"top\"><p class=\"MsoNormal\"><span style=\"font-family:\'宋体\';\">无</span><span></span></p>\n</td>\n</tr><tr><td width=\"114\" valign=\"top\"><p class=\"MsoNormal\"><span style=\"font-family:\'宋体\';\">发动机涉水险</span><span></span></p>\n</td>\n<td width=\"114\" valign=\"top\"><p class=\"MsoNormal\"><span>&nbsp;&nbsp;&nbsp; </span><span style=\"font-family:\'宋体\';\">有</span><span></span></p>\n</td>\n<td width=\"114\" valign=\"top\"><p class=\"MsoNormal\"><span>&nbsp;</span><span style=\"font-family:\'宋体\';\">无保额</span><span></span></p>\n</td>\n<td width=\"114\" valign=\"top\"><p class=\"MsoNormal\"><span style=\"font-family:\'宋体\';\">无</span><span></span></p>\n</td>\n</tr><tr><td width=\"114\" valign=\"top\"><p class=\"MsoNormal\"><span style=\"font-family:\'宋体\';\">指定维修厂险</span><span></span></p>\n</td>\n<td width=\"114\" valign=\"top\"><p class=\"MsoNormal\"><span>&nbsp;</span></p>\n</td>\n<td width=\"114\" valign=\"top\"><p class=\"MsoNormal\"><span>&nbsp;</span><span style=\"font-family:\'宋体\';\">无保额</span><span></span></p>\n</td>\n<td width=\"114\" valign=\"top\"><p class=\"MsoNormal\"><span style=\"font-family:\'宋体\';\">无</span><span></span></p>\n</td>\n</tr><tr><td width=\"114\" valign=\"top\"><p class=\"MsoNormal\"><span style=\"font-family:\'宋体\';\">无法找到第三方特约险</span><span></span></p>\n</td>\n<td width=\"114\" valign=\"top\"><p class=\"MsoNormal\"><span>&nbsp;</span></p>\n</td>\n<td width=\"114\" valign=\"top\"><p class=\"MsoNormal\"><span>&nbsp;</span><span style=\"font-family:\'宋体\';\">无保额</span><span></span></p>\n</td>\n<td width=\"114\" valign=\"top\"><p class=\"MsoNormal\"><span style=\"font-family:\'宋体\';\">无</span><span></span></p>\n</td>\n</tr><tr><td width=\"114\" rowspan=\"2\" valign=\"top\"><p class=\"MsoNormal\" style=\"text-indent:21pt;\"><span style=\"font-family:\'宋体\';\">交强险</span><span></span></p>\n</td>\n<td width=\"114\" valign=\"top\"><p class=\"MsoNormal\"><span style=\"font-family:\'宋体\';\">交强险</span><span></span></p>\n</td>\n<td width=\"114\" valign=\"top\"><p class=\"MsoNormal\"><span>&nbsp;</span></p>\n</td>\n<td width=\"114\" valign=\"top\"><p class=\"MsoNormal\"><span>&nbsp;</span><span style=\"font-family:\'宋体\';\">无保额</span><span></span></p>\n</td>\n<td width=\"114\" valign=\"top\"><p class=\"MsoNormal\"><span style=\"font-family:\'宋体\';\">无</span><span></span></p>\n</td>\n</tr><tr><td width=\"114\" valign=\"top\"><p class=\"MsoNormal\"><span style=\"font-family:\'宋体\';\">车船税</span><span></span></p>\n</td>\n<td width=\"114\" valign=\"top\"><p class=\"MsoNormal\"><span>&nbsp;</span></p>\n</td>\n<td width=\"114\" valign=\"top\"><p class=\"MsoNormal\"><span>&nbsp;</span><span style=\"font-family:\'宋体\';\">无保额</span><span></span></p>\n</td>\n<td width=\"114\" valign=\"top\"><p class=\"MsoNormal\"><span style=\"font-family:\'宋体\';\">无</span><span></span></p>\n</td>\n</tr></tbody></table><p><br /></p>', '');
INSERT INTO `zt_storyspec` VALUES ('54', '1', '填写-商业险', '<p class=\"MsoListParagraph\" style=\"margin-left:57.3pt;text-indent:0cm;\">商业险起保日期为前一个页面用户填写日期，本页面不可修改<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:49.35pt;text-indent:-21pt;\">l&nbsp; 车损险<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:49.35pt;text-indent:0cm;\">选择了该险后，保额部分可修改，数字和图标区域点击调起系统数字键盘（非<span>iOS</span>调默认键盘），完成修改以后，盗抢险的保额联动copy车损的保额<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:49.35pt;text-indent:-21pt;\">l&nbsp; 三者险<span>/</span>车上人员<span>-</span>司机险<span>/</span>车上人员<span>-</span>乘客险<span>/</span>划痕险<span>/</span>玻璃险<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:49.35pt;text-indent:0cm;\">调用选择控件，对应选项上方已附表<span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('55', '1', '填写-交强险', '<p class=\"MsoListParagraph\" style=\"margin-left:57.3pt;text-indent:0cm;\">交强险起保日期为前一个页面用户填写日期，本页面不可修改<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:49.35pt;text-indent:-21pt;\">l&nbsp; 交强险<span>/</span>车船税<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:49.35pt;text-indent:0cm;\">绑定，所以无需显示让用户分项选择<span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('56', '1', '信息校验', '<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\">校验时机：点击“获取价格”<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\">主要校验类型如下：<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\"><span>&nbsp;</span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:44.65pt;text-indent:-21pt;\">l&nbsp; 为空校验<span></span></p>\n<table class=\"MsoTableGrid\" border=\"1\" cellspacing=\"0\" cellpadding=\"0\" style=\"border:none;\"><tbody><tr><td width=\"126\" valign=\"top\" style=\"background:#4F81BD;\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span style=\"font-family:\'宋体\';\">校验对象</span><span></span></p>\n</td>\n<td width=\"128\" valign=\"top\" style=\"background:#4F81BD;\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span>&nbsp; </span><span style=\"font-family:\'宋体\';\">要求</span><span></span></p>\n</td>\n<td width=\"128\" valign=\"top\" style=\"background:#4F81BD;\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span>&nbsp; </span><span style=\"font-family:\'宋体\';\">具体错误</span><span></span></p>\n</td>\n<td width=\"128\" valign=\"top\" style=\"background:#4F81BD;\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span>&nbsp;toast</span><span style=\"font-family:\'宋体\';\">提示</span><span></span></p>\n<p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span style=\"font-family:\'宋体\';\">（</span><span>5</span><span style=\"font-family:\'宋体\';\">秒，居中）</span><span></span></p>\n</td>\n</tr><tr><td width=\"126\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span style=\"font-family:\'宋体\';\">险别</span><span></span></p>\n</td>\n<td width=\"128\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span>&nbsp; </span><span style=\"font-family:\'宋体\';\">商业</span><span>/</span><span style=\"font-family:\'宋体\';\">交强至少选择一个</span><span></span></p>\n</td>\n<td width=\"128\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span style=\"font-family:\'宋体\';\">都不选</span><span></span></p>\n<p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span style=\"font-family:\'宋体\';\">（商业险开关关闭或者开启但是无险种选中</span><span>&amp;</span><span style=\"font-family:\'宋体\';\">交强险开关关闭）</span><span></span></p>\n</td>\n<td width=\"128\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span style=\"font-family:\'宋体\';\">请选择险种</span><span></span></p>\n</td>\n</tr></tbody></table><p class=\"MsoListParagraph\" style=\"margin-left:44.65pt;text-indent:0cm;\"><span>&nbsp;</span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:44.65pt;text-indent:-21pt;\">l&nbsp; 正确性校验<span></span></p>\n<table class=\"MsoTableGrid\" border=\"1\" cellspacing=\"0\" cellpadding=\"0\" style=\"border:none;\"><tbody><tr><td width=\"142\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span style=\"font-family:\'宋体\';\">校验对象</span><span></span></p>\n</td>\n<td width=\"142\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span style=\"font-family:\'宋体\';\">要求</span><span></span></p>\n</td>\n<td width=\"142\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span style=\"font-family:\'宋体\';\">具体错误</span><span></span></p>\n</td>\n<td width=\"142\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span>Toast</span><span style=\"font-family:\'宋体\';\">提示</span><span></span></p>\n<p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span style=\"font-family:\'宋体\';\">（</span><span>5</span><span style=\"font-family:\'宋体\';\">秒，居中）</span><span></span></p>\n</td>\n</tr><tr><td width=\"142\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span>&nbsp;</span></p>\n<p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span>&nbsp;</span></p>\n<p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span style=\"font-family:\'宋体\';\">车损保额</span><span></span></p>\n</td>\n<td width=\"142\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span style=\"font-family:\'宋体\';color:#525E71;\">车损不能比系统自带的下浮超过</span><span>20%&amp;</span><span style=\"font-family:\'宋体\';color:#525E71;\">不能比系统自带的上浮超过</span><span>30%</span><span></span></p>\n</td>\n<td width=\"142\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span>&nbsp;</span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:-18pt;\"><span>1）<span style=\"font-size:7pt;line-height:normal;\">&nbsp; </span></span><span style=\"font-family:\'宋体\';\">低于系统自带保额</span><span>20%</span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:-18pt;\"><span>2）<span style=\"font-size:7pt;line-height:normal;\">&nbsp; </span></span><span style=\"font-family:\'宋体\';\">高于系统自带保额</span><span>30%</span></p>\n</td>\n<td width=\"142\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span>&nbsp;</span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:-18pt;\"><span>1）<span style=\"font-size:7pt;line-height:normal;\">&nbsp; </span></span><span style=\"font-family:\'宋体\';\">不能低于系统保额</span><span>20%</span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:-18pt;\"><span>2）<span style=\"font-size:7pt;line-height:normal;\">&nbsp; </span></span><span style=\"font-family:\'宋体\';\">不能高于系统保额</span><span>30%</span></p>\n</td>\n</tr></tbody></table><p class=\"MsoNormal\"><span>&nbsp;</span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:44.65pt;text-indent:-21pt;\">l&nbsp; 多种错误类型存在或者一种错误类型多个错误存在<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:44.65pt;text-indent:0cm;\">只提示一条原则，按照优先级“为空<span>&gt;</span>正确性”，为空错误类型优先级按表中从上到下依次降低<span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('57', '1', '投保查询时机', '<p class=\"MsoNormal\">投保查询是信息验证通过过，获取报价前进行的一次投保查询，主要目的是防止交强险重复投保（商业险不限制）<span></span></p>\n<p class=\"MsoNormal\"><br /></p>\n<p class=\"MsoNormal\"><br /></p>\n<p class=\"MsoNormal\"></p><h4>投保查询时机<span></span></h4>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\">当用户点击“获取报价”，且信息校验通过时<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\"><span>&nbsp;</span></p>\n', '');
INSERT INTO `zt_storyspec` VALUES ('58', '1', '投保查询结果提示', '<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\">投保查询，主要目的是为了防止交强险重复投保（概率最大）<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\"><span>&nbsp;</span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\">在投保查询环节，只有两种情况需要被拦截，其他情况放过<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\"><span>&nbsp;</span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\"><span>3.1</span>）用户还在上份保单的保障期内，但是未到可购买交强险日期（提前<span>90</span>天），想买，这个时候需要拦截给予提示<span></span></p>\n<p class=\"MsoNormal\"><span>&nbsp;</span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\">交强险重复投保提示<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\"><img src=\"{25.png}\" alt=\"\" /></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\"><span></span><span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\"><span>&nbsp;</span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\"><span>3.2</span>）用户还在上份保单的保障期内，到了可购买交强险日期内（落在了提前<span>90</span>天内），想买但是交强险起保日期写错了，这个时候系统自动更正起保日期（顺承上份的到期日）<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\"><img src=\"{26.png}\" alt=\"\" /></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\"><span></span><span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\">我知道了：弹框消失，停留当前页面，系统不做任何操作（但是交强险起保日期已更改）<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\">继续投保：进行报价请求<span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('59', '1', '报价等待', '<p class=\"MsoNormal\">如有，请参考<span></span></p>\n<p class=\"MsoNormal\"><span><a href=\"https://modao.cc/workspace/apps/pB0601502EE1500950458258/preview\">https://modao.cc/workspace/apps/pB0601502EE1500950458258/preview</a></span></p>\n<p class=\"MsoNormal\"><img src=\"{27.png}\" alt=\"\" /></p>\n<p class=\"MsoNormal\"><span></span><span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('60', '1', '成功', '<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\"><img src=\"{28.png}\" alt=\"\" /></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\">显示要素：保险公司<span>logo</span>、保险公司名称、总价格、查看价格详情按钮、去核保按钮<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\"><span>&nbsp;</span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\">查看价格详情：<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\">点击原页面顺延下拉查看商业险和交强险价格详情，详见需求链接，上图只有商业险<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\">再次点击收起<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\"><span>&nbsp;</span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\"><span>P.S. </span>网络不好保险公司<span>logo</span>那里需要一个占位图，同理失败<span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('61', '1', '失败', '<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\"><span><img src=\"{29.png}\" alt=\"\" /><img src=\"{30.png}\" alt=\"\" /><br /></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\"><span>2.1</span>）显示要素：保险公司<span>logo</span>、保险公司名称、“报价失败”<span>4</span>个字，刷新报价结果按钮<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\"><span>2.2</span>）查看失败原因<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\"><span>&nbsp;&nbsp;&nbsp;&nbsp; </span>组成元素：标题<span>+</span>车牌<span>+</span>失败原因<span>+</span>具体原因<span>+</span>“我知道了”按钮<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\"><span>&nbsp;&nbsp;&nbsp;&nbsp; </span>如图所示<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\"><span>&nbsp;&nbsp;&nbsp;&nbsp; </span>超长加下拉框，点击“我知道了”或者非下拉框区域收起整个弹框<span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('62', '1', '报价详情页', '<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\"><img src=\"{31.png}\" alt=\"\" /></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\"><br /></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\">展现要素见需求链接页面，不复述<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\"><span>&nbsp;</span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\"><span>P.S. </span>不计免赔展开分项，显示对应分项价格<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\">如果后续对接的保险公司给的是总价格，再按照保险公司给的样式做统一归纳和给出总价格<span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('63', '1', '上传照片', '<p><img src=\"{32.png}\" alt=\"\" /></p>\n<p></p><p class=\"MsoListParagraph\" style=\"margin-left:54pt;text-indent:-36pt;\">1.1）&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\n温馨提示：由服务器下发，因为暂未知道需要传递内容，图示只是一个部分，后调研后及时通知</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:54pt;text-indent:-36pt;\"><span>1.2）&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>上传照片：相关操作如地址：<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:54pt;text-indent:0cm;\"><span><a href=\"https://modao.cc/workspace/apps/pB0601502EE1500950458258/preview\">https://modao.cc/workspace/apps/pB0601502EE1500950458258/preview</a><span class=\"MsoHyperlink\"></span></span></p>\n<img src=\"{33.png}\" alt=\"\" /><p><br /></p>\n<p></p><p class=\"MsoListParagraph\" style=\"margin-left:54pt;text-indent:0cm;\">照片可增删，格式比例大小看安盛要求，待定<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:54pt;text-indent:-36pt;\"><span>1.1）&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>提交，进行核保<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:54pt;text-indent:0cm;\">沉底<span>+</span>固定；条款校验通过跳转到核保页面<span></span></p>\n\n<p><br /></p>\n<p><br /></p>', '');
INSERT INTO `zt_storyspec` VALUES ('64', '1', '条款', '<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\">包含两个条款，一个是“商业险特别约定”、一个是“商业险补充约定”<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\">“商业险特别约定”默认勾选，<b>如果此项不勾选，“提交、进行核保”按钮置灰</b>，不可点击<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\">相关展示样式和文本内容如地址：<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\"><span><a href=\"https://modao.cc/workspace/apps/pB0601502EE1500950458258/preview\">https://modao.cc/workspace/apps/pB0601502EE1500950458258/preview</a><span class=\"MsoHyperlink\"></span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\"><br /></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\"><img src=\"{34.png}\" alt=\"\" /></p>', '');
INSERT INTO `zt_storyspec` VALUES ('65', '1', '提交核保等待（如有）', '<img src=\"{35.png}\" alt=\"\" />', '');
INSERT INTO `zt_storyspec` VALUES ('66', '1', '核保校验', '<p><img src=\"{36.png}\" alt=\"\" /></p>\n<p></p><p class=\"MsoNormal\">核保时去校验是否存在核保通过待支付订单，如果发现同样车牌的待支付订单，则如上图提示<span></span></p>\n<p class=\"MsoNormal\"><span>&nbsp;</span></p>\n<p class=\"MsoNormal\">去查看：待支付列表页<span></span></p>\n<p class=\"MsoNormal\">我知道了：弹框消失，停留在当前页面<span></span></p>\n\n<p><br /></p>', '');
INSERT INTO `zt_storyspec` VALUES ('67', '1', '核保成功', '<p><img src=\"{37.png}\" alt=\"\" /></p>\n<p><br /></p>\n<p></p><p class=\"MsoNormal\">原型地址：<span></span></p>\n<p class=\"MsoNormal\"><span><a href=\"https://modao.cc/workspace/apps/pB0601502EE1500950458258/preview\">https://modao.cc/workspace/apps/pB0601502EE1500950458258/preview</a></span></p>\n<p class=\"MsoNormal\">核保成功定义：顾名思义<span></span></p>\n<p class=\"MsoNormal\"><span>&nbsp;</span></p>\n<p class=\"MsoNormal\">展现字段：<span></span></p>\n<p class=\"MsoNormal\">核保成功<span>+</span>保险信息<span>+</span>车辆信息<span>+</span>被保人信息<span>+</span>车主信息<span>+</span>支付按钮<span></span></p>\n<p class=\"MsoNormal\"><span>&nbsp;</span></p>\n<p class=\"MsoNormal\"><span>&nbsp;</span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:36pt;text-indent:-36pt;\"><span>1.1、&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>保险信息<span></span></p>\n<p class=\"MsoNormal\"><span>&nbsp;</span></p>\n<p class=\"MsoNormal\">保险公司<span>+</span>总价<span>+</span>商业险总价<span>+</span>商业险起保日期<span>+</span>商业险险种（名称<span>+</span>保额<span>+</span>价格）<span>+</span>交强险总价<span>+</span>交强险起保日期<span>+</span>交强险（名称<span>+</span>金额）<span>+</span>车船税（名称<span>+</span>金额）<span></span></p>\n<p class=\"MsoNormal\"><span>&nbsp;</span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:36pt;text-indent:-36pt;\"><span>1.2、&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>车辆信息<span></span></p>\n<p class=\"MsoNormal\"><span>&nbsp;</span></p>\n<p class=\"MsoNormal\">车牌号<span>+</span>车架号<span>+</span>发动机号<span>+</span>初登日期<span>+</span>品牌型号<span>+</span>过户信息（之前用户选否的话就没有过户日期）<span>+</span>按揭信息（之前用户选否的话就不需要展现第一受益人）<span></span></p>\n<p class=\"MsoNormal\"><span>&nbsp;</span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:36pt;text-indent:-36pt;\"><span>1.3、&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>被保人信息<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:36pt;text-indent:0cm;\"><span>&nbsp;</span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:36pt;text-indent:0cm;\">被保人姓名<span>+</span>被保人身份证<span>+</span>被保人手机<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:36pt;text-indent:0cm;\"><span>&nbsp;</span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:36pt;text-indent:-36pt;\"><span>1.4、&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>车主信息<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:36pt;text-indent:0cm;\"><span>&nbsp;</span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:36pt;text-indent:0cm;\">车主姓名<span>+</span>车主身份证<span>+</span>车主手机<span></span></p>\n<p class=\"MsoNormal\"><span>&nbsp;</span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:36pt;text-indent:-36pt;\"><span>1.5、&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>总金额<span>+</span>支付按钮<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:36pt;text-indent:0cm;\">沉底固定显示，总金额为保险总金额<span></span></p>\n', '');
INSERT INTO `zt_storyspec` VALUES ('68', '1', '核保失败', '<p><img src=\"{38.png}\" alt=\"\" /></p>\n<p><br /></p>\n<p></p><p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\">核保失败定义：除了成功的都是失败<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\">失败的在订单管理的待修改列表中可查<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\">展现要素：核保失败<span>+</span>车牌号<span>+</span>失败原因<span>+</span>修改投保信息按钮<span>+</span>刷新核保结果按钮<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\"><span>&nbsp;</span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\"><span>2.1</span>）车牌号<span>+</span>失败原因<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\"><span>&nbsp;</span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;\">如图所示，控制三行，超过显示“<span>…</span>”<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:57.3pt;text-indent:-36pt;\"><span>2.1）&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>修改投保信息<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:57.3pt;text-indent:0cm;\">跳转到“填写信息”页面，车<span>+</span>车主<span>+</span>被保险人信息传递过去<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:57.3pt;text-indent:-36pt;\"><span>2.2）&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>刷新核保结果<span></span></p>\n同理报价失败里的刷新报价结果，刷新结果如果变成核保成功转向“核保成功”', '');
INSERT INTO `zt_storyspec` VALUES ('69', '1', 'POS支付', '<p class=\"MsoNormal\">展示字段：订单号、订单状态、应付金额。<span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\">从待支付订单列表、核保成功页面点击支付按钮，进到支付页面，默认为支付方式为<span>POS</span>支付。<span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\">点击查看支付结果按钮，查询订单的支付状态，如果已支付，跳转到支付成功页面；如果未支付，跳转到未查询到结果页面。<span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\">点击更换为微信支付跳转到微信支付页面。<span></span></p>\n<p>如下图所示：</p>\n<p><br /></p>\n<p><img src=\"{39.png}\" alt=\"\" /></p>', '');
INSERT INTO `zt_storyspec` VALUES ('70', '1', '微信支付', '<p class=\"MsoNormal\" style=\"text-indent:21pt;\">二维码为保险公司生成，用户扫描微信二维码支付，每次请求都生成新的二维码。<span></span></p>\n<p>点击查看支付结果按钮，检查订单的支付结果。如下图所示：</p>\n<p><img src=\"{40.png}\" alt=\"\" /></p>', '');
INSERT INTO `zt_storyspec` VALUES ('71', '1', '查看支付结果', '<p class=\"MsoNormal\" style=\"text-indent:21pt;\">点击查看支付结果按钮，<span>loading </span>页面最长<span>5</span>秒钟，如果没查询到已支付，返回未查询到支付结果提示，<span>toast</span>形式。。如下图所示：<span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\"><img src=\"{41.png}\" alt=\"\" /></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\"><br /></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\"></p><p class=\"MsoNormal\" style=\"text-indent:21pt;\">如果查询到订单支付成功，进入支付成功页面。点击查看订单详情，跳转到订单详情页面。如下图所示：<span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\"><br /></p>\n<img src=\"{42.png}\" alt=\"\" /><p class=\"MsoNormal\" style=\"text-indent:21pt;\"><br /></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\"></p>', '');
INSERT INTO `zt_storyspec` VALUES ('72', '1', '网络不好/加载', '<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\">在当前页加载，如地址（背景页面只是示例）<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\"><span><a href=\"https://modao.cc/workspace/apps/pB0601502EE1500950458258/preview\">https://modao.cc/workspace/apps/pB0601502EE1500950458258/preview</a></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\"><span>&nbsp;</span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\"><span>&nbsp;</span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\">TO 绳姑娘、晓龙<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\">网络不好的情况下，购买页的轮播图、报价结果也得保险公司<span>logo</span>需要一个占位图<span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('73', '1', '没有网络', '<p class=\"MsoNormal\" align=\"left\" style=\"margin-left:18pt;\">如地址<span></span></p>\n<p class=\"MsoNormal\" align=\"left\" style=\"margin-left:18pt;\"><span><a href=\"https://modao.cc/workspace/apps/pB0601502EE1500950458258/preview\">https://modao.cc/workspace/apps/pB0601502EE1500950458258/preview</a></span></p>\n<p class=\"MsoNormal\" align=\"left\" style=\"margin-left:18pt;\"><span>&nbsp;</span></p>\n<p class=\"MsoNormal\" align=\"left\" style=\"margin-left:18pt;\">点击蓝色字体“刷新”可刷新当前页<span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('74', '1', '订单管理', '订单管理功能为展示用户生成的订单及暂存的车辆信息，方便用户查看、编辑订单信息及车辆信息。<span>TAB</span>页有：全部、暂存、待修改、待支付、已支付。不同页面功能如下文。', '');
INSERT INTO `zt_storyspec` VALUES ('75', '1', '暂存', '<p class=\"MsoNormal\" style=\"text-indent:21pt;\">暂存页面指在基本信息页面保存的车辆信息，只展示最近<span>7</span>天保存的，大于<span>7</span>天的不再展示。<span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\"><b>列表页展示字段</b>：车主姓名、车牌号、保存时间。<span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\">列表页每条信息为链接区域，点击跳转到<b>基本信息页面</b>，可继续编辑上次保存的信息。<span></span></p>\n<p>如下图所示：</p>\n<p><img src=\"{43.png}\" alt=\"\" /></p>', '');
INSERT INTO `zt_storyspec` VALUES ('76', '1', '全部订单', '<p class=\"MsoNormal\">全部订单页面展示所有订单，包含状态有：暂存、待修改、核保中、待支付、已支付、已完成、已取消。全部状态下的订单和其它对应<span>TAB</span>页订单展示字段、落地页相同。<span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\"><b>排序方式</b>：默认按最后更新时间倒序排列。<span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\"><b>已取消订单</b>：已取消订单展示取消时间在<span>7</span>天内的，已取消订单没有落地页。展示字段：车主姓名、车牌号、险种、保费、取消原因、订单状态、取消时间。取消原因为，如果是待修改状态取消，则展示为：未及时修改取消，以此类推。其它状态的见下文。<span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\">不同<span>tab</span>页对应的订单状态、订单落地页。如下表：<span></span></p>\n<table class=\"MsoTableGrid\" border=\"1\" cellspacing=\"0\" cellpadding=\"0\" style=\"border:none;\"><tbody><tr><td width=\"131\" valign=\"top\"><p class=\"MsoNormal\"><b><span>Tab</span></b><b><span>页<span></span></span></b></p>\n</td>\n<td width=\"131\" valign=\"top\"><p class=\"MsoNormal\"><b><span>包含订单状态<span></span></span></b></p>\n</td>\n<td width=\"154\" valign=\"top\"><p class=\"MsoNormal\"><b><span>落地页<span></span></span></b></p>\n</td>\n<td width=\"152\" valign=\"top\"><p class=\"MsoNormal\"><b><span>落地页操作<span></span></span></b></p>\n</td>\n</tr><tr><td width=\"131\" valign=\"top\"><p class=\"MsoNormal\"><span style=\"font-size:9pt;\">暂存<span></span></span></p>\n</td>\n<td width=\"131\" valign=\"top\"><p class=\"MsoNormal\"><span style=\"font-size:9pt;\">保存的车辆信息<span></span></span></p>\n</td>\n<td width=\"154\" valign=\"top\"><p class=\"MsoNormal\"><span style=\"font-size:9pt;\">填写信息页面<span></span></span></p>\n</td>\n<td width=\"152\" valign=\"top\"><p class=\"MsoNormal\"><span style=\"font-size:9pt;\">编辑信息<span></span></span></p>\n</td>\n</tr><tr><td width=\"131\" valign=\"top\"><p class=\"MsoNormal\"><span style=\"font-size:9pt;\">待修改<span></span></span></p>\n</td>\n<td width=\"131\" valign=\"top\"><p class=\"MsoNormal\"><span style=\"font-size:9pt;\">待修改、核保中<span></span></span></p>\n</td>\n<td width=\"154\" valign=\"top\"><p class=\"MsoNormal\"><span style=\"font-size:9pt;\">待修改：填写信息页面<span></span></span></p>\n<p class=\"MsoNormal\"><span style=\"font-size:9pt;\">核保中：无<span></span></span></p>\n</td>\n<td width=\"152\" valign=\"top\"><p class=\"MsoNormal\"><span style=\"font-size:9pt;\">无<span></span></span></p>\n</td>\n</tr><tr><td width=\"131\" valign=\"top\"><p class=\"MsoNormal\"><span style=\"font-size:9pt;\">待支付<span></span></span></p>\n</td>\n<td width=\"131\" valign=\"top\"><p class=\"MsoNormal\"><span style=\"font-size:9pt;\">待支付<span></span></span></p>\n</td>\n<td width=\"154\" valign=\"top\"><p class=\"MsoNormal\"><span style=\"font-size:9pt;\">订单详情页<span></span></span></p>\n</td>\n<td width=\"152\" valign=\"top\"><p class=\"MsoNormal\"><span style=\"font-size:9pt;\">撤回、去支付<span></span></span></p>\n</td>\n</tr><tr><td width=\"131\" valign=\"top\"><p class=\"MsoNormal\"><span style=\"font-size:9pt;\">已支付<span></span></span></p>\n</td>\n<td width=\"131\" valign=\"top\"><p class=\"MsoNormal\"><span style=\"font-size:9pt;\">已支付、已完成<span></span></span></p>\n</td>\n<td width=\"154\" valign=\"top\"><p class=\"MsoNormal\"><span style=\"font-size:9pt;\">订单详情页<span></span></span></p>\n</td>\n<td width=\"152\" valign=\"top\"><p class=\"MsoNormal\"><span style=\"font-size:9pt;\">无<span></span></span></p>\n</td>\n</tr></tbody></table><p class=\"MsoNormal\"><span>&nbsp;</span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('77', '1', '待修改', '<p class=\"MsoNormal\" style=\"text-indent:21pt;\">待修改页面展示订单状态为<b>待修改、核保中</b>的订单。待修改页面只展示最后更新时间<span>7</span>天内的订单。<span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\">列表页如下图所示：<span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\"><img src=\"{44.png}\" alt=\"\" /></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\"><br /></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\"></p><p class=\"MsoNormal\" style=\"text-indent:21pt;\"><b>待修改状态</b>的订单<b>列表页展示字段</b>：车主姓名、车牌号、险种、保费、订单状态、核保失败原因、最后更新时间。每条信息为链接区域，点击跳转到基本信息页面，可继续编辑上次保存的基本信息。<b>操作按钮</b>：刷新核保结果，用户点击此按钮时检查此条订单的核保结果。如果状态变为核保通过，则订单状态变为待支付，显示在待支付<span>tab</span>页；如果状态还是核保失败，则无变化。<span></span></p>\n<b>核保中状态</b>的订单<b>列表页展示字段</b>：车主姓名、车牌号、险种、保费、订单状态、最后更新时间。核保中订单不可点击，无落地页。<b>操作按钮</b>：刷新核保结果。', '');
INSERT INTO `zt_storyspec` VALUES ('78', '1', '待支付', '<p class=\"MsoNormal\">待支付页面展示订单状态为<b>待支付</b>的订单。待支付展示订单范围：<span>1</span>、保险生效日晚于当天；<span>2</span>、最后更新时间在<span>7</span>天内。<span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\">列表页如下图所示：<span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\"><img src=\"{45.png}\" alt=\"\" /></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\"><br /></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\"></p><p class=\"MsoNormal\" style=\"text-indent:21pt;\"><b>列表页展示字段</b>：车主姓名、车牌号、险种、保费、订单状态、最后更新时间。每条信息为链接区域，点击跳转到订单详情页面。<span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\"><b>操作按钮</b>：撤回、去支付。<span></span></p>\n点击撤回，弹出提示框。点击确定后，订单状态变为待修改。如下图所示：\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\"><br /></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\"><img src=\"{46.png}\" alt=\"\" /></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\"></p><p class=\"MsoNormal\" style=\"text-indent:21pt;\">点击去支付，跳转到支付页面，暂无。<span></span></p>\n待支付订单详情页，展示内容：订单号、订单状态、总保费、车辆信息、被保险人信息、车主信息、保险信息。操作按钮：撤回、去支付。效果同列表页。\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\"></p>', '');
INSERT INTO `zt_storyspec` VALUES ('79', '1', '已支付', '<p class=\"MsoNormal\" style=\"text-indent:21pt;\">已支付页面展示订单状态为已支付、已完成的订单。已支付展示全部时间段内的订单。<span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\">列表页如下图所示：<span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\"><img src=\"{47.png}\" alt=\"\" /></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\"></p><p class=\"MsoNormal\" style=\"text-indent:21pt;\">列表页展示字段，<b>已支付</b>：车主姓名、车牌号、险种、保费、订单状态、最后更新时间。<span></span></p>\n<p class=\"MsoNormal\"><b>已完成</b>：车主姓名、车牌号、险种、保费、保单号、订单状态、最后更新时间。每条信息为链接区域，点击跳转到订单详情页面。<span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\">操作按钮：无。<span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\">已支付订单详情页：展示内容：订单号、订单状态、总保费、车辆信息、被保险人信息、车主信息、保险信息。操作按钮：无。<span></span></p>\n已完成订单详情页：展示内容：订单号、订单状态、保单号、总保费、车辆信息、被保险人信息、车主信息、保险信息。操作按钮：无。\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\"></p>', '');
INSERT INTO `zt_storyspec` VALUES ('80', '1', '报价、核保交互', '<p class=\"MsoNormal\"><span>1.</span>用户通过<span>VIN</span>或厂牌型号搜索车型时，调用车型模糊查询接口<span>V010</span>，搜索车型信息；<span></span></p>\n<p class=\"MsoNormal\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 判断是否成功返回车型信息：<span></span></p>\n<p class=\"MsoNormal\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 是：展示车型搜索结果列表，如个别信息缺失，展示时该项信息展示为空；<span></span></p>\n<p class=\"MsoNormal\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 否：返回获取车型失败和失败原因；<span></span></p>\n<p class=\"MsoNormal\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 若接口超时、或异常，启动重试机制。<span></span></p>\n<p class=\"MsoNormal\">2.根据身份证号，解析性别、地址（精确到县）；<span></span></p>\n<p class=\"MsoNormal\">&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;根据地址，解析邮编；<span></span></p>\n<p class=\"MsoNormal\">&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;解析失败，提供默认信息。<span></span></p>\n<p class=\"MsoNormal\">3.填写信息页<span>-</span>用户点击【去选择险种】，调投保查询<span>V030</span>接口，根据用户选择险种判断，是调用交强险投保查询接口，还是商业险投保查询接口；<span></span></p>\n<p class=\"MsoNormal\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 判断投保查询是否成功：<span></span></p>\n<p class=\"MsoNormal\" style=\"margin-left:73.5pt;text-indent:-73.5pt;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 成功：调用保费计算接口<span>V040</span>；若交商同保，交、商投保查询接口都返回成功，才认为是投保查询成功。<span></span></p>\n<p class=\"MsoNormal\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 失败：通知报价失败和失败原因；<span></span></p>\n<p class=\"MsoNormal\">4.用户点击【报价】按钮，过滤该投保城市不在线的保司和供应商（可略）<span></span></p>\n<p class=\"MsoNormal\">5.调用保费计算接口<span>V040</span>，判断报价是否成功：<span></span></p>\n<p class=\"MsoNormal\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 成功：通知报价成功和明细；<span></span></p>\n<p class=\"MsoNormal\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 失败：通知报价失败和失败原因；<span></span></p>\n<p class=\"MsoNormal\"><span>6.<a></a><a></a>1</span>）用户点击【核保】按钮，先判断订单类型是否为【商业险】或【综合险】：<span></span></p>\n<p class=\"MsoNormal\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>是：通过车牌号<span>+</span>被保人姓名搜索平台记录，有无投保单号；<span></span></p>\n<p class=\"MsoNormal\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>否：进行步骤<span>7</span>；<span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent:10.5pt;\"><span>2</span>）通过车牌号<span>+</span>被保人姓名搜索有无投保单号，<span></span></p>\n<p class=\"MsoNormal\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>有：校验投保单状态；<span></span></p>\n<p class=\"MsoNormal\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>无：进行步骤<span>7</span>；<span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent:10.5pt;\"><span>3</span>）校验核心系统投保单状态（调接口投保单状态查询<span>V305</span>）：<span></span></p>\n<p class=\"MsoNormal\" style=\"margin-left:31.5pt;text-indent:-31.5pt;\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>状态为【核保人同意待实收】<span>/</span>【核保通过待实收】，提示已存在核保通过的投保单，在订单列表中支付或撤回修改；<span> </span></p>\n<p class=\"MsoNormal\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>状态非【核保人同意待实收】<span>/</span>【核保通过待实收】，进行步骤<span>7</span>；<span></span></p>\n<p class=\"MsoNormal\">7.调用申请核保接口<span>V050</span>，判断是否通过核保：<span></span></p>\n<p class=\"MsoNormal\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 是：调用投保单状态查询接口<span>V305</span>，查询是否核保通过；<span></span></p>\n<p class=\"MsoNormal\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 否：返回核保失败及失败原因。<span></span></p>\n<p class=\"MsoNormal\">8.核保是否通过，以投保单状态查询接口<span>V305</span>返回结果而确定，不以申请核保接口<span>V050</span>而确定。<span></span></p>\n<p class=\"MsoNormal\">9.调用投保单查询接口<span>V305</span>，判断投保单状态：<span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent:31.5pt;\">【待支付】：返回核保通过；<span></span></p>\n<p class=\"MsoNormal\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 【待修改】：返回核保不通过，待修改；<span></span></p>\n<p class=\"MsoNormal\">10.撤回核保通过投保单：<span></span></p>\n<p class=\"MsoNormal\">订单列表<span>-</span>待支付订单列表中，点击【撤回】按钮，调用撤回接口<span>V060</span>，判断是否撤回成功：<span></span></p>\n<p class=\"MsoNormal\">成功：返回撤回成功；<span></span></p>\n<p class=\"MsoNormal\">失败：返回失败及失败原因；<span></span></p>\n<p class=\"MsoNormal\">若订单类型为单交强，则撤回交强险投保单；<span></span></p>\n<p class=\"MsoNormal\">若订单类型为单商业，则撤回商业险投保单；<span></span></p>\n<p class=\"MsoNormal\">若订单类型为交商同保，则撤回交强险和商业险投保单；<span></span></p>\n<p class=\"MsoNormal\">&nbsp;</p>\n<p class=\"MsoNormal\">11.支付前校验重复支付。用户选择了支付方式，调取第三方支付平台接口前，校验该车牌号<span>+</span>被保人姓名是否存在【已付款】、【已完成】状态的订单（只校验平台订单，不校验核心系统）<span></span></p>\n<p class=\"MsoNormal\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 存在：提示【已存在支付成功订单，是否继续支付】，确认后可继续支付流程；<span></span></p>\n<p class=\"MsoNormal\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 不存在：继续支付流程，调用第三方支付平台接口付款。<span></span></p>\n<p class=\"MsoNormal\">&nbsp;</p>\n<p class=\"MsoNormal\">每次请求安盛天平的接口都加日志，记录请求次数、返回结果（成功<span>/</span>失败，失败原因）、未知异常统计（超时、返回结果未知）。支持按城市、保司筛选。<span></span></p>\n<p class=\"MsoNormal\">记录请求和返回的报文（若数据量或工作量过大可略）<span></span></p>\n<p class=\"MsoNormal\">安盛天平接口所有字段都需记录<span></span></p>\n<p class=\"MsoNormal\">H5页面<span>PV UV</span>统计签<span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('81', '1', '订单状态定义', '<h4><span>&nbsp;</span></h4>\n<table class=\"MsoTableGrid\" border=\"1\" cellspacing=\"0\" cellpadding=\"0\" style=\"border:none;\"><tbody><tr><td width=\"68\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span style=\"font-family:\'宋体\';\">已报价</span><span></span></p>\n</td>\n<td width=\"476\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:-18pt;\"><span style=\"font-family:\'宋体\';\">①<span style=\"font-size:7pt;line-height:normal;\">&nbsp; </span></span><span style=\"font-family:\'宋体\';\">报价成功，未核保</span> <span style=\"font-family:\'宋体\';\">②</span><span style=\"font-family:\'宋体\';\">报价失败，未核保</span><span></span></p>\n</td>\n</tr><tr><td width=\"68\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span style=\"font-family:\'宋体\';\">待修改</span><span></span></p>\n</td>\n<td width=\"476\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:-18pt;\"><span style=\"font-family:\'宋体\';\">①<span style=\"font-size:7pt;line-height:normal;\">&nbsp; </span></span><span style=\"font-family:\'宋体\';\">核保不通过②核保中</span><span></span></p>\n</td>\n</tr><tr><td width=\"68\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span style=\"font-family:\'宋体\';\">待付款</span><span></span></p>\n</td>\n<td width=\"476\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span style=\"font-family:\'宋体\';\">核保通过，未支付</span><span></span></p>\n</td>\n</tr><tr><td width=\"68\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span style=\"font-family:\'宋体\';\">已付款</span><span style=\"background:#FFFF00;\"></span></p>\n</td>\n<td width=\"476\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span style=\"font-family:\'宋体\';\">用户支付成功</span><span></span></p>\n</td>\n</tr><tr><td width=\"68\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span style=\"font-family:\'宋体\';\">已完成</span><span style=\"background:#FFFF00;\"></span></p>\n</td>\n<td width=\"476\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span style=\"font-family:\'宋体\';\">出单状态字段：已出单</span><span></span></p>\n</td>\n</tr><tr><td width=\"68\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span style=\"font-family:\'宋体\';\">已退款</span><span></span></p>\n</td>\n<td width=\"476\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span style=\"font-family:\'宋体\';\">退款暂不走平台</span><span></span></p>\n</td>\n</tr><tr><td width=\"68\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"text-indent:0cm;\"><span style=\"font-family:\'宋体\';\">已取消</span><span></span></p>\n</td>\n<td width=\"476\" valign=\"top\"><p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:-18pt;\"><span style=\"font-family:\'宋体\';\">①<span style=\"font-size:7pt;line-height:normal;\">&nbsp; </span></span><span style=\"font-family:\'宋体\';\">投保日期＜当前日期</span><span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:-18pt;\"><span style=\"font-family:\'宋体\';\">②<span style=\"font-size:7pt;line-height:normal;\">&nbsp; </span></span><span style=\"font-family:\'宋体\';\">＞</span><span>168h</span><span style=\"font-family:\'宋体\';\">（</span><span>7</span><span style=\"font-family:\'宋体\';\">天）已报价</span><span>/</span><span style=\"font-family:\'宋体\';\">待修改</span><span>/</span><span style=\"font-family:\'宋体\';\">待付款</span><span></span></p>\n<p class=\"MsoNormal\"><span style=\"font-family:\'宋体\';\">（判定订单是否为已取消优先级：</span><span style=\"font-family:\'宋体\';\">①＞②</span><span style=\"font-family:\'宋体\';\">）</span><span></span></p>\n</td>\n</tr></tbody></table>', '');
INSERT INTO `zt_storyspec` VALUES ('82', '1', '订单状态机', '<p class=\"MsoListParagraph\" style=\"margin-left:39pt;text-indent:-21pt;\"><span>1)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>已报价<span>-</span>待付款<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:39pt;text-indent:0cm;\">已报价<span>-</span>待修改<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:39pt;text-indent:0cm;\">已报价<span>-</span>已取消<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:39pt;text-indent:-21pt;\"><span>2)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>待修改<span>-</span>待付款<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:39pt;text-indent:0cm;\">待修改<span>-</span>已取消<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:39pt;text-indent:-21pt;\"><span>3)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>待付款<span>-</span>已付款<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:39pt;text-indent:0cm;\">待付款<span>-</span>已取消<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:39pt;text-indent:-21pt;\"><span>4)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>已付款<span>-</span>已完成<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;\">已付款<span>-</span>已退款<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:39pt;text-indent:-21pt;\"><span>5)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>已完成<span>-</span>已退款<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:39pt;text-indent:-21pt;\"><img src=\"{48.png}\" alt=\"\" /></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:39pt;text-indent:-21pt;\"></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:39pt;text-indent:-21pt;\"></p>', '');
INSERT INTO `zt_storyspec` VALUES ('83', '1', '订单生成', '<p class=\"MsoListParagraph\" style=\"margin-left:39pt;text-indent:-21pt;\"><span>1)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>点击【获取报价】生成一条订单，状态为已报价；<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:39pt;text-indent:-21pt;\"><span>2)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>多次点击【获取报价】，执行新增操作；<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:39pt;text-indent:-21pt;\"><span>3)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>一个车牌号可对应多条订单；<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:39pt;text-indent:-21pt;\"><span>4)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>订单号设置：<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:60pt;text-indent:-60pt;\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\ni.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><span>18</span>位数字；<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:60pt;text-indent:-60pt;\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\nii.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>前<span>14</span>位订单生成时间，具体到秒，后四位为<span>0-9</span>随机组合；<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:60pt;text-indent:0cm;\"><span>Eg. 2017072410361234</span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:60pt;text-indent:-60pt;\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\niii.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>综合险生成一个订单号<span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('84', '1', '暂存单', '<p class=\"MsoListParagraph\" style=\"margin-left:35.2pt;text-indent:-21pt;\"><span>1)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>暂存单生成：<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:60pt;text-indent:-60pt;\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\ni.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>基本信息页点击【保存】，生成一条暂存单；<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:60pt;text-indent:-60pt;\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\nii.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>多次【点击】执行新增操作；<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:60pt;text-indent:-60pt;\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\niii.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>一个车牌号可对应多个暂存单；<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:35.2pt;text-indent:-21pt;\"><span>2)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>暂存单号设置：<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:56.2pt;text-indent:-56.2pt;\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\ni.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><span>ZC+16</span>位数字；<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:56.2pt;text-indent:-56.2pt;\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\nii.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>前两位前缀“<span>ZC</span>”，第三位至第十四位为暂存单生成时间，具体到分钟，后<span>4</span>位为<span>0-9</span>随机组合；<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:60pt;text-indent:0cm;\"><span>Eg. ZC2017072718271234</span></p>\n暂存单有效期：不大于7天，否则不在 “暂存”中展示，但后台数据库保存；', '');
INSERT INTO `zt_storyspec` VALUES ('85', '1', '易鑫车服整体框架时序图', '<img src=\"{49.png}\" alt=\"\" />', '');
INSERT INTO `zt_storyspec` VALUES ('86', '1', '登录页（校验逻辑同安鑫保）', '<p class=\"MsoListParagraphCxSpFirst\" style=\"margin-left:39pt;text-indent:-21pt;\">l&nbsp; 手机号<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:60pt;text-indent:-21pt;\">Ø&nbsp; 手机号码为<span>11</span>位数字，输入框最多支持输入<span>11</span>位数字；<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:60pt;text-indent:-21pt;\">Ø&nbsp; 号段校验符合要求（<span>130-139</span>、<span>150-154</span>、<span>170</span>、<span>176</span>、<span>180-189</span>）；<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:60pt;text-indent:-21pt;\">Ø&nbsp; 点击手机号输入框时，调起原生数字键盘。<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:39pt;text-indent:-21pt;\">l&nbsp; 验证码<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:60pt;text-indent:-21pt;\">Ø&nbsp; 验证码为<span>4</span>位数字，有效期<span>15</span>分钟，最小发送间隔<span>60</span>秒，且一个验证码只允许验证一次；<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:60pt;text-indent:-21pt;\">Ø&nbsp; 同一手机号每天最多接收<span>10</span>条验证码；<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:60pt;text-indent:-21pt;\">Ø&nbsp; 短信文案：【淘车车主】验证码：<span>xxxx</span>，<span>15</span>分钟内有效，如非本人操作，请忽略本短信；<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:60pt;text-indent:-21pt;\">Ø&nbsp; 点击验证码按钮时，校验手机号是否符合规则：<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:39pt;text-indent:55pt;\">合规：发送短信验证码<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:39pt;text-indent:55pt;\">不合规：<span>Toast</span>提示【请输入正确的手机号】<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:39pt;text-indent:-21pt;\">l&nbsp; 登录<span>/</span>注册按钮<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:60pt;text-indent:-21pt;\">Ø&nbsp; 点击登录<span>/</span>注册按钮时，判断手机号和验证码是否符合规则：<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:39pt;text-indent:55pt;\">合规：判断验证码是否正确<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:11pt;text-indent:77pt;\">不合规：<span>Toast</span>提示【请输入正确的手机号】<span>/</span>【请输入正确的验证码】<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:60pt;text-indent:-21pt;\">Ø&nbsp; 判断验证码是否正确：<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:60pt;text-indent:0cm;\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>正确：判断是否已注册用户<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:60pt;text-indent:0cm;\"><span>&nbsp;&nbsp;&nbsp;&nbsp; </span>不正确：<span>Toast</span>提示【请输入正确的验证码】<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:60pt;text-indent:-21pt;\">Ø&nbsp; 判断是否已注册用户：<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:60pt;text-indent:0cm;\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>已注册：跳转首页<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:60pt;text-indent:0cm;\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>未注册：弹注册弹窗<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:39pt;text-indent:-21pt;\">l&nbsp; 注册弹窗<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:60pt;text-indent:-21pt;\">Ø&nbsp; 点击姓名栏调起原生拼音键盘；<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:60pt;text-indent:-21pt;\">Ø&nbsp; 姓名栏最多允许输入<span>30</span>个半角字符；<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:60pt;text-indent:-21pt;\">Ø&nbsp; 分销代码为<span>6</span>位数字字母组合，不区分大小写；<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:60pt;text-indent:-21pt;\">Ø&nbsp; 分销代码栏点击调起原生字母键盘；<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:60pt;text-indent:-21pt;\">Ø&nbsp; 分销代码栏最多支持输入<span>10</span>个半角字符；<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:60pt;text-indent:-21pt;\">Ø&nbsp; 确定注册提示【已提交注册申请】；取消注册则取消弹窗，停在当前页；<span></span></p>\n<p class=\"MsoListParagraphCxSpLast\" style=\"margin-left:60pt;text-indent:-21pt;\"><s>Ø&nbsp; </s><s>注册审核通过后，发送账号开通短信。</s>注册不需审核<s><span></span></s></p>', '');
INSERT INTO `zt_storyspec` VALUES ('87', '1', '登录页（校验逻辑同安鑫保）', '<p class=\"MsoListParagraphCxSpFirst\" style=\"margin-left:39pt;text-indent:-21pt;\">l&nbsp; 手机号<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:60pt;text-indent:-21pt;\">Ø&nbsp; 手机号码为<span>11</span>位数字，输入框最多支持输入<span>11</span>位数字；<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:60pt;text-indent:-21pt;\">Ø&nbsp; 号段校验符合要求（<span>130-139</span>、<span>150-154</span>、<span>170</span>、<span>176</span>、<span>180-189</span>）；<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:60pt;text-indent:-21pt;\">Ø&nbsp; 点击手机号输入框时，调起原生数字键盘。<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:39pt;text-indent:-21pt;\">l&nbsp; 验证码<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:60pt;text-indent:-21pt;\">Ø&nbsp; 验证码为<span>4</span>位数字，有效期<span>15</span>分钟，最小发送间隔<span>60</span>秒，且一个验证码只允许验证一次；<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:60pt;text-indent:-21pt;\">Ø&nbsp; 同一手机号每天最多接收<span>10</span>条验证码；<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:60pt;text-indent:-21pt;\">Ø&nbsp; 短信文案：【淘车车主】验证码：<span>xxxx</span>，<span>15</span>分钟内有效，如非本人操作，请忽略本短信；<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:60pt;text-indent:-21pt;\">Ø&nbsp; 点击验证码按钮时，校验手机号是否符合规则：<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:39pt;text-indent:55pt;\">合规：发送短信验证码<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:39pt;text-indent:55pt;\">不合规：<span>Toast</span>提示【请输入正确的手机号】<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:39pt;text-indent:-21pt;\">l&nbsp; 登录<span>/</span>注册按钮<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:60pt;text-indent:-21pt;\">Ø&nbsp; 点击登录<span>/</span>注册按钮时，判断手机号和验证码是否符合规则：<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:39pt;text-indent:55pt;\">合规：判断验证码是否正确<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:11pt;text-indent:77pt;\">不合规：<span>Toast</span>提示【请输入正确的手机号】<span>/</span>【请输入正确的验证码】<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:60pt;text-indent:-21pt;\">Ø&nbsp; 判断验证码是否正确：<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:60pt;text-indent:0cm;\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>正确：判断是否已注册用户<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:60pt;text-indent:0cm;\"><span>&nbsp;&nbsp;&nbsp;&nbsp; </span>不正确：<span>Toast</span>提示【请输入正确的验证码】<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:60pt;text-indent:-21pt;\">Ø&nbsp; 判断是否已注册用户：<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:60pt;text-indent:0cm;\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>已注册：跳转首页<span></span></p>\n<p class=\"MsoListParagraphCxSpLast\" style=\"margin-left:60pt;text-indent:0cm;\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>未注册：自动注册并跳转首页<span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('88', '1', '我的服务券', '<p class=\"MsoListParagraphCxSpFirst\" style=\"margin-left:39pt;text-indent:-21pt;\">l&nbsp; 客服电话固定展示：13581119311<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:39pt;text-indent:-21pt;\">l&nbsp; 可使用的服务券<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:60pt;text-indent:-21pt;\">Ø&nbsp; 按到期时间倒序排列，最近过期的券排在前；<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:60pt;text-indent:-21pt;\">Ø&nbsp; 点击服务券，进入预约门店页面，根据服务券类型，展示能够提供该类型服务的门店列表；<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:60pt;text-indent:-21pt;\">Ø&nbsp; 点击门店，展示拨号弹窗；<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:39pt;text-indent:-21pt;\">l&nbsp; 不可使用的优惠券<span></span></p>\n<p class=\"MsoListParagraphCxSpLast\" style=\"margin-left:60pt;text-indent:-21pt;\">Ø&nbsp; 优惠券不可点击<span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('89', '1', '填写订单', '<p class=\"MsoListParagraphCxSpFirst\" style=\"margin-left:39pt;text-indent:-21pt;\">l&nbsp; 车主信息<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:54pt;text-indent:-21pt;\">Ø&nbsp; 姓名栏最多允许输入<span>30</span>个半角字符；<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:54pt;text-indent:-21pt;\">Ø&nbsp; 身份证号为<span>18</span>位数字；<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:54pt;text-indent:-21pt;\">Ø&nbsp; 手机号为<span>11</span>位数字<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:39pt;text-indent:-21pt;\">l&nbsp; 车辆信息<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:54pt;text-indent:-21pt;\">Ø&nbsp; 车牌号最多输入<span>9</span>位半角字符，默认展示 豫；<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:54pt;text-indent:-21pt;\">Ø&nbsp; 车架号为<span>17</span>位数字<span>+</span>字母组合；<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:54pt;text-indent:-21pt;\">Ø&nbsp; 发动机号最多允许输入<span>35</span>位半角字符；<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:39pt;text-indent:-21pt;\">l&nbsp; 证照上传<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:54pt;text-indent:-21pt;\">Ø&nbsp; 点击调起相册，最多允许上传<span>9</span>张照片<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:39pt;text-indent:-21pt;\">l&nbsp; 购买须知<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:54pt;text-indent:-21pt;\">Ø&nbsp; 纯文本页面，文案滞后提供<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:39pt;text-indent:-21pt;\">l&nbsp; 提交审核<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:54pt;text-indent:-21pt;\">Ø&nbsp; 点击提交审核按钮，弹窗提示是否确认提交平台审核：<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:39pt;text-indent:21.75pt;\">确定：提示提交成功，请<span>5</span>分钟后进入我的订单查看审核结果。页面跳转首页。<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:39pt;text-indent:21.75pt;\">取消：关闭弹窗，页面停在当前页<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:54pt;text-indent:-21pt;\">Ø&nbsp; 订单审核结果短信通知<span>B</span>端渠道。短信文案：<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:110pt;text-indent:-55pt;\">审核通过：【淘车车主】订单号xxxxxxxxx审核通过，请尽快付款，付款后将向车主发送服务券。</p>\n<p class=\"MsoListParagraphCxSpLast\" style=\"margin-left:110pt;text-indent:-55pt;\">审核不通过：【淘车车主】订单号xxxxxxxxx未审核通过，原因：xxxx，如需购买，请进入我的订单修改后提交审核。<span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('90', '1', '订单状态机', '<img src=\"{50.png}\" alt=\"\" />', '');
INSERT INTO `zt_storyspec` VALUES ('91', '1', '订单列表', '<p class=\"MsoListParagraphCxSpFirst\" style=\"margin-left:54pt;text-indent:-21pt;\">Ø&nbsp; 按生单时间倒序排序；<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:54pt;text-indent:-21pt;\">Ø&nbsp; 进入页面时加载<span>20</span>条数据，向下滑动时再次加载<span>20</span>条数据；<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:54pt;text-indent:-21pt;\">Ø&nbsp; 点击数据进入订单详情页；<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:54pt;text-indent:-21pt;\">Ø&nbsp; 待付款状态展示支付按钮；<span></span></p>\n<p class=\"MsoListParagraphCxSpLast\" style=\"margin-left:54pt;text-indent:-21pt;\">Ø&nbsp; 待修改状态展示失败原因。<span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('92', '1', '订单详情页', '<p class=\"MsoListParagraphCxSpFirst\" style=\"margin-left:55.5pt;text-indent:-21pt;\">Ø&nbsp; 只有待付款状态展示立即支付按钮；<span></span></p>\n<p class=\"MsoListParagraphCxSpLast\" style=\"margin-left:55.5pt;text-indent:-21pt;\">Ø&nbsp; 点击立即支付按钮，调起微信<span>H5</span>支付。<span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('93', '1', '分销代码', '<p class=\"MsoListParagraphCxSpFirst\" style=\"margin-left:60.95pt;text-indent:-21pt;\">Ø&nbsp; <span>B</span>端销售渠道最多支持<span>3</span>级分销，一级分销由开发开账号；<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:60.95pt;text-indent:-21pt;\">Ø&nbsp; 一级、二级分销会生成分销代码，三级分销不生成分销代码，<span></span></p>\n<p class=\"MsoListParagraphCxSpLast\" style=\"margin-left:60.95pt;text-indent:-21pt;\">Ø&nbsp; 三级分销该页面为空白页，展示文案，您的上级代理为<span>xxx</span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('94', '1', '团队列表', '<p class=\"MsoListParagraphCxSpFirst\" style=\"margin-left:60.75pt;text-indent:-21pt;\">Ø&nbsp; 若无团队成员，成员列表区域展示文案【您的团队还没有成员，请多努力！】<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:60.75pt;text-indent:-21pt;\">Ø&nbsp; 按照入团时间倒序排列；<span></span></p>\n<p class=\"MsoListParagraphCxSpLast\" style=\"margin-left:60.75pt;text-indent:-21pt;\">Ø&nbsp; 进入页面时加载<span>20</span>条数据，向下滑动时再次加载<span>20</span>条数据；<span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('95', '1', '服务券规则', '<p class=\"MsoListParagraphCxSpFirst\" style=\"margin-left:60pt;text-indent:-21pt;\">Ø&nbsp; 服务券分为小保养券、喷漆券、外观件券<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:60pt;text-indent:-21pt;\">Ø&nbsp; 支付成功后生成服务包，包含小保养券<span>*2</span>，喷漆券<span>*2</span>、外观件券<span>*1</span>。每个<s>服务包有单独的服务包</s><s><span>ID</span></s>，每张服务券有单独的券<span>ID</span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:60pt;text-indent:-21pt;\">Ø&nbsp; 服务券有效期为<span>1</span>年<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:60pt;text-indent:-21pt;\">Ø&nbsp; 服务券有城市属性，仅限本城市使用<span></span></p>\n<p class=\"MsoListParagraphCxSpLast\" style=\"margin-left:60pt;text-indent:-21pt;\">Ø&nbsp; 服务券生成后短信通知用户，短信文案：【淘车车主】全车宝服务券已入账，有效期一年，请关注微信公众号<span>“</span>淘车车主服务<span>”</span>，进入我的服务券查看。如有问题，请致电客服：<span>13581119311</span>。<span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('96', '1', '服务券状态', '<img src=\"{51.png}\" alt=\"\" />', '');
INSERT INTO `zt_storyspec` VALUES ('97', '1', '安心意外险', '<p class=\"MsoListParagraphCxSpFirst\" style=\"margin-left:39pt;text-indent:-21pt;vertical-align:baseline;\">l&nbsp; 运营后台确认订单审核通过时，调安心意外险核保接口。</p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:60pt;text-indent:-21pt;vertical-align:baseline;\">Ø&nbsp; 若核保通过，则修改订单状态为待付款；</p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:60pt;text-indent:-21pt;vertical-align:baseline;\">Ø&nbsp; 若核保不通过，则修改订单状态失败，订单状态仍为待审核。</p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent:-21pt;vertical-align:baseline;\">l&nbsp; 用户支付成功后，生成服务券码，并调安心意外险出单接口。</p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"text-indent:-21pt;vertical-align:baseline;\">Ø&nbsp; 若出单成功，订单状态改为已完成；</p>\n<p class=\"MsoListParagraphCxSpLast\" style=\"text-indent:-21pt;vertical-align:baseline;\">Ø&nbsp; 若出单失败，订单状态改为已完成，发送短信报警。报警文案：【淘车车主】订单号xxxxxxxxxxx，意外险出单失败，请处理！</p>', '');
INSERT INTO `zt_storyspec` VALUES ('98', '1', '登录页（校验逻辑同安鑫保）', '<p class=\"MsoListParagraphCxSpFirst\" style=\"margin-left:39pt;text-indent:-21pt;\">l&nbsp; 账号密码<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:54pt;text-indent:-21pt;\">Ø&nbsp; 由开发开设账号，暂不允许注册和修改密码；<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:54pt;text-indent:-21pt;\">Ø&nbsp; 点击登录判断账号密码是否正确<span>:</span></p>\n<p class=\"MsoListParagraphCxSpLast\" style=\"margin-left:54pt;text-indent:21.75pt;\">正确：跳转券码核销页；<span></span></p>\n<p class=\"MsoNormal\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>不正确：<span>Toast</span>提示【请输入正确的账号】<span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('99', '1', '核销', '<p class=\"MsoListParagraphCxSpFirst\" style=\"margin-left:60pt;text-indent:-21pt;\">Ø&nbsp; 每张服务券只允许被核销一次；<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:60pt;text-indent:-21pt;\">Ø&nbsp; 点击确定按钮判断服务券状态是否有效且在有效期内：<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:60pt;text-indent:21.75pt;\">是：判断服务券城市与<span>F</span>端门店是否相符；<span></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:60pt;text-indent:21.75pt;\">否：<span>Toast</span>提示【服务券不存在】；<span></span></p>\n<p class=\"MsoListParagraphCxSpLast\" style=\"margin-left:60pt;text-indent:-21pt;\">Ø&nbsp; 判断服务券城市与<span>F</span>端门店是否相符<span></span></p>\n<p class=\"MsoNormal\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>是：弹窗确认是否核销<span></span></p>\n<p class=\"MsoNormal\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>否：<span>Toast</span>提示【服务券不存在】<span></span></p>\n<p class=\"MsoListParagraphCxSpFirst\" style=\"margin-left:60pt;text-indent:-21pt;\">Ø&nbsp; 确认核销后，服务券状态变更为已使用，弹窗提示【核销成功，请提供服务】<span></span></p>\n<p class=\"MsoListParagraphCxSpLast\" style=\"margin-left:60pt;text-indent:-21pt;\">Ø&nbsp; 服务券核销后需要短信通知<span>C</span>端车主<span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('100', '1', '导出报表', '<p class=\"MsoListParagraphCxSpFirst\" style=\"margin-left:60pt;text-indent:-21pt;\">Ø&nbsp; <span>PC</span>端<span>H5</span>上标题栏，展示入口；<span></span></p>\n<p class=\"MsoListParagraphCxSpLast\" style=\"margin-left:60pt;text-indent:-21pt;\">Ø&nbsp; 根据生单时间导出<span>excel</span>，字段滞后提供<span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('38', '2', '1、投保城市与保险公司对应表', '<p class=\"MsoListParagraph\" style=\"margin-left:39pt;text-indent:-21pt;\"></p><p class=\"MsoNormal\" style=\"text-indent:21pt;\">建立投保城市和保险公司对应表；选择不同的投保城市，在选择车型、报价、核保时调不同保险公司接口。<span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\">字段：投保城市、保险公司、是否有效。<span></span></p>\n\n<p class=\"MsoListParagraph\" style=\"margin-left:39pt;text-indent:-21pt;\"><span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('101', '1', '填写车辆信息--品牌型号选择', '<p class=\"MsoNormal\">填写信息页选择品牌型号时，根据车辆型号查询天平的车型库，页面展示天平的查询结果。用户选择品牌型号后，用已选择的厂牌型号<span>+</span>新车购置价（不含税）匹配众安的车型信息，如果匹配到惟一值，则对应众安的此车型。调<span>V3.2.1</span>接口匹配众安车型。<span></span></p>\n如果根据厂牌型号<span>+</span>新车购置价没有匹配到众安车型，则报价时展示为众安报价失败。失败原因：没有查询到此车型。', '');
INSERT INTO `zt_storyspec` VALUES ('45', '2', '1车辆信息', '<p class=\"MsoListParagraph\" style=\"margin-left:39pt;text-indent:0cm;\">包含：车架号、发动机号、初登日期、品牌型号、是否过户、是否按揭、交强险起保日期、商业险起保日期<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:57pt;text-indent:-57pt;\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\ni.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>车架号<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:-21pt;\"><span>A.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>默认展现“请输入<span>17</span>位车架号”<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:-21pt;\"><span>B.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>手动输入<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:-21pt;\"><span>a)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>调用键盘<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:0cm;\"><span>iOS</span>为英文<span>+</span>数字二合一键盘；<span>Android</span>和其他系统为系统默认键盘<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:-21pt;\"><span>b)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>输入限制<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:120pt;text-indent:-21pt;\">Ø&nbsp; 输入类型<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:120pt;text-indent:0cm;\"><span>26</span>个英文字母<span>+</span>纯数字；其他字符输入也不显示<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:120pt;text-indent:-21pt;\">Ø&nbsp; 输入字数限制<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:120pt;text-indent:0cm;\"><span>17</span>位，超出后输入无展现<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:120pt;text-indent:-21pt;\">Ø&nbsp; 英文大小写自动转换<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:120pt;text-indent:0cm;\">小写字母输入自动转换成大写字母<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:-21pt;\"><span>c)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>输入完成显示<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:120pt;text-indent:-21pt;\">Ø&nbsp; 当第一个输入进去，自动清掉默认展现值；<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:120pt;text-indent:-21pt;\">Ø&nbsp; 右对齐<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:120pt;text-indent:-21pt;\">Ø&nbsp; 折行<span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent:126pt;\">在限定展现范围内（以UI图为准），如遇屏幕太小，则自动折行<span></span></p>\n<p class=\"MsoNormal\"><span>&nbsp;</span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:57pt;text-indent:-57pt;\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\nii.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>发动机号<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:-21pt;\"><span>A.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>无默认展现<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:-21pt;\"><span>B.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>手动输入<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:-21pt;\"><span>a)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>调用键盘<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:0cm;\"><span>iOS</span>为英文<span>+</span>数字二合一键盘；<span>Android</span>和其他系统为系统默认键盘<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:-21pt;\"><span>b)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>输入限制<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:120pt;text-indent:-21pt;\">Ø&nbsp; 输入类型<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:120pt;text-indent:0cm;\"><span>26</span>个英文字母<span>+</span>纯数字；其他字符输入也不显示<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:120pt;text-indent:-21pt;\">Ø&nbsp; 输入字数限制<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:120pt;text-indent:0cm;\">最长13位，超出后输入无展现<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:120pt;text-indent:-21pt;\">Ø&nbsp; 英文大小写自动转换<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:120pt;text-indent:0cm;\">小写字母输入自动转换成大写字母<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:-21pt;\"><span>c)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>输入完成显示<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:120pt;text-indent:-21pt;\">Ø&nbsp; 当第一个输入进去，自动清掉默认展现值；<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:120pt;text-indent:-21pt;\">Ø&nbsp; 右对齐<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:120pt;text-indent:-21pt;\">Ø&nbsp; 折行<span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent:126pt;\">在限定展现范围内，如遇屏幕太小，则自动折行<span></span></p>\n<p class=\"MsoNormal\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:0cm;\"><span>&nbsp;</span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:57pt;text-indent:-57pt;\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\niii.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>初登日期<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:-21pt;\"><span>A.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>默认展现：“请选择”<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:-21pt;\"><span>B.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>点击通栏，触发选择控件，样式为如下地址：（以<span>iOS</span>为例）<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:0cm;\"><span><a href=\"https://modao.cc/workspace/apps/pB0601502EE1500950458258/preview\">https://modao.cc/workspace/apps/pB0601502EE1500950458258/preview</a></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:0cm;\"><span></span><img src=\"{9.png}\" alt=\"\" />部分<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:-21pt;\"><span>C.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>选择内容：当天以前数<span>15</span>年，调起后默认当天<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:-21pt;\"><span>D.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>选择完成后，显示样式如下（年<span>-</span>月<span>-</span>日）：<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:-21pt;\"><img src=\"{10.png}\" alt=\"\" /></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:0cm;\"><span></span><span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:57pt;text-indent:-57pt;\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\niv.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>品牌型号<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:-21pt;\"><span>A.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>默认值：请选择<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:-21pt;\"><span>B.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>点击通栏，触发搜索，样式地址如下：<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:0cm;\"><span>https://modao.cc/workspace/apps/pB0601502EE1500950458258/preview</span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:0cm;\"><span>&nbsp;<img src=\"{11.png}\" alt=\"\" /></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:0cm;\"><span></span><span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:-21pt;\"><span>a)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>默认样式：填写示例<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:-21pt;\"><span>b)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>输入键盘：统一调系统默认键盘<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:-21pt;\"><span>c)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>搜索触发：点击搜索图标<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:-21pt;\"><span>d)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>搜索结果<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:0cm;\">展现：年代款+厂牌型号+新车购置价</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:0cm;\">如：201011 北京奔驰牌SLN849 ¥480888<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:-21pt;\"><span>e)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>选择结果<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:0cm;\">通栏触发选择，跳转至“填写信息”页面<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:-21pt;\"><span>f)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>选择完成<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:0cm;\">展现“厂牌型号”，超长自动折段<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:0cm;\">如：北京奔驰牌<span>SLN849</span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:0cm;\"><span><br /></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:0cm;\"><span><br /></span></p>\n<p class=\"MsoNormal\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></p>\n<p class=\"MsoNormal\"><span></span></p><p class=\"MsoNormal\">填写信息页选择品牌型号时，根据车辆型号查询天平的车型库，页面展示天平的查询结果。用户选择品牌型号后，用已选择的厂牌型号+新车购置价（不含税）匹配众安的车型信息，如果匹配到惟一值，则对应众安的此车型。调V3.2.1接口匹配众安车型。</p>\n<span>如果根据厂牌型号</span><span>+</span><span>新车购置价没有匹配到众安车型，则报价时展示为众安报价失败。失败原因：没有查询到此车型。</span><br />\n<p class=\"MsoNormal\"><span><br /></span></p>\n<p class=\"MsoNormal\"><span><br /></span></p>\n<p class=\"MsoNormal\"><span><br /></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:57pt;text-indent:-57pt;\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\nv.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>是否过户<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:-21pt;\"><span>A.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>开关默认：开启<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:-21pt;\"><span>B.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>联动显示过户日期，初始显示“请选择过户日期”，点击通栏触发选择日期控件，显示选择结果为：“年<span>-</span>月<span>-</span>日”，如“<span>2012-02-01</span>”，调起后默认选项为当天<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:-21pt;\"><span>C.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>开关关闭后，收起过户日期，原先若有选择日期也置于无效<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:0cm;\"><span>&nbsp;</span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:0cm;\"><span>&nbsp;</span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:57pt;text-indent:-57pt;\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\nvi.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>是否按揭<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:57pt;text-indent:0cm;\"><span>A</span>、开关默认：开启<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:57pt;text-indent:0cm;\"><span>B</span>、联动显示“第一受益人”，默认第一受益人为“上海融资租赁有限公司”（目前只有郑州，以后会分公司分地区分业务线），用户可修改第一受益人，<span><br /></span>点击通栏调系统默认键盘；输入位数最长<span>15</span>位，超长自动折行<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:57pt;text-indent:0cm;\"><span>&nbsp;</span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:57pt;text-indent:-57pt;\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\nvii.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>交强险起保日期<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:57pt;text-indent:0cm;\">默认显示“请选择”，通栏可点，调用选择控件，年月日选项，选择范围：明天起至<span>90</span>自然日后的年月日选项，如今天是<span>20170101</span>，那么选项为，<span>20170102-20170401</span>区间<span></span></p>\n调起控件后默认选项为当天', '');
INSERT INTO `zt_storyspec` VALUES ('47', '2', '3.	车主信息', '<p class=\"MsoListParagraph\" style=\"margin-left:39pt;text-indent:0cm;\">包含：车主姓名、车主身份证、车主手机<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:77.7pt;text-indent:-21pt;\"><span>A.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>车主姓名<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:77.7pt;text-indent:0cm;\">调用系统默认键盘，输入位数控制<span>15</span>位，超出不显示，超长折行<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:77.7pt;text-indent:-21pt;\"><span>B.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>车主身份证<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:77.7pt;text-indent:0cm;\"><span>iOS</span>调用英文<span>+</span>数字键盘、其他系统调用默认键盘；输入位数控制<span>18</span>位，超出不显示，超长折行；只能输入英文和数字，其他的输入不显示<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:77.7pt;text-indent:-21pt;\"><span>C.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>手机号码<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:77.7pt;text-indent:0cm;\"><span>iOS</span>调用数字键盘，其他系统调用系统默认键盘；输入位数控制<span>11</span>位，只能输入数字，超长折行；<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:77.7pt;text-indent:0cm;\"><br /></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:77.7pt;text-indent:0cm;\"><br /></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:77.7pt;text-indent:0cm;\"><br /></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:77.7pt;text-indent:0cm;\"></p><h2>车主为企业时<span></span></h2>\n<p class=\"MsoNormal\">&nbsp;&nbsp; 车辆性质选择非营业<span>-</span>企业用车或营业<span>-</span>企业用车时，车主所属性质为企业。众安需要单位区号<span>+</span>单位电话号码，必传。传默认值，“<span>010</span>—<span>11111111</span>“。</p>\n<p class=\"MsoNormal\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 车主性别和车主生日传一个默认值，“男”，“<span>1980-01-01</span>”。<span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\">增加社会信用代码校验，众安有校验规则，调<span>V3.3.3</span>第<span>9</span>小节接口。<span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\">用户点击去核保，调<span>V3.6.1</span>时，当车主性质为企业时众安发票相关字段必传，发票抬头：默认同投保人姓名，不允许修改。发票类型默认为普通发票。增加税号字段，非必填。<span></span></p>\n', '');
INSERT INTO `zt_storyspec` VALUES ('34', '3', '登录', '<p class=\"MsoNormal\" style=\"text-indent:21pt;\">如下图所示：<span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\"><img src=\"{3.png}\" alt=\"\" /></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\"><b>特殊说明：<span></span></b></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\">1、手机号不存在时提示：此账号不存在；<span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\">2、手机号存在，密码错误时提示：密码错误；<span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\">3、密码连续输入错误<span>5</span>次，账号当天锁定。连续输入错误第<span>3</span>次时提示：密码错误，还有<span>2</span>次账号将锁定。<span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\">6、<span>token</span>有效期<span>7</span>天。即距上次登录<span>7</span>天时，账号自动退出。<span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\"><br /></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\">测试加的</p>', '');
INSERT INTO `zt_storyspec` VALUES ('102', '1', '填写信息-车辆信息-车架号', '<p>车辆信息<span>包含：车架号、发动机号、初登日期、品牌型号、是否过户、是否按揭、交强险起保日期、商业险起保日期</span></p>\n<p><br /></p>\n<p></p><p class=\"MsoListParagraph\" style=\"margin-left:57pt;text-indent:-57pt;\">车架号</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:-21pt;\">A.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;默认展现“请输入17位车架号”</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:-21pt;\">B.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;手动输入</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:-21pt;\">a)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;调用键盘</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:0cm;\">iOS为英文+数字二合一键盘；Android和其他系统为系统默认键盘</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:-21pt;\">b)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;输入限制</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:120pt;text-indent:-21pt;\">Ø&nbsp; 输入类型</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:120pt;text-indent:0cm;\">26个英文字母+纯数字；其他字符输入也不显示</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:120pt;text-indent:-21pt;\">Ø&nbsp; 输入字数限制</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:120pt;text-indent:0cm;\">17位，超出后输入无展现</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:120pt;text-indent:-21pt;\">Ø&nbsp; 英文大小写自动转换</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:120pt;text-indent:0cm;\">小写字母输入自动转换成大写字母</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:-21pt;\">c)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;输入完成显示</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:120pt;text-indent:-21pt;\">Ø&nbsp; 当第一个输入进去，自动清掉默认展现值；</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:120pt;text-indent:-21pt;\">Ø&nbsp; 右对齐</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:120pt;text-indent:-21pt;\">Ø&nbsp; 折行</p>\n<p class=\"MsoNormal\" style=\"text-indent:126pt;\">在限定展现范围内（以UI图为准），如遇屏幕太小，则自动折行</p>\n\n<p><br /></p>', '');
INSERT INTO `zt_storyspec` VALUES ('103', '1', '填写信息-车辆信息-发动机号', '<p class=\"MsoListParagraph\" style=\"margin-left:57pt;text-indent:-57pt;\">发动机号</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:-21pt;\">A.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;无默认展现</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:-21pt;\">B.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;手动输入</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:-21pt;\">a)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;调用键盘</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:0cm;\">iOS为英文+数字二合一键盘；Android和其他系统为系统默认键盘</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:-21pt;\">b)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;输入限制</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:120pt;text-indent:-21pt;\">Ø&nbsp; 输入类型</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:120pt;text-indent:0cm;\">26个英文字母+纯数字；其他字符输入也不显示</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:120pt;text-indent:-21pt;\">Ø&nbsp; 输入字数限制</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:120pt;text-indent:0cm;\">最长13位，超出后输入无展现</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:120pt;text-indent:-21pt;\">Ø&nbsp; 英文大小写自动转换</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:120pt;text-indent:0cm;\">小写字母输入自动转换成大写字母</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:-21pt;\">c)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;输入完成显示</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:120pt;text-indent:-21pt;\">Ø&nbsp; 当第一个输入进去，自动清掉默认展现值；</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:120pt;text-indent:-21pt;\">Ø&nbsp; 右对齐</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:120pt;text-indent:-21pt;\">Ø&nbsp; 折行</p>\n<p class=\"MsoNormal\" style=\"text-indent:126pt;\">在限定展现范围内，如遇屏幕太小，则自动折行</p>', '');
INSERT INTO `zt_storyspec` VALUES ('104', '1', '填写信息-车辆信息-初登日期', '<p class=\"MsoListParagraph\" style=\"margin-left:57pt;text-indent:-57pt;\">初登日期</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:-21pt;\">A.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;默认展现：“请选择”</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:-21pt;\">B.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;点击通栏，触发选择控件，样式为如下地址：（以iOS为例）</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:0cm;\"><a href=\"https://modao.cc/workspace/apps/pB0601502EE1500950458258/preview\">https://modao.cc/workspace/apps/pB0601502EE1500950458258/preview</a></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:0cm;\"><a href=\"/zentao/file-read-9.png\" target=\"_blank\" rel=\"noreferrer noopener\"><img src=\"{9.png}\" alt=\"\" /></a>部分</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:-21pt;\">C.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;选择内容：当天以前数15年，调起后默认当天</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:-21pt;\">D.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;选择完成后，显示样式如下（年-月-日）：</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:-21pt;\"><a href=\"/zentao/file-read-10.png\" target=\"_blank\" rel=\"noreferrer noopener\"><img src=\"{10.png}\" alt=\"\" /></a></p>', '');
INSERT INTO `zt_storyspec` VALUES ('105', '1', '填写信息-车辆信息-品牌型号', '<p class=\"MsoListParagraph\" style=\"margin-left:57pt;text-indent:-57pt;\">品牌型号</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:-21pt;\">A.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;默认值：请选择</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:-21pt;\">B.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;点击通栏，触发搜索，样式地址如下：</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:0cm;\">https://modao.cc/workspace/apps/pB0601502EE1500950458258/preview</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:0cm;\">&nbsp;<a href=\"/zentao/file-read-11.png\" target=\"_blank\" rel=\"noreferrer noopener\"><img src=\"{11.png}\" alt=\"\" /></a></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:-21pt;\">a)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;默认样式：填写示例</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:-21pt;\">b)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;输入键盘：统一调系统默认键盘</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:-21pt;\">c)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;搜索触发：点击搜索图标</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:-21pt;\">d)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;搜索结果</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:0cm;\">展现：年代款+厂牌型号+新车购置价</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:0cm;\">如：201011 北京奔驰牌SLN849 ¥480888</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:-21pt;\">e)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;选择结果</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:0cm;\">通栏触发选择，跳转至“填写信息”页面</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:-21pt;\">f)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;选择完成</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:0cm;\">展现“厂牌型号”，超长自动折段</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:0cm;\">如：北京奔驰牌SLN849</p>', '');
INSERT INTO `zt_storyspec` VALUES ('105', '2', '填写信息-车辆信息-品牌型号', '<p class=\"MsoListParagraph\" style=\"margin-left:57pt;text-indent:-57pt;\">品牌型号</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:-21pt;\">A.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;默认值：请选择</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:-21pt;\">B.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;点击通栏，触发搜索，样式地址如下：</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:0cm;\">https://modao.cc/workspace/apps/pB0601502EE1500950458258/preview</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:0cm;\">&nbsp;<a href=\"/zentao/file-read-11.png\" target=\"_blank\" rel=\"noreferrer noopener\"><img src=\"{11.png}\" alt=\"\" /></a></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:-21pt;\">a)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;默认样式：填写示例</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:-21pt;\">b)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;输入键盘：统一调系统默认键盘</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:-21pt;\">c)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;搜索触发：点击搜索图标</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:-21pt;\">d)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;搜索结果</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:0cm;\">展现：年代款+厂牌型号+新车购置价</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:0cm;\">如：201011 北京奔驰牌SLN849 ¥480888</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:-21pt;\">e)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;选择结果</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:0cm;\">通栏触发选择，跳转至“填写信息”页面</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:-21pt;\">f)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;选择完成</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:0cm;\">展现“厂牌型号”，超长自动折段</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:0cm;\">如：北京奔驰牌SLN849</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:0cm;\"><br /></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:0cm;\"><strong>接入众安后加入以下内容：</strong></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:0cm;\"><br /></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:99pt;text-indent:0cm;\"></p><p class=\"MsoNormal\">填写信息页选择品牌型号时，根据车辆型号查询天平的车型库，页面展示天平的查询结果。用户选择品牌型号后，用已选择的厂牌型号+新车购置价（不含税）匹配众安的车型信息，如果匹配到惟一值，则对应众安的此车型。调V3.2.1接口匹配众安车型。</p>\n<span>如果根据厂牌型号</span><span>+</span><span>新车购置价没有匹配到众安车型，则报价时展示为众安报价失败。失败原因：没有查询到此车型。</span>', '');
INSERT INTO `zt_storyspec` VALUES ('106', '1', '填写信息-车辆信息-是否过户', '<p class=\"MsoListParagraph\" style=\"margin-left:57pt;text-indent:-57pt;\">&nbsp;是否过户</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:-21pt;\">A.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;开关默认：开启</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:-21pt;\">B.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;联动显示过户日期，初始显示“请选择过户日期”，点击通栏触发选择日期控件，显示选择结果为：“年-月-日”，如“2012-02-01”，调起后默认选项为当天</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:78pt;text-indent:-21pt;\">C.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;开关关闭后，收起过户日期，原先若有选择日期也置于无效</p>', '');
INSERT INTO `zt_storyspec` VALUES ('107', '1', '填写信息-车辆信息-是否按揭', '<p class=\"MsoListParagraph\" style=\"margin-left:57pt;text-indent:-57pt;\">是否按揭</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:57pt;text-indent:0cm;\">A、开关默认：开启</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:57pt;text-indent:0cm;\">B、联动显示“第一受益人”，默认第一受益人为“上海融资租赁有限公司”（目前只有郑州，以后会分公司分地区分业务线），用户可修改第一受益人，<br />\n点击通栏调系统默认键盘；输入位数最长15位，超长自动折行</p>', '');
INSERT INTO `zt_storyspec` VALUES ('108', '1', '填写信息-车辆信息-交强险起保日期', '<p class=\"MsoListParagraph\" style=\"margin-left:57pt;text-indent:-57pt;\">交强险起保日期</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:57pt;text-indent:0cm;\">默认显示“请选择”，通栏可点，调用选择控件，年月日选项，选择范围：明天起至90自然日后的年月日选项，如今天是20170101，那么选项为，20170102-20170401区间</p>\n<span>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;调起控件后默认选项为当天</span>', '');
INSERT INTO `zt_storyspec` VALUES ('109', '1', '1.车辆信息-贷款车', '<p class=\"MsoNormal\">需要传贷款机构、贷款分支机构两个字段，需要先在众安新增上海易鑫融资租赁有限公司等贷款机构。用户选择后对应到众安的贷款机构。<span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('110', '1', '5.投保人信息', '<p class=\"MsoNormal\">投保人姓名、证件号码、证件类型、手机号、性别、生日、年龄、国籍信息默认和车主一致，众安需要传投保人邮箱，传默认值：<span style=\"color:#E53333;\">待申请公用邮箱。</span><span><span style=\"color:#E53333;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span>&nbsp;</span></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\">投保人省份编码、投保人城市编码、投保人区县编码、投保人地址，和目前天平处理方法一致。<span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('57', '2', '投保查询时机', '<p class=\"MsoNormal\">投保查询是信息验证通过过，获取报价前进行的一次投保查询，主要目的是防止交强险重复投保（商业险不限制）<span></span></p>\n<p class=\"MsoNormal\"><br /></p>\n<p class=\"MsoNormal\"><br /></p>\n<h4>投保查询时机<span></span></h4>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\">当用户点击“获取报价”，且信息校验通过时<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\"><br /></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\"><br /></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\"><strong>接入众安保险：</strong></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\"><strong><br /></strong></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\"></p><p class=\"MsoNormal\">点击获取价格按钮调<span>V3.3.1</span>接口，返回商业险险种和保额。报价页面展示天平的险种、保额。个别情况需要验证码。此步骤众安会返回投保流程编码，由众安生成，标识一次投保流程。<span></span></p>\n\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\"><span>&nbsp;</span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('54', '2', '填写-商业险', '<p class=\"MsoListParagraph\" style=\"margin-left:57.3pt;text-indent:0cm;\">商业险起保日期为前一个页面用户填写日期，本页面不可修改<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:49.35pt;text-indent:-21pt;\">l&nbsp; 车损险<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:49.35pt;text-indent:0cm;\">选择了该险后，保额部分可修改，数字和图标区域点击调起系统数字键盘（非<span>iOS</span>调默认键盘），完成修改以后，盗抢险的保额联动copy车损的保额<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:49.35pt;text-indent:-21pt;\">l&nbsp; 三者险<span>/</span>车上人员<span>-</span>司机险<span>/</span>车上人员<span>-</span>乘客险<span>/</span>划痕险<span>/</span>玻璃险<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:49.35pt;text-indent:0cm;\">调用选择控件，对应选项上方已附表<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:49.35pt;text-indent:0cm;\"><br /></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:49.35pt;text-indent:0cm;\"><strong>接入众安保险：</strong></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:49.35pt;text-indent:0cm;\"><br /></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:49.35pt;text-indent:0cm;\"></p><p class=\"MsoNormal\">点击获取价格按钮，调<span>V3.5.1</span>接口。盗抢险的保额和车损险一致，不可以调整。自燃险的保额和车损险一致，不可以调整。其它险种保额以用户填写为准。<span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\">车损险保额检验调整幅度和目前检验规则一致：即最低为实际价值的<span>0.8</span>倍、最高<span>1.3</span>倍。在选择方案页面做校验。同时，众安也会对车损险会有范围校验。<span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\">划痕险选择项和目前保持一致。<span></span></p>\n', '');
INSERT INTO `zt_storyspec` VALUES ('111', '1', '车辆实际价值', '<p class=\"MsoNormal\">&nbsp; &nbsp; &nbsp; &nbsp;同一车型，不同保险公司车辆实际价值可能不一样。所选投保城市，有多家保险公司时，报价页面展示默认用天平的。可以不调众安<span>V3.4.1</span>接口。<span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\">如果只有众安一家，调<span>V3.4.1</span>接口查询车辆实际价值。<span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('60', '2', '成功', '<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\"><img src=\"{28.png}\" alt=\"\" /></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\">显示要素：保险公司<span>logo</span>、保险公司名称、总价格、查看价格详情按钮、去核保按钮<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\"><span>&nbsp;</span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\">查看价格详情：<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\">点击原页面顺延下拉查看商业险和交强险价格详情，详见需求链接，上图只有商业险<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\">再次点击收起<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\"><span>&nbsp;</span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\"><span>P.S. </span>网络不好保险公司<span>logo</span>那里需要一个占位图，同理失败<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\"><br /></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\"><strong>接入众安保险：</strong></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\"><strong><br /></strong></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\"><br /></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\">用户点击获取价格按钮调<span>V3.3.1</span>、<span>V3.5.2</span>接口，展示多个保险公司的报价结果。异步展示，即一个保险报价成功就展示一个。<span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\"></p><p class=\"MsoNormal\" style=\"text-indent:21pt;\">成功：展示报价结果明细，样式和目前天平一致。<span></span></p>\n\n<p><br /></p>', '');
INSERT INTO `zt_storyspec` VALUES ('61', '2', '失败', '<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\"><span><img src=\"{29.png}\" alt=\"\" /><img src=\"{30.png}\" alt=\"\" /><br /></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\"><span>2.1</span>）显示要素：保险公司<span>logo</span>、保险公司名称、“报价失败”<span>4</span>个字，刷新报价结果按钮<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\"><span>2.2</span>）查看失败原因<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\"><span>&nbsp;&nbsp;&nbsp;&nbsp; </span>组成元素：标题<span>+</span>车牌<span>+</span>失败原因<span>+</span>具体原因<span>+</span>“我知道了”按钮<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\"><span>&nbsp;&nbsp;&nbsp;&nbsp; </span>如图所示<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\"><span>&nbsp;&nbsp;&nbsp;&nbsp; </span>超长加下拉框，点击“我知道了”或者非下拉框区域收起整个弹框<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\"><br /></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\"><strong>接入众安保险：</strong></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\">&nbsp; &nbsp; &nbsp;</p><p class=\"MsoNormal\" style=\"text-indent:21pt;\">失败：展示失败原因。<span></span></p>\n\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\"></p><p class=\"MsoNormal\" style=\"text-indent:21pt;\">众安保险，个别情况下，需要输入验证码才能查看报价结果。<span></span></p>\n', '');
INSERT INTO `zt_storyspec` VALUES ('63', '2', '上传照片', '<p><img src=\"{32.png}\" alt=\"\" /></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:54pt;text-indent:-36pt;\">1.1）&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\n温馨提示：由服务器下发，因为暂未知道需要传递内容，图示只是一个部分，后调研后及时通知</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:54pt;text-indent:-36pt;\"><span>1.2）&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>上传照片：相关操作如地址：<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:54pt;text-indent:0cm;\"><span><a href=\"https://modao.cc/workspace/apps/pB0601502EE1500950458258/preview\">https://modao.cc/workspace/apps/pB0601502EE1500950458258/preview</a><span class=\"MsoHyperlink\"></span></span></p>\n<img src=\"{33.png}\" alt=\"\" /><p><br /></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:54pt;text-indent:0cm;\">照片可增删，格式比例大小看安盛要求，待定<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:54pt;text-indent:-36pt;\"><span>1.1）&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>提交，进行核保<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:54pt;text-indent:0cm;\">沉底<span>+</span>固定；条款校验通过跳转到核保页面<span></span></p>\n<p><br /></p>\n<p><strong>接入众安保险：</strong></p>\n<p><strong><br /></strong></p>\n<p></p><p class=\"MsoNormal\">用户点击去核保按钮，调<span>V3.6.1</span>接口。<span>&nbsp; </span>众安也上传验车照片，样式和目前一致。是接口传还是线下传待最终和众安确认。<span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\">上传照片页面增加保险公司名称。<span></span></p>\n\n<p><br /></p>', '');
INSERT INTO `zt_storyspec` VALUES ('112', '1', '核保', '<p class=\"MsoNormal\">核保</p>\n<p class=\"MsoNormal\"><br /></p>\n<p class=\"MsoNormal\">需要传商户唯一订单号，每次投保流程必须使用不同的订单号，单次投保流程里多次调用该接口，要使用相同的订单号。<span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\"><a></a>众安收件人信息（收件人省份编码、收件人城市编码、收件人区县编码、收件人姓名、收件人详细地址、收件人手机号）必填，投保省市和收件人省市必须完全一致。收件人省份编码、收件人城市编码、收件人区县编码传投保城市默认值，收件人姓名、电话、地址传对应投保城市默认值\n。<span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\">建投保城市、收件人信息对应表。<span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\">字段：投保城市、收件人姓名、收件人电话、收件人详细地址。调<span>V3.6.1</span>接口时查此表传收件人信息。<span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('64', '2', '条款', '<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\">包含两个条款，一个是“商业险特别约定”、一个是“商业险补充约定”<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\">“商业险特别约定”默认勾选，<b>如果此项不勾选，“提交、进行核保”按钮置灰</b>，不可点击<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\">相关展示样式和文本内容如地址：<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\"><span><a href=\"https://modao.cc/workspace/apps/pB0601502EE1500950458258/preview\">https://modao.cc/workspace/apps/pB0601502EE1500950458258/preview</a><span class=\"MsoHyperlink\"></span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\"><br /></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\"><img src=\"{34.png}\" alt=\"\" /></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\"><br /></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\"><br /></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\"><br /></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\"><br /></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\"><strong>接入众安保险：</strong></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\"><strong><br /></strong></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\">保骉车险网络服务协议</p>\n<p class=\"MsoListParagraph\" style=\"margin-left:18pt;text-indent:0cm;\"></p><p class=\"MsoNormal\">上传照片页面，用户点击保骉车险网络服务协议，调<span>V3.9.1</span>接口，展示特别约定（商业险特别约定，贷款车增加补充约定）<b>特约描述</b>字段内容、投保声明。<span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\">同时展示免责声明、保险条款（商业险、交强险）。<span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\">&nbsp;</p>\n<p class=\"MsoNormal\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 调<span>V3.9.3</span>接口，链接到众安浮动告知单页面，所有浮动告知单展示项目由众安给出页面链接地址，由众安的浮动告知单页面展示。</p>\n', '');
INSERT INTO `zt_storyspec` VALUES ('113', '1', '核保验证码', '<p class=\"MsoNormal\" style=\"text-indent:21pt;\">众安保险，极少情况下，需要输入验证码才能查看核保结果。</p>', '');
INSERT INTO `zt_storyspec` VALUES ('83', '2', '订单生成', '<p class=\"MsoListParagraph\" style=\"margin-left:39pt;text-indent:-21pt;\"><span>1)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>点击【获取报价】生成一条订单，状态为已报价；<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:39pt;text-indent:-21pt;\"><span>2)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>多次点击【获取报价】，执行新增操作；<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:39pt;text-indent:-21pt;\"><span>3)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>一个车牌号可对应多条订单；<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:39pt;text-indent:-21pt;\"><span>4)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>订单号设置：<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:60pt;text-indent:-60pt;\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\ni.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><span>18</span>位数字；<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:60pt;text-indent:-60pt;\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\nii.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>前<span>14</span>位订单生成时间，具体到秒，后四位为<span>0-9</span>随机组合；<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:60pt;text-indent:0cm;\"><span>Eg. 2017072410361234</span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:60pt;text-indent:-60pt;\"><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\niii.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>综合险生成一个订单号<span></span></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:60pt;text-indent:-60pt;\"><br /></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:60pt;text-indent:-60pt;\"><br /></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:60pt;text-indent:-60pt;\"><strong>接入众安保险：</strong></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:60pt;text-indent:-60pt;\"><strong><br /></strong></p>\n<p class=\"MsoListParagraph\" style=\"margin-left:60pt;text-indent:-60pt;\"></p><p class=\"MsoNormal\">&nbsp; &nbsp; &nbsp; &nbsp; 报价结果页，选择某一保司点击去核保按钮，生成订单。每个订单只包含一家保险公司的报价信息、核保信息。从核保页面返回到报价结果页，刷新报价结果，可继续选择其它保司进行核保，同时生成其它保司的订单。<span></span></p>\n<p class=\"MsoNormal\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 用户选择某一保司去核保，核保过程中返回到基本信息页<span>/</span>选择险种页、重新报价，展示多家保险公司的报价结果，点击去投保按钮，不管是否已经有订单，都生成新的订单。<span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\">订单列表页待修改订单点击进到基本信息页、重新报价，只展示一家保险公司的报价结果。点击去投保按钮，是否更新原订单信息处理逻辑和目前一致。<span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\">订单状态、列表展示页面和目前一致。<span></span></p>\n', '');
INSERT INTO `zt_storyspec` VALUES ('114', '1', '订单列表', '<p class=\"MsoNormal\">调<span>V3.7.1</span>、<span>V3.8.1</span>查询订单状态，众安广东地区没有电子保单，不用查询电子保单。以<span>V3.8.1</span>保单状态对应安鑫保订单状态。<span></span></p>\n<p class=\"MsoNormal\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 众安订单状态<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>安鑫保订单状态<span></span></p>\n<p class=\"MsoNormal\" align=\"left\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 3已投保、待支付<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>待支付<span></span></p>\n<p class=\"MsoNormal\" align=\"left\" style=\"text-indent:21pt;\">4已支付待出单<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>已支付<span></span></p>\n<p class=\"MsoNormal\" align=\"left\" style=\"text-indent:21pt;\">5已支付出单失败 <span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>已支付<span></span></p>\n<p class=\"MsoNormal\" align=\"left\" style=\"text-indent:21pt;\">6已支付已出单<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>已完成<span></span></p>\n<p class=\"MsoNormal\" align=\"left\" style=\"text-indent:21pt;\">8已承保已生效<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>已完成<span></span></p>\n<p class=\"MsoNormal\" align=\"left\" style=\"text-indent:21pt;\">11终止<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;</span>已终止（暂不处理）<span></span></p>\n<p class=\"MsoNormal\" align=\"left\" style=\"text-indent:21pt;\">0注销<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;</span>已退款（暂不处理）<span></span></p>\n<p class=\"MsoNormal\" align=\"left\" style=\"text-indent:21pt;\">98预收退费中<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;</span>退款中（暂不处理）<span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\">待支付、已支付及订单详情页增加保险公司信息；<span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\">待支付状态，众安的订单保留撤回按钮，撤回后可以再编辑订单信息，再修改后投保生成新的投保单号。<span></span></p>\n<p class=\"MsoNormal\" style=\"text-indent:21pt;\">待修改状态，众安保留刷新核保结果按钮。众安没有人工核保过程。<span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('115', '1', '根据账号归属城市显示默认信息', '<p><span style=\"color:#333333;font-family:arial, sans-serif;font-size:15px;\">根据账号归属城市，默认险种等信息显示不同的默认值、可修改范围。</span></p>\n<p><br /></p>\n<p></p><table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"954\" style=\"width:717pt;\" class=\"ke-zeroborder\"><tbody><tr><td height=\"18\" class=\"xl65\" width=\"110\">模板编号</td>\n<td class=\"xl65\" width=\"86\">三者险保额</td>\n<td class=\"xl65\" width=\"128\">车损调整范围</td>\n<td class=\"xl65\" width=\"264\">车辆性质</td>\n<td class=\"xl65\" width=\"366\">第一受益人</td>\n</tr><tr><td height=\"18\" class=\"xl65\"></td>\n<td class=\"xl69\">默认选中值</td>\n<td class=\"xl69\">可手动调整的范围</td>\n<td class=\"xl69\">第一个为默认选中值</td>\n<td class=\"xl69\">第一个为默认选中值</td>\n</tr><tr><td height=\"18\" class=\"xl66\"><span style=\"background-color:#FFE500;\">A0</span></td>\n<td class=\"xl66\"><span style=\"background-color:#FFE500;\">20万</span></td>\n<td class=\"xl67\"><span style=\"background-color:#FFE500;\">下浮20%，上调30%</span></td>\n<td class=\"xl66\"><span style=\"background-color:#FFE500;\">非营业—个人用车</span></td>\n<td class=\"xl66\"><span style=\"background-color:#FFE500;\">上海易鑫融资租赁有限公司</span></td>\n</tr><tr><td height=\"18\" class=\"xl66\"><span style=\"background-color:#FFE500;\">A1</span></td>\n<td class=\"xl66\"><span style=\"background-color:#FFE500;\">20万</span></td>\n<td class=\"xl67\"><span style=\"background-color:#FFE500;\">下浮20%，上调30%</span></td>\n<td class=\"xl66\"><span style=\"background-color:#FFE500;\">非营业—个人用车</span></td>\n<td class=\"xl66\"><span style=\"background-color:#FFE500;\">上海易鑫融资租赁有限公司、晋城银行股份有限公司</span></td>\n</tr><tr><td height=\"18\" class=\"xl66\"><span style=\"background-color:#FFE500;\">A2</span></td>\n<td class=\"xl66\"><span style=\"background-color:#FFE500;\">50万</span></td>\n<td class=\"xl67\"><span style=\"background-color:#FFE500;\">下浮30%，上调30%</span></td>\n<td class=\"xl66\"><span style=\"background-color:#FFE500;\">非营业—个人用车、非营业—企业用车</span></td>\n<td class=\"xl66\"><span style=\"background-color:#FFE500;\">上海易鑫融资租赁有限公司</span></td>\n</tr></tbody></table><table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"196\" style=\"width:148pt;\" class=\"ke-zeroborder\"><tbody><tr><td height=\"18\" class=\"xl65\" width=\"110\">账号归属城市</td>\n<td class=\"xl65\" width=\"86\">对应模板</td>\n</tr><tr><td height=\"18\" class=\"xl66\">郑州</td>\n<td class=\"xl66\">A1</td>\n</tr><tr><td height=\"18\" class=\"xl66\">新乡</td>\n<td class=\"xl66\">A0</td>\n</tr><tr><td height=\"18\" class=\"xl66\">周口</td>\n<td class=\"xl66\">A0</td>\n</tr><tr><td height=\"18\" class=\"xl66\">平顶山</td>\n<td class=\"xl66\">A0</td>\n</tr><tr><td height=\"18\" class=\"xl66\">漯河</td>\n<td class=\"xl66\">A0</td>\n</tr><tr><td height=\"18\" class=\"xl66\">许昌</td>\n<td class=\"xl66\">A1</td>\n</tr><tr><td height=\"18\" class=\"xl66\">安阳</td>\n<td class=\"xl66\">A0</td>\n</tr><tr><td height=\"18\" class=\"xl66\">信阳</td>\n<td class=\"xl66\">A0</td>\n</tr><tr><td height=\"18\" class=\"xl66\">濮阳</td>\n<td class=\"xl66\">A0</td>\n</tr><tr><td height=\"18\" class=\"xl66\">洛阳</td>\n<td class=\"xl66\">A0</td>\n</tr><tr><td height=\"18\" class=\"xl66\">鹤壁</td>\n<td class=\"xl66\">A0</td>\n</tr><tr><td height=\"18\" class=\"xl66\">广州</td>\n<td class=\"xl66\">A2</td>\n</tr><tr><td height=\"18\" class=\"xl66\">佛山</td>\n<td class=\"xl66\">A2</td>\n</tr></tbody></table><p><br /></p>\n<p><br /></p>\n<p><br /></p>', '');
INSERT INTO `zt_storyspec` VALUES ('116', '1', '车主信息', '<p class=\"MsoListParagraphCxSpFirst\" style=\"margin-left:39pt;text-indent:-21pt;\">车主信息</p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:54pt;text-indent:-21pt;\">Ø&nbsp; 姓名栏最多允许输入30个半角字符；</p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:54pt;text-indent:-21pt;\">Ø&nbsp; 身份证号为18位数字；</p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:54pt;text-indent:-21pt;\">Ø&nbsp; 手机号为11位数字</p>', '');
INSERT INTO `zt_storyspec` VALUES ('117', '1', '车辆信息', '<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:39pt;text-indent:-21pt;\">车辆信息</p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:54pt;text-indent:-21pt;\">Ø&nbsp; 车牌号最多输入9位半角字符，默认展示 豫；</p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:54pt;text-indent:-21pt;\">Ø&nbsp; 车架号为17位数字+字母组合；</p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:54pt;text-indent:-21pt;\">Ø&nbsp; 发动机号最多允许输入35位半角字符；</p>', '');
INSERT INTO `zt_storyspec` VALUES ('118', '1', '证照上传', '<span></span><p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:39pt;text-indent:-21pt;\">证照上传</p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:54pt;text-indent:-21pt;\">Ø&nbsp; 点击调起相册，最多允许上传9张照片</p>\n', '');
INSERT INTO `zt_storyspec` VALUES ('119', '1', '购买须知', '<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:39pt;text-indent:-21pt;\">&nbsp;购买须知</p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:54pt;text-indent:-21pt;\">Ø&nbsp; 纯文本页面，文案滞后提供</p>', '');
INSERT INTO `zt_storyspec` VALUES ('120', '1', '提交审核', '<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:39pt;text-indent:-21pt;\">提交审核</p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:54pt;text-indent:-21pt;\">Ø&nbsp; 点击提交审核按钮，弹窗提示是否确认提交平台审核：</p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:39pt;text-indent:21.75pt;\">确定：提示提交成功，请5分钟后进入我的订单查看审核结果。页面跳转首页。</p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:39pt;text-indent:21.75pt;\">取消：关闭弹窗，页面停在当前页</p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:54pt;text-indent:-21pt;\">Ø&nbsp; 订单审核结果短信通知B端渠道。短信文案：</p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:110pt;text-indent:-55pt;\">审核通过：【淘车车主】订单号xxxxxxxxx审核通过，请尽快付款，付款后将向车主发送服务券。</p>\n<p class=\"MsoListParagraphCxSpLast\" style=\"margin-left:110pt;text-indent:-55pt;\">审核不通过：【淘车车主】订单号xxxxxxxxx未审核通过，原因：xxxx，如需购买，请进入我的订单修改后提交审核。</p>', '');
INSERT INTO `zt_storyspec` VALUES ('117', '2', '车辆信息(1760更新)', '<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:39pt;text-indent:-21pt;\">车辆信息</p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:54pt;text-indent:-21pt;\">Ø&nbsp; 车牌号最多输入9位半角字符，默认展示 豫；</p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:54pt;text-indent:-21pt;\">Ø&nbsp; 车架号为17位数字+字母组合；</p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:54pt;text-indent:-21pt;\">Ø&nbsp; 发动机号最多允许输入35位半角字符；</p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:54pt;text-indent:-21pt;\"><br /></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:54pt;text-indent:-21pt;\"><br /></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:54pt;text-indent:-21pt;\"><strong>1760-</strong><span class=\"todo-rest\" style=\"font-size:20px;vertical-align:baseline;color:#333333;\"><strong>B端车牌号省份可修改</strong></span><span style=\"color:#333333;\"><strong>&nbsp;</strong></span></p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:54pt;text-indent:-21pt;\"></p><p style=\"font-size:15px;vertical-align:baseline;color:#333333;font-family:arial, sans-serif;\">1.省份变更可修改字段</p>\n<p style=\"font-size:15px;vertical-align:baseline;color:#333333;font-family:arial, sans-serif;\">2.进入页面，默认显示“豫”</p>\n<p style=\"font-size:15px;vertical-align:baseline;color:#333333;font-family:arial, sans-serif;\">3.点击【提交审核】，判断车牌号是否小于7个字符</p>\n<p style=\"font-size:15px;vertical-align:baseline;color:#333333;font-family:arial, sans-serif;\">&nbsp; &nbsp;是：toast提示：请输入正确的车牌号</p>\n<p style=\"font-size:15px;vertical-align:baseline;color:#333333;font-family:arial, sans-serif;\">&nbsp; &nbsp;否：验证通过</p>\n', '');
INSERT INTO `zt_storyspec` VALUES ('121', '1', '核销记录', '<ul style=\"margin-left:6px;font-size:15px;vertical-align:baseline;color:#333333;font-family:arial, sans-serif;\"><li style=\"vertical-align:baseline;\">商户服务</li>\n</ul><ol style=\"margin-left:6px;font-size:15px;vertical-align:baseline;color:#333333;font-family:arial, sans-serif;\"><li style=\"vertical-align:baseline;\">点击【商户服务】，显示【券码核销】和【<span style=\"vertical-align:baseline;\">核销记录</span>】</li>\n<li style=\"vertical-align:baseline;\">点击【核销记录】，进入核销记录页</li>\n<li style=\"vertical-align:baseline;\"><img src=\"https://attachments.tower.im/tower/f3c9dac853e8495c886edbeaadb9bf26?version=auto&amp;filename=Clipboard%20Image.png\" alt=\"Clipboard Image.png\" /></li>\n</ol><span style=\"color:#333333;font-family:arial, sans-serif;font-size:15px;\">核销记录页</span><br /><ol style=\"margin-left:6px;font-size:15px;vertical-align:baseline;color:#333333;font-family:arial, sans-serif;\"><li style=\"vertical-align:baseline;\"><ol style=\"margin-left:6px;font-size:15px;vertical-align:baseline;color:#333333;font-family:arial, sans-serif;\"><li style=\"vertical-align:baseline;\">显示核销成功的全部服务券信息；</li>\n<li style=\"vertical-align:baseline;\">核销记录不可点击；</li>\n<li style=\"vertical-align:baseline;\">按照核销时间倒叙排列；</li>\n<li style=\"vertical-align:baseline;\">进入页面加载20条数据，向下滑动时再次加载20条数据；</li>\n<li style=\"vertical-align:baseline;\">判断核销记录是否＜1条</li>\n</ol><p style=\"font-size:15px;vertical-align:baseline;color:#333333;font-family:arial, sans-serif;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;是：文案提示：还没有核销成功的服务券</p>\n<p style=\"font-size:15px;vertical-align:baseline;color:#101010;font-family:arial, sans-serif;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;否：显示核销记录</p>\n<p style=\"font-size:15px;vertical-align:baseline;color:#333333;font-family:arial, sans-serif;\"><br /></p>\n<p style=\"font-size:15px;vertical-align:baseline;color:#333333;font-family:arial, sans-serif;\">原型地址：</p>\n<p style=\"font-size:15px;vertical-align:baseline;color:#333333;font-family:arial, sans-serif;\"><a href=\"https://free.modao.cc/app/ZXmZ9Wba1wCQgOvRsFb8eRtJFlLLoIN\">https://free.modao.cc/app/ZXmZ9Wba1wCQgOvRsFb8eRtJFlLLoIN</a></p>\n</li>\n</ol>', '');
INSERT INTO `zt_storyspec` VALUES ('122', '1', '后台导出报表', '<p style=\"margin-left:42pt;font-size:15px;vertical-align:baseline;color:#333333;font-family:arial, sans-serif;\"><span style=\"font-size:12pt;vertical-align:baseline;color:#000000;\">订单列表页增加报表导出</span></p>\n<p style=\"margin-left:63pt;font-size:15px;vertical-align:baseline;color:#333333;font-family:arial, sans-serif;\"><span style=\"font-size:12pt;vertical-align:baseline;color:#000000;\">1)<span style=\"font-size:7pt;vertical-align:baseline;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size:12pt;vertical-align:baseline;color:#000000;\">订单列表搜索栏增加【导出报表】按钮；</span></p>\n<p style=\"margin-left:63pt;font-size:15px;vertical-align:baseline;color:#333333;font-family:arial, sans-serif;\"><span style=\"font-size:12pt;vertical-align:baseline;color:#000000;\">2)<span style=\"font-size:7pt;vertical-align:baseline;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size:12pt;vertical-align:baseline;color:#000000;\">点击【导出报表】，若结果为空，弹窗提示：结果为空，无法导出报表， &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 请修改搜索条件；</span></p>\n<p style=\"margin-left:63pt;font-size:15px;vertical-align:baseline;color:#333333;font-family:arial, sans-serif;\"><span style=\"font-size:12pt;vertical-align:baseline;color:#000000;\">3)<span style=\"font-size:7pt;vertical-align:baseline;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size:12pt;vertical-align:baseline;color:#000000;\">报表命名为：起始日期</span><span style=\"font-size:12pt;vertical-align:baseline;color:#000000;\">-</span><span style=\"font-size:12pt;vertical-align:baseline;color:#000000;\">结束日期</span><span style=\"font-size:12pt;vertical-align:baseline;color:#000000;\">+</span><span style=\"font-size:12pt;vertical-align:baseline;color:#000000;\">销售汇总表</span></p>\n<p style=\"margin-left:63pt;font-size:15px;vertical-align:baseline;color:#333333;font-family:arial, sans-serif;\"><span style=\"font-size:12pt;vertical-align:baseline;color:#000000;\">&nbsp; &nbsp; &nbsp; &nbsp; Eg.20170908-20170912</span><span style=\"font-size:12pt;vertical-align:baseline;color:#000000;\">销售汇总表</span></p>\n<p style=\"margin-left:63pt;font-size:15px;vertical-align:baseline;color:#333333;font-family:arial, sans-serif;\"><span style=\"font-size:12pt;vertical-align:baseline;color:#000000;\">4)<span style=\"font-size:7pt;vertical-align:baseline;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span><span style=\"font-size:12pt;vertical-align:baseline;color:#000000;\">报表内容</span></p>\n<p style=\"margin-left:84pt;font-size:15px;vertical-align:baseline;color:#333333;font-family:arial, sans-serif;\"><span style=\"font-size:12pt;vertical-align:baseline;color:#000000;\">l<span style=\"font-size:7pt;vertical-align:baseline;\">&nbsp;&nbsp;</span></span><span style=\"font-size:12pt;vertical-align:baseline;color:#000000;\">导出维度：所有一级、二级、三级分销员</span></p>\n<p style=\"margin-left:21pt;font-size:15px;vertical-align:baseline;color:#333333;font-family:arial, sans-serif;\"><span style=\"vertical-align:baseline;color:#000000;\">&nbsp;</span></p>\n<p></p><table style=\"margin:15px 0px 1.5em;padding:0px;border:0px;font-size:.96em;width:663px;color:#333333;font-family:arial, sans-serif;background-color:#FFFFFF;\"><tbody><tr><th style=\"font-size:14.4px;vertical-align:top;\"><span style=\"font-size:11pt;vertical-align:baseline;color:#000000;\">元素</span></th>\n<th style=\"font-size:14.4px;vertical-align:top;\"><span style=\"font-size:11pt;vertical-align:baseline;color:#000000;\">说明</span></th>\n</tr></tbody><tbody><tr><td style=\"font-size:14.4px;\"><span style=\"font-size:11pt;vertical-align:baseline;color:#000000;\">时间区间</span></td>\n<td style=\"font-size:14.4px;\"><span style=\"font-size:11pt;vertical-align:baseline;color:#000000;\">显示搜索条件中起止日期</span></td>\n</tr><tr><td style=\"font-size:14.4px;\"><span style=\"font-size:11pt;vertical-align:baseline;color:#000000;\">所属一级分销员</span></td>\n<td style=\"font-size:14.4px;\"><span style=\"font-size:11pt;vertical-align:baseline;color:#000000;\">出单员所属一级分销员，若无，显示为空，出单员为一级，显示该出单员姓名</span></td>\n</tr><tr><td style=\"font-size:14.4px;\"><span style=\"font-size:11pt;vertical-align:baseline;color:#000000;\">所属二级分销员</span></td>\n<td style=\"font-size:14.4px;\"><span style=\"font-size:11pt;vertical-align:baseline;color:#000000;\">出单员所属一级分销员，若无，显示为空，出单员为二级，显示该出单员姓名</span></td>\n</tr><tr><td style=\"font-size:14.4px;\"><span style=\"font-size:11pt;vertical-align:baseline;color:#000000;\">出单员</span></td>\n<td style=\"font-size:14.4px;\"><span style=\"font-size:11pt;vertical-align:baseline;color:#000000;\">生成订单的分销员</span></td>\n</tr><tr><td style=\"font-size:14.4px;\"><span style=\"font-size:11pt;vertical-align:baseline;color:#000000;\">待付款订单量</span></td>\n<td style=\"font-size:14.4px;\"><span style=\"font-size:11pt;vertical-align:baseline;color:#000000;\">指定时间区间内的待付款订单量</span></td>\n</tr><tr><td style=\"font-size:14.4px;\"><span style=\"font-size:11pt;vertical-align:baseline;color:#000000;\">已完成订单量</span></td>\n<td style=\"font-size:14.4px;\"><span style=\"font-size:11pt;vertical-align:baseline;color:#000000;\">指定时间区间内的已完成订单量</span></td>\n</tr><tr><td style=\"font-size:14.4px;\"><span style=\"font-size:11pt;vertical-align:baseline;color:#000000;\">退单量</span></td>\n<td style=\"font-size:14.4px;\"><span style=\"font-size:11pt;vertical-align:baseline;color:#000000;\">指定时间区间内的已完成订单量<br /></span></td>\n</tr></tbody></table><span><span style=\"font-size:13.44px;\"><br /></span></span>\n<p><span><span style=\"font-size:13.44px;\"><img src=\"{53.png}\" alt=\"\" /><br /></span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('123', '1', '审核通过提醒', '<p class=\"MsoNormal\"><b>触发节点</b>：运营审核通过<span></span></p>\n<p class=\"MsoNormal\"><b>推送对象</b>：<span>B</span>端人员<span></span></p>\n<p class=\"MsoNormal\"><b>推送内容</b>：订单号：<span>{</span>订单号<span>ID/18</span>位<span>}</span>，车牌号： <span>{</span>车牌号<span>}</span>，已审核通过，请于<span>11</span>月<span>21</span>日<span>24</span>点前付款，付款后将向车主发送服务券<span></span></p>\n<p class=\"MsoNormal\"><b>点击跳转页面</b>：<span>B</span>端<span>-</span>订单支付页<span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('124', '1', '支付将到期提醒', '<p class=\"MsoNormal\"><b>触发节点</b>：据支付截止时间<span>3</span>小时<span></span></p>\n<p class=\"MsoNormal\"><b>推送对象</b>：<span>B</span>端人员<span></span></p>\n<p class=\"MsoNormal\"><b>推送内容</b>：订单号：<span>{</span>订单号<span>ID/18</span>位<span>}</span>，车牌号： <span>{</span>车牌号<span>}</span>，支付期限将于<span> 11</span>月<span>21</span>日<span>24</span>点到期，请尽快付款，如过期未支付，该订单将取消。<span></span></p>\n<p class=\"MsoNormal\"><b>点击跳转页面</b>：<span>B</span>端<span>-</span>订单支付页<span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('125', '1', '审核不通过提醒', '<p class=\"MsoNormal\"><b>触发节点</b>：运营审核不通过<span></span></p>\n<p class=\"MsoNormal\"><b>推送对象</b>：<span>B</span>端人员<span></span></p>\n<p class=\"MsoNormal\"><b>推送内容</b>：订单号：<span>{</span>订单<span>ID/18</span>位<span>}</span>，车主： <span>{</span>车主姓名<span>}</span>，未审核通过，原因：<span>{</span>原因<span>/</span>长度不固定<span>}</span>，如需购买，请进入我的订单修改后提交审核。<span></span></p>\n<p class=\"MsoNormal\"><b>点击跳转页面</b>：<span>B</span>端<span>-</span>订单修改页<span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('126', '1', '服务券入账提醒：', '<p class=\"MsoNormal\"><b>触发节点</b>：<span>B</span>端支付成功<span></span></p>\n<p class=\"MsoNormal\"><b>推送对象</b>：<span>C</span>端车主<span></span></p>\n<p class=\"MsoNormal\">C端车主已关注<span>“</span>淘车车主服务<span>”-</span>微信通知<span></span></p>\n<p class=\"MsoNormal\"><b>推送内容</b>：您的全车宝服务券已入账，有效期至<span>2018</span>年<span>11</span>月<span>21</span>日，可在我的服务券中查看。如有问题，请致电客服：<span>{</span>手机号或电话<span>/</span>长度不固定<span>}&nbsp;</span></p>\n<p class=\"MsoNormal\"><b>点击跳转页面</b>：<span>C</span>端<span>-</span>我的服务券<span>-</span>可使用服务券<span></span></p>\n<p class=\"MsoNormal\">&nbsp;</p>\n<p class=\"MsoNormal\">C端车主未关注<span>“</span>淘车车主服务<span>”-</span>短信通知<span></span></p>\n<p class=\"MsoNormal\"><b>短信内容</b>：您的全车宝服务券已入账，有效期至<span>2018</span>年<span>11</span>月<span>21</span>日，请关注微信公众号<span>“</span>淘车车主服务<span>”</span>，进入我的服务券查看。如有问题，请致电客服：<span>{</span>手机号或电话<span>/</span>长度不固定<span>}</span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('127', '1', '核销成功提醒', '<p class=\"MsoNormal\"><b>触发节点</b>：<span>F</span>端核销成功<span></span></p>\n<p class=\"MsoNormal\"><b>推送对象</b>：<span>C</span>端车主<span></span></p>\n<p class=\"MsoNormal\"><b>推送内容</b>：<span>{</span>服务券类型<span>+</span>服务券号<span>/</span>长度不固定<span>}</span>，已核销成功。如有问题，请致电客服：<span>{</span>手机号或电话<span>/</span>长度不固定<span>}</span></p>\n<p class=\"MsoNormal\"><b>点击跳转页面</b>：<span>C</span>端<span>-</span>我的服务券<span>-</span>不可使用服务券<span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('128', '1', '服务券到期提醒：', '<p class=\"MsoNormal\"><b>触发节点</b>：据可使用服务券到期<span>1</span>个月<span></span></p>\n<p class=\"MsoNormal\"><b>推送对象</b>：<span>C</span>端车主<span></span></p>\n<p class=\"MsoNormal\"><b>推送内容</b>：您的全车宝<span>{</span>服务券类型<span>}</span>服务券即将在<span>2017</span>年<span>11</span>月<span>22</span>日到期，过期将无法使用，请您及时到店享受服务，如有问题，请致电客服：<span>{</span>手机号或电话<span>/</span>长度不固定<span>}</span></p>\n<p class=\"MsoNormal\"><b>点击跳转页面</b>：<span>C</span>端<span>-</span>我的服务券<span>-</span>可使用服务券<span></span></p>', '');
