INSERT INTO `zt_storyspec` VALUES ('130', '1', '意外险出单失败提醒：', '<p class=\"MsoNormal\"><b>触发节点</b>：出单失败（用户支付成功后，生成服务券码，并调安心意外险出单接口）<span></span></p>\n<p class=\"MsoNormal\"><b>推送对象</b>：运营人员<span></span></p>\n<p class=\"MsoNormal\"><b>推送内容</b>：订单号<span>{</span>订单<span>ID/18</span>位<span>}</span>，车主： <span>{</span>车主姓名<span>}</span>，意外险出单失败，请处理！<span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('131', '1', '待审核提醒：', '<p class=\"MsoNormal\"><b>触发节点</b>：<span>B</span>端成功提交审核<span><br /></span><b>推送对象</b>：指定运营人员<span>&nbsp;&nbsp;</span>手机号：<span>15332023939<br /></span><b>推送内容</b>：订单号<span>{</span>订单<span>ID/18</span>位<span>}</span>，车主： <span>{</span>车主姓名<span>}</span>，已提交审核，请尽快审核。<span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('120', '2', '提交审核', '<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:39pt;text-indent:-21pt;\">提交审核</p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:54pt;text-indent:-21pt;\">Ø&nbsp; 点击提交审核按钮，弹窗提示是否确认提交平台审核：</p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:39pt;text-indent:21.75pt;\">确定：提示提交成功，请5分钟后进入我的订单查看审核结果。页面跳转首页。</p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:39pt;text-indent:21.75pt;\">取消：关闭弹窗，页面停在当前页</p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:54pt;text-indent:-21pt;\">Ø&nbsp; 订单审核结果短信通知B端渠道。短信文案：</p>\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-left:110pt;text-indent:-55pt;\">审核通过：【淘车车主】订单号xxxxxxxxx审核通过，请尽快付款，付款后将向车主发送服务券。</p>\n<p class=\"MsoListParagraphCxSpLast\" style=\"margin-left:110pt;text-indent:-55pt;\">审核不通过：【淘车车主】订单号xxxxxxxxx未审核通过，原因：xxxx，如需购买，请进入我的订单修改后提交审核。</p>\n<p class=\"MsoListParagraphCxSpLast\" style=\"margin-left:110pt;text-indent:-55pt;\"><br /></p>\n<p class=\"MsoListParagraphCxSpLast\" style=\"margin-left:110pt;text-indent:-55pt;\"><br /></p>\n<p class=\"MsoListParagraphCxSpLast\" style=\"margin-left:110pt;text-indent:-55pt;\">哈市简单化</p>', '');
INSERT INTO `zt_storyspec` VALUES ('132', '1', 'Banner', '<p class=\"MsoListParagraph\" align=\"left\" style=\"margin-left:18pt;text-indent:0cm;\">Banner采用<span>&nbsp;&nbsp;&nbsp; </span>同时出现易鑫车险<span>logo+</span>保险公司<span>logo</span>的那种<span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('133', '1', '用车城市', '<p class=\"MsoListParagraph\" align=\"left\" style=\"margin-left:36pt;text-indent:-36pt;\">（1）&nbsp;&nbsp;&nbsp; 默认显示定位城市<span></span></p>\n<p class=\"MsoListParagraph\" align=\"left\" style=\"margin-left:36pt;text-indent:-36pt;\">（2）&nbsp;&nbsp;&nbsp; 不同保险公司支持的城市不同，对应关系详见<span>excel</span></p>\n<p class=\"MsoListParagraph\" align=\"left\" style=\"margin-left:36pt;text-indent:-36pt;\">（3）&nbsp;&nbsp;&nbsp; 城市控件只显示支持投保的地区，不显示不支持投保的地区<span></span></p>\n<p class=\"MsoListParagraph\" align=\"left\" style=\"margin-left:36pt;text-indent:-36pt;\">（4）&nbsp;&nbsp;&nbsp; 不论哪家公司，热门城市都是<span>15</span>个，顺序如下：<span></span></p>\n<p class=\"MsoNormal\" align=\"left\">北京、上海、广州、深圳、南京、苏州、杭州、济南、青岛、武汉、长沙、沈阳、成都、重庆、西安、合肥、福州、石家庄、郑州、天津<span>&nbsp; </span>（如果<span>A</span>公司不支持某个城市，则向后展示其他城市，直到凑够<span>15</span>个）<span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('134', '1', '1、	车牌号', '<p class=\"MsoNormal\" align=\"left\">（<span>1</span>）根据选择城市对应：相关缩写<span>+</span>车牌号首字母<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></p>\n<p class=\"MsoNormal\" align=\"left\">（<span>2</span>）含汉字最多<span>7</span>位（太平洋、中华保险扩展到<span>8</span>位，其他公司<span>7</span>位）<span></span></p>\n<p class=\"MsoNormal\" align=\"left\">（<span>3</span>）点击未上牌，车牌改为汉字缩写加城市首<span>*</span>，如苏<span>A*</span>；选未上牌则车牌处禁止编辑，光标转至下个录入字段。<span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('135', '1', '车主姓名', '<p class=\"MsoNormal\" align=\"left\">（<span>1</span>）仅支持<span>2-15</span>个中文字符（英文<span>4-30</span>）<span>&nbsp; </span>（<span>2</span>）允许录入大写或小写，不进行大小写的强制转变<span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('136', '1', '手机号码', '<p class=\"MsoListParagraph\" align=\"left\" style=\"margin-left:36pt;text-indent:-36pt;\">（1）&nbsp;&nbsp;&nbsp; 调用数字键盘<span></span></p>\n<p class=\"MsoListParagraph\" align=\"left\" style=\"margin-left:36pt;text-indent:-36pt;\">（2）&nbsp;&nbsp;&nbsp; 长度仅支持<span>11</span>位；需要分段展示：<span>3</span>位<span>-4</span>位<span>-4</span>位<span>&nbsp; </span>（<span>3</span>）使用正则较验，非法号段提示错误<span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('137', '1', '发票号', '<p class=\"MsoListParagraph\" align=\"left\" style=\"margin-left:36pt;text-indent:-36pt;\">（1）&nbsp;&nbsp;&nbsp; 只有北京地区的新车会出现<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>（<span>2</span>）调用数字键盘，长度仅支持<span>8</span>位，位数不能更多或更少<span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('138', '1', '发票日期', '<p class=\"MsoNormal\" align=\"left\">（<span>1</span>）只有仅北京地区的新车会出现<span>&nbsp;&nbsp; </span>（<span>2</span>）<span> </span>仅可选<span>12</span>个月以内<span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('139', '1', '页面下方的“理赔指引”、“在线客服”点击后进入相应页面', '<p class=\"MsoNormal\" align=\"left\">页面下方的“理赔指引”、“在线客服”点击后进入相应页面<span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('140', '1', '点击车辆信息后的问号，页面下方会出现弹窗', '', '');
INSERT INTO `zt_storyspec` VALUES ('141', '1', '车架号码', '<p class=\"MsoListParagraph\" align=\"left\" style=\"margin-left:36pt;text-indent:-36pt;\">（1）&nbsp;&nbsp;&nbsp; 长度仅支持<span>17</span>位<span></span></p>\n<p class=\"MsoListParagraph\" align=\"left\" style=\"margin-left:36pt;text-indent:-36pt;\">（2）&nbsp;&nbsp;&nbsp; 支持数字或者字母，不可含<span>I</span>、<span>O</span>、<span>Q</span>中的任意一个字母<span></span></p>\n<p class=\"MsoListParagraph\" align=\"left\" style=\"margin-left:36pt;text-indent:-36pt;\">（3）&nbsp;&nbsp;&nbsp; 信息补全的数据，<span>11-14</span>位为<span>*</span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('142', '1', '发动机号', '<p class=\"MsoListParagraph\" align=\"left\" style=\"margin-left:36pt;text-indent:-36pt;\">（1）&nbsp;&nbsp;&nbsp; 仅支持<span>4-16</span>位字符，仅支持数字或者字母<span></span></p>\n<p class=\"MsoListParagraph\" align=\"left\" style=\"margin-left:36pt;text-indent:-36pt;\">（2）&nbsp;&nbsp;&nbsp; 信息补全的数据，开头<span>2</span>位、结尾<span>2</span>位不变，中间用<span>*&nbsp;&nbsp;</span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('143', '1', '车型&amp;车价', '<p class=\"MsoListParagraph\" align=\"left\" style=\"margin-left:18pt;text-indent:0cm;\">点击后跳转到车型控件<span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('144', '1', '注册日期', '<p class=\"MsoNormal\" align=\"left\">（<span>1</span>）该字段默认出现在第二页。中华保险例外，出现在第一页，车牌号的后面<span></span></p>\n<p class=\"MsoNormal\" align=\"left\">（<span>2</span>）新车小于等于<span>270</span>天选择，非新车十五年以内；<span>&nbsp;&nbsp;&nbsp; </span>今天是<span>11</span>月<span>7</span>日，如果是新车注册日期在<span>2</span>月<span>10</span>日及以后；如果是非新车，注册日期在<span>2002</span>年<span>11</span>月<span>7</span>日及以后<span></span></p>\n<p class=\"MsoNormal\" align=\"left\">（<span>3</span>）新车默认日期今年当天，非新车默认日期去年今天；<span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('145', '1', '一年内是否过户', '<p class=\"MsoListParagraph\" align=\"left\" style=\"margin-left:36pt;text-indent:-36pt;\">（1）&nbsp;&nbsp;&nbsp; 如果首页选择了“未上牌”的新车，“一年内是否过户”这行不显示<span></span></p>\n<p class=\"MsoListParagraph\" align=\"left\" style=\"margin-left:36pt;text-indent:-36pt;\">（2）&nbsp;&nbsp;&nbsp; 默认否，若选择是出现过户日期一行<span></span></p>\n<p class=\"MsoListParagraph\" align=\"left\" style=\"margin-left:36pt;text-indent:-36pt;\">（3）&nbsp;&nbsp;&nbsp; 点击后面的问号，出现弹窗<span></span></p>\n<p class=\"MsoListParagraph\" align=\"left\" style=\"margin-left:36pt;text-indent:-36pt;\"><img src=\"{68.png}\" alt=\"\" /></p>', '');
INSERT INTO `zt_storyspec` VALUES ('146', '1', '过户日期', '<p class=\"MsoListParagraph\" align=\"left\" style=\"margin-left:36pt;text-indent:-36pt;\">（1）&nbsp;&nbsp;&nbsp; 仅可选择<span>12</span>个月以内<span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('147', '1', '身份证号', '<p class=\"MsoNormal\" align=\"left\">（<span>1</span>）该字段默认出现在第二页。太平洋保险例外，出现在第一页，手机号码的后面<span></span></p>\n<p class=\"MsoNormal\" align=\"left\">（<span>2</span>）仅可录入数字或字母，禁止录入汉字；长度仅支持<span>15</span>位或<span>18</span>位的录入，正则较验<span></span></p>\n<p class=\"MsoNormal\" align=\"left\">（<span>3</span>）倒数第二位偶数为女，奇数为男<span></span></p>\n<p class=\"MsoNormal\" align=\"left\">（<span>4</span>）信息补全的数据，出生月份<span>+</span>日期<span>4</span>位，加<span>*</span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('148', '1', '是否新能源车', '<p class=\"MsoNormal\" align=\"left\">（<span>1</span>）太平洋、中华保险会出现这一字段，其他公司不出现。<span></span></p>\n<p class=\"MsoNormal\" align=\"left\">（<span>2</span>）如果车牌号是<span>7</span>位，则车辆信息页不出现是否新能源车的选项<span></span></p>\n<p class=\"MsoNormal\" align=\"left\">（<span>3</span>）如果车牌号是<span>8</span>位，则“是否过户车”的下方出现“是否新能源车”一栏。默认选项“是”，用户可以更改为“否”。（这样的原因：<span>8</span>位车牌可能是新能源，也可能不是新能源）<span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('149', '1', '是否贷款车', '<p class=\"MsoNormal\" align=\"left\">（<span>1</span>）每家保险公司的前台页面，\n“是否贷款车”这一行展示与否，由<span>OP</span>后台控制<span></span></p>\n<p class=\"MsoNormal\" align=\"left\">（<span>2</span>）如果出现的话，位置是在 “车辆信息”下方，“一年内是否过户上面”<span></span></p>\n<p class=\"MsoNormal\" align=\"left\">（<span>3</span>）“是否贷款车”默认状态为否，如果选择是则要填写“第一受益人<span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('150', '1', '拍照识别功能', '<p class=\"MsoNormal\" align=\"left\">用户可通过拍照或者相册，上传行驶证照片。用户上传后，我们通过<span>OCR</span>技术进行解析<span></span></p>\n<p class=\"MsoNormal\" align=\"left\">注：点击“查看拍照要求”，弹出拍照示例，不必再让拍照示例消失<span></span></p>\n<p class=\"MsoNormal\" align=\"left\">对于<span>OCR</span>解析的结果，如果能达到标准（至少能读出<span>5</span>个字段，车牌、车架、注册日期、过户车至少有<span>3</span>个位数正确） 则提示：以下信息为系统识别，请仔细核对！<span></span></p>\n<p>如果不能达到标准，则提示“识别信息有误，请核对修改”</p>\n<p><img src=\"{69.png}\" alt=\"\" /><img src=\"{70.png}\" alt=\"\" /></p>', '');
INSERT INTO `zt_storyspec` VALUES ('151', '1', '车型选择', '<p class=\"MsoNormal\" align=\"left\">用户输入<span>17</span>位<span>vin</span>码后，用力洋的技术解析对应的车型<span></span></p>\n<p class=\"MsoNormal\" align=\"left\"><b>场景<span>1</span>：未解析出任何配置型号<span></span></b></p>\n<p class=\"MsoNormal\" align=\"left\">（<span>1</span>）“填信息”页会出现提示<span>&nbsp; </span>“无对应车型，请检查车架号是否正确”<span></span></p>\n<p class=\"MsoNormal\" align=\"left\">（<span>2</span>）在车型选择页，需要用户手动输入品牌型号<span></span></p>\n<p class=\"MsoNormal\" align=\"left\">“温馨提示”的文字和设计稿相比，有所更改，以下图片是最新的：<span></span></p>\n<p>如果是在中华的投保流程中，额外增加一句话。“为保证搜索结果，品牌型号需大于等于<span>6</span>位”</p>\n<p><img src=\"{71.png}\" alt=\"\" /></p>\n<p><br /></p>\n<p></p><p class=\"MsoNormal\" align=\"left\">（<span>3</span>）通过品牌型号查找中、查找到、未查找到<span></span></p>\n<p class=\"MsoNormal\" align=\"left\">（用户自己输入的内容需要标红，年款<span>&amp;</span>排量均可以筛选，排量要精确到小数点后面一位）<span></span></p>\n<p><img src=\"{72.png}\" alt=\"\" />&nbsp; &nbsp;<img src=\"{73.png}\" alt=\"\" />&nbsp; &nbsp;<img src=\"{74.png}\" alt=\"\" /></p>\n<p><br /></p>\n<p><img src=\"{75.png}\" alt=\"\" />&nbsp; &nbsp;<img src=\"{76.png}\" alt=\"\" /></p>\n<p><br /></p>\n<p><br /></p>\n<p></p><p class=\"MsoNormal\" align=\"left\"><b>场景<span>2</span>：解析出唯一的配置型号<span></span></b></p>\n<p class=\"MsoNormal\" align=\"left\">车型<span>&amp;</span>车价一栏无需用户操作，直接带入<span></span></p>\n<p class=\"MsoNormal\" align=\"left\"><b>场景<span>3 </span>：解析出唯一的品牌型号、多个配置型号<span></span></b></p>\n用户需在列表中选择配置型号\n<p><img src=\"{77.png}\" alt=\"\" /></p>\n<p><br /></p>\n<p></p><p class=\"MsoNormal\" align=\"left\"><b>场景<span>4</span>：解析出多个品牌型号、多个配置型号<span></span></b></p>\n用户选择某个品牌型号后，会对下方的配置型号再次进行筛选\n<p><br /></p>\n<p><img src=\"{78.png}\" alt=\"\" /></p>\n<p><br /></p>\n<p></p>\n<p></p>\n<p><br /></p>\n<p><br /></p>\n\n<p><br /></p>', '');
INSERT INTO `zt_storyspec` VALUES ('152', '1', '报价的险种套餐有2种情况（险种套餐包含哪些由后台控制）', '<p class=\"MsoNormal\" align=\"left\">（<span>1</span>）险种套餐由保险返回：阳光、人保、太保、安盛<span></span></p>\n<p class=\"MsoNormal\" align=\"left\">（<span>2</span>）其余公司采用易鑫的套餐：<span></span></p>\n<p class=\"MsoNormal\" align=\"left\">车损<span>+</span>三者<span>50</span>万<span>+</span>司机<span>1</span>万<span>+</span>乘客<span>1</span>万<span>+</span>玻璃<span>+</span>不计免赔（车损、三者、司机、乘客）<span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('153', '1', '报价成功', '<p class=\"MsoNormal\" align=\"left\">点击“修改方案”，进入调整险种页<span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('154', '1', '报价失败', '<p class=\"MsoListParagraph\" align=\"left\" style=\"margin-left:18pt;text-indent:0cm;\">报价失败后，要向用户解释失败的原因。原因是保险公司返回给易鑫的，每次都会不同。<span></span></p>\n<p class=\"MsoListParagraph\" align=\"left\" style=\"margin-left:18pt;text-indent:0cm;\">点击“修改方案再试试”，关闭弹窗，并跳转到修改险种页<span></span></p>\n<p>点击“查看其他公司报价”，用这辆车的信息请求比价（人保报价失败后，不引导去比价）</p>\n<p><img src=\"{79.png}\" alt=\"\" /></p>', '');
INSERT INTO `zt_storyspec` VALUES ('155', '1', '关于按钮开关', '<p class=\"MsoListParagraph\" align=\"left\" style=\"margin-left:18pt;text-indent:0cm;\">交强险<span>+</span>车船税，如果按钮关闭，起保日期一行隐藏<span></span></p>\n<p class=\"MsoListParagraph\" align=\"left\" style=\"margin-left:18pt;text-indent:0cm;\">商业险，如果按钮关闭，起保日期<span>+</span>下方的所有险种隐藏。<span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('156', '1', '“险种攻略”', '<p class=\"MsoListParagraph\" align=\"left\" style=\"margin-left:18pt;text-indent:0cm;\">点击商业险后面的“险种攻略”，进入险种攻略页面<span></span></p>\n<p class=\"MsoListParagraph\" align=\"left\" style=\"margin-left:18pt;text-indent:0cm;\">点击险种功率的右上角返回，回到调整险种页面<span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('157', '1', '调整险种页的日期选择', '<p class=\"MsoNormal\" align=\"left\">（<span>1</span>）用户首次更改了交强险日期，商业险发生联动改变。用户更改商业险，不对交强险联动<span></span></p>\n<p class=\"MsoNormal\" align=\"left\">（<span>2</span>）当用户第<span>2</span>次及以上更改交强险时，商业险日期不改变<span></span></p>\n<p class=\"MsoNormal\" align=\"left\">（<span>3</span>）从其他页面（如提订单）回到算报价页面，更改交强险，仍视为第一次。<span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('158', '1', '车损险', '<p class=\"MsoNormal\" align=\"left\">取消车损险后，以下险种不能投保：玻璃、划痕、自燃、涉水、指定专修、无法找到第三方<span></span></p>\n<p>并且后出现一个弹窗，内容如下：</p>\n<p><img src=\"{80.png}\" alt=\"\" /></p>', '');
INSERT INTO `zt_storyspec` VALUES ('159', '1', '关于玻璃破碎险的说明', '<img src=\"{81.png}\" alt=\"\" />', '');
INSERT INTO `zt_storyspec` VALUES ('160', '1', '若保险公司返回某险种不能投保，则直接标记为灰色', '', '');
INSERT INTO `zt_storyspec` VALUES ('161', '1', '返回推荐', '<p class=\"MsoNormal\" align=\"left\">当点击“返回推荐”按钮，到报价页。展示刚才推荐的方案，并不用重新报价<span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('162', '1', '投保礼模块', '<p class=\"MsoNormal\" align=\"left\">如果公司赠送用户礼品，该模块出现；如果公司不赠送用户礼品，该模块不出现<span></span></p>\n<p class=\"MsoNormal\" align=\"left\"><img src=\"{82.png}\" alt=\"\" /></p>', '');
INSERT INTO `zt_storyspec` VALUES ('163', '1', '保单类型', '<p class=\"MsoNormal\" align=\"left\">（<span>1</span>）所有公司的北京地区均强制电子保单，点击后会进入对应的说明页面，可参见链接<span></span></p>\n<p class=\"MsoNormal\" align=\"left\"><span><a href=\"http://m.chexian.com/InsuranceParity/OrderSubmit?ShortEName=CPIC&amp;orderId=8bd3f211757bef00e5cf112f32e4545dece41782dc2d10a6&amp;return=0&amp;twoPage=null&amp;InsureFlowCode\">http://m.chexian.com/InsuranceParity/OrderSubmit?ShortEName=CPIC&amp;orderId=8bd3f211757bef00e5cf112f32e4545dece41782dc2d10a6&amp;return=0&amp;twoPage=null&amp;InsureFlowCode</a></span>=&nbsp;</p>\n<p class=\"MsoNormal\" align=\"left\"><img src=\"{83.png}\" alt=\"\" /></p>\n<p class=\"MsoNormal\" align=\"left\"><br /></p>\n<p class=\"MsoNormal\" align=\"left\"></p><p class=\"MsoListParagraph\" align=\"left\" style=\"margin-left:36pt;text-indent:-36pt;\">（1）&nbsp;&nbsp;&nbsp;&nbsp;\n太平洋保险的四川地区强制电子保单，点击后会进入对应的说明，可参见链接；其他公司不会出现<span></span></p>\n<p class=\"MsoNormal\" align=\"left\"><span><a href=\"http://m.chexian.com/InsuranceParity/OrderSubmit?ShortEName=CPIC&amp;orderId=b64ccf3705fcbd1c8914133061d79b488a7d099c2fa6aa89&amp;return=0&amp;twoPage=null&amp;InsureFlowCode\">http://m.chexian.com/InsuranceParity/OrderSubmit?ShortEName=CPIC&amp;orderId=b64ccf3705fcbd1c8914133061d79b488a7d099c2fa6aa89&amp;return=0&amp;twoPage=null&amp;InsureFlowCode</a></span>=&nbsp;</p>\n<p class=\"MsoNormal\" align=\"left\"><br /></p>\n<img src=\"{84.png}\" alt=\"\" /><p class=\"MsoNormal\" align=\"left\"><br /></p>\n<p class=\"MsoNormal\" align=\"left\"></p><p class=\"MsoListParagraph\" align=\"left\" style=\"margin-left:36pt;text-indent:-36pt;\">（3&nbsp; ）&nbsp;&nbsp;&nbsp;&nbsp;\n太平洋的广州和上海地区，发票类型可选择；其他公司不会出现<span></span></p>\n<p class=\"MsoNormal\" align=\"left\"><img src=\"{85.png}\" alt=\"\" /></p>\n<p class=\"MsoNormal\" align=\"left\"><br /></p>\n<img src=\"{86.png}\" alt=\"\" /><p class=\"MsoNormal\" align=\"left\"><br /></p>\n<p class=\"MsoNormal\" align=\"left\"><br /></p>', '');
INSERT INTO `zt_storyspec` VALUES ('164', '1', '发票类型', '<p class=\"MsoListParagraph\" align=\"left\" style=\"margin-left:36pt;text-indent:-36pt;\">（1）&nbsp;&nbsp;&nbsp;&nbsp;\n太平洋保险的所有地区都强制选择电子发票，出现绿色方框中的内容；其余公司不会出现<span></span></p>\n<p class=\"MsoListParagraph\" align=\"left\" style=\"margin-left:36pt;text-indent:-36pt;\"><img src=\"{87.png}\" alt=\"\" />&nbsp; <img src=\"{88.png}\" alt=\"\" /></p>\n<p class=\"MsoListParagraph\" align=\"left\" style=\"margin-left:36pt;text-indent:-36pt;\"><br /></p>\n<p class=\"MsoListParagraph\" align=\"left\" style=\"margin-left:36pt;text-indent:-36pt;\"></p><p class=\"MsoNormal\" align=\"left\">（<span>2</span>）点击“电子发票”后面的问号，出现弹窗<span></span></p>\n<p class=\"MsoNormal\" align=\"left\">标题：电子发票使用须知<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>下方<span>button</span>：我知道了<span></span></p>\n<p class=\"MsoNormal\" align=\"left\">中间文字：<span> 1</span>、增值税电子普通发票和增值税发票的一种，其法律效力、基本用途、基本使用规定等与税务机关监制的增值税普通发票相同。<span>&nbsp;&nbsp; 2</span>、请录入正确的手机号码、证件号码及邮箱地址，以确保正常接收和查询电子发票信息。<span>3</span>、您可以登录上海市税务局电子发票查询平台进行查询及验证，查询地址如下：<span><a href=\"http://dzfp.tax.sh.gov.cn/\">http://dzfp.tax.sh.gov.cn</a></span></p>\n<p class=\"MsoListParagraph\" align=\"left\" style=\"margin-left:36pt;text-indent:-36pt;\"><br /></p>\n<p class=\"MsoListParagraph\" align=\"left\" style=\"margin-left:36pt;text-indent:-36pt;\"><br /></p>\n', '');
INSERT INTO `zt_storyspec` VALUES ('165', '1', '邮箱控制', '<p class=\"MsoNormal\" align=\"left\">（<span>1</span>）太保、保骉、中华三家公司，所有地区都必填邮箱，需要用户输入<span></span></p>\n<p class=\"MsoNormal\" align=\"left\">（<span>2</span>）对于其他公司，北京必填邮箱<span></span></p>\n<p class=\"MsoListParagraph\" align=\"left\" style=\"margin-left:81pt;text-indent:20pt;\">其他地区，邮箱非必填。如果用户没有填写，则后台传默认值<span></span></p>\n<p class=\"MsoListParagraph\" align=\"left\" style=\"margin-left:36pt;text-indent:-36pt;\">（1）&nbsp;&nbsp;&nbsp;&nbsp; 邮箱输入时，需要加后缀，如图所展示<span></span></p>\n<p class=\"MsoNormal\" align=\"left\">@qq.com&nbsp;&nbsp; @126.com&nbsp;\n@163.com&nbsp;&nbsp; @186.com&nbsp; @sina.com</p>\n<p class=\"MsoNormal\" align=\"left\"><br /></p>\n<p class=\"MsoNormal\" align=\"left\"><img src=\"{89.png}\" alt=\"\" /></p>\n<p class=\"MsoNormal\" align=\"left\"><br /></p>\n<p class=\"MsoNormal\" align=\"left\"><br /></p>\n<p class=\"MsoNormal\" align=\"left\"></p>', '');
INSERT INTO `zt_storyspec` VALUES ('166', '1', '车主信息', '<p class=\"MsoNormal\" align=\"left\">车主信息只能查看，并不能修改<span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('167', '1', '被保人信息', '<p class=\"MsoListParagraph\" align=\"left\" style=\"margin-left:36pt;text-indent:-36pt;\">（1）&nbsp;&nbsp;&nbsp;\n被保人信息默认同车主 （<span>2</span>）去掉了勾选之后，需填写被保人、身份证号、手机号<span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('168', '1', '险种信息、车辆信息之间可点击切换', '<p class=\"MsoListParagraph\" align=\"left\" style=\"margin-left:18pt;text-indent:-18pt;\">险种信息、车辆信息之间可点击切换<span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('169', '1', '核保相关规则', '<p class=\"MsoListParagraph\" align=\"left\" style=\"margin-left:36pt;text-indent:-36pt;\">（1）&nbsp;&nbsp;&nbsp;\n核保中<span></span></p>\n<p class=\"MsoNormal\" align=\"left\">点击“立即支付”后，即进入核保的过程。此时文案为“保险公司正在核对您的信息，请稍候”<span></span></p>\n<p class=\"MsoNormal\" align=\"left\">（<span>2</span>）核保成功<span></span></p>\n<p class=\"MsoNormal\" align=\"left\">核保成功后，先出现提示“即将前往<span>XXX</span>官网支付”，然后再跳转至保险公司收银台<span></span></p>\n<p class=\"MsoNormal\" align=\"left\">“<span>XXX</span>”是变量，根据不同的保险公司而变化<span></span></p>\n<p class=\"MsoNormal\" align=\"left\">（<span>3</span>）核保失败<span></span></p>\n<p class=\"MsoNormal\" align=\"left\">出现弹窗“很遗憾，<span>XXX</span>核保失败了。原因：<span>XXXXXXX&nbsp;&nbsp; </span>添加“易鑫车险”公众号，帮您在线投保 ”<span></span></p>\n<p class=\"MsoNormal\" align=\"left\">点击“确认”，弹窗关闭<span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('170', '1', '数据应用的优先级', '保险公司续保<span>&gt;</span>在易鑫成功投保<span>&gt;</span>壁虎数据应用<span>&gt;</span>在易鑫成功报价', '');
INSERT INTO `zt_storyspec` VALUES ('171', '1', '保险公司续保', '<p class=\"MsoNormal\" align=\"left\">若是某家公司的续保用户，保险公司会返回相关信息，不同公司返回内容不同。<span></span></p>\n<p class=\"MsoNormal\" align=\"left\"><img src=\"{90.png}\" alt=\"\" /></p>', '');
INSERT INTO `zt_storyspec` VALUES ('172', '1', '成功投保数据&amp;成功报价数据', '<p class=\"MsoListParagraph\" align=\"left\" style=\"margin-left:36pt;text-indent:-36pt;\">（1）&nbsp;&nbsp;&nbsp;\n三天以内报价成功的用户直接带入车辆信息，无需验证手机号<span></span></p>\n<p class=\"MsoListParagraph\" align=\"left\" style=\"margin-left:36pt;text-indent:0cm;\">上次报价成功大于<span>3</span>天，需验证手机号。手机验证码正确，才带入相关信息。<span></span></p>\n<p>用户也可以直接关闭弹窗，这样该页面的信息都要重新输入</p>\n<p><img src=\"{91.png}\" alt=\"\" /></p>\n<p><br /></p>\n<p></p><p class=\"MsoNormal\" align=\"left\">（<span>2</span>） 针对根据车牌号车主姓名可以找到大于或等于<span>1</span>条历史订单（历史报价成功范围或者历史报价非成功范围）的数据，均需要验证手机号，且手机号不同\n的情况，此时弹框中显示最多三个手机号可供用户选择带入，手机号的显示顺序是，优先显示跟该订单手机号相同的手机号，其他按时间倒序显示<span></span></p>\n<p><br /></p>\n<p><img src=\"{92.png}\" alt=\"\" /></p>\n<p><br /></p>\n<p></p>\n', '');
INSERT INTO `zt_storyspec` VALUES ('173', '1', '壁虎数据应用', '<p class=\"MsoListParagraph\" align=\"left\" style=\"margin-left:36pt;text-indent:-36pt;\">（1）&nbsp;&nbsp;&nbsp;\n若用户投保城市在壁虎支持的城市范围内，先出现提示 “正在为您匹配车辆信息，请稍候<span>…</span>”<span></span></p>\n<p class=\"MsoNormal\" align=\"left\">如果壁虎找到了相关数据，则直接带入；<span></span></p>\n<p class=\"MsoNormal\" align=\"left\">如果壁虎未找到相关数据，则再出现提示“暂无匹配信息，您可拍照或手工填写”<span></span></p>\n<p class=\"MsoNormal\" align=\"left\">（<span>2</span>）根据壁虎返回的起保日期，如果可以判定该车当年已经保过了商业险或者交强险，在报价页报价前给出提示。<span></span></p>\n<p class=\"MsoNormal\" align=\"left\">如果商业险、交强险都已经保过了，则提示后，用户点击确定后直接返回首页<span></span></p>\n<p class=\"MsoNormal\" align=\"left\">如果确定商业险已经保过了，则提示后继续报价，报价时去掉商业险继续报价，各公司负责人内部自己处理。<span></span></p>\n<p class=\"MsoNormal\" align=\"left\">如果确定交强险已经保过了，则提示后继续报价，报价时去掉交强险继续报价，各公司负责人内部自己处理。<span></span></p>\n<p class=\"MsoNormal\" align=\"left\">（<span>3</span>）基本信息页请求壁虎接口后台逻辑调整：当发现缓存中已有该车辆的壁虎数据，并且商业险或交强险起保日期小于或等于今天，则再次请求壁虎数据，将返回数据更新缓存，以便后续流程使用。<span></span></p>\n<p class=\"MsoNormal\" align=\"left\">（<span>4</span>）默认报价页，如果壁虎返回的起保日期小于或等于今天、超过<span>90</span>天，则默认返回给前端的数据为空。<span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('174', '1', '“这不是我的车”', '<p class=\"MsoNormal\" align=\"left\">所有“填信息”页面不是用户自己填写的场景，页面下方均会出现“这不是我的车”<span></span></p>\n<p class=\"MsoNormal\" align=\"left\">点击后出现弹窗“您即将清空本页所有的信息”。选择否，弹窗关闭；选择是，弹窗关闭，清空本页所有信息<span></span></p>', '');
INSERT INTO `zt_storyspec` VALUES ('175', '1', '用户在投保过程中，会给ta发送短信。具体发送内容与时机由运营同学决定，咨询尹惠/唐功奇', '', '');
INSERT INTO `zt_storyspec` VALUES ('176', '1', '各种验证码', '<p class=\"MsoListParagraph\" align=\"left\" style=\"margin-left:36pt;text-indent:-36pt;\">（1）&nbsp;&nbsp;&nbsp;\n江苏地区验证码，弹出在报价页（进入该页面即出现）<span></span></p>\n<p class=\"MsoNormal\" align=\"left\">A&nbsp;&nbsp;&nbsp;&nbsp; 新车<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>仅有阳光需填写验证码<span></span></p>\n<p>B&nbsp;&nbsp;&nbsp;&nbsp; 非新车<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>保骉、人保、阳光、太保、中华都会出现<span>&nbsp;&nbsp;&nbsp; </span>中银、安盛不出现验证码</p>\n<p><img src=\"{93.png}\" alt=\"\" /></p>\n<p><br /></p>\n<p></p><p class=\"MsoListParagraph\" align=\"left\" style=\"margin-left:36pt;text-indent:-36pt;\">（2）&nbsp;&nbsp;&nbsp;\n转保验证码，弹出在报价页（进入该页面即出现）<span></span></p>\n<p class=\"MsoNormal\" align=\"left\">中银、安盛、保骉已经破解；人保、阳光、太保、中华会出现验证码<span></span></p>\n北京地区验证码，弹出在去支付页（点击“立即支付”的时候出现）\n<p><img src=\"{94.png}\" alt=\"\" /></p>\n<p><br /></p>\n<p></p>', '');
INSERT INTO `zt_storyspec` VALUES ('177', '1', '绿色方框中的，是由后台配置的', '<p><img src=\"{95.png}\" alt=\"\" /></p>\n<p></p><p class=\"MsoNormal\" align=\"left\">“保险销售”是写死的<span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>“<span>0</span>息分期”这句，是由后台配置的<span></span></p>\n<img src=\"{96.png}\" alt=\"\" /><p><br /></p>\n<p></p><p class=\"MsoNormal\" align=\"left\">“立即报价”下面的小字，是由后台配置的<span></span></p>\n<p><br /></p>\n<p><br /></p>\n<img src=\"{97.png}\" alt=\"\" /><p><br /></p>\n<p></p><p class=\"MsoNormal\" align=\"left\">如果有投保礼显示投保礼，如果没有投保礼显示文案<span></span></p>\n', '');
