INSERT INTO `zt_storyspec` VALUES ('188', '1', '8各公司文案', '<p class=\"MsoNormal\" align=\"left\">人保<span>&nbsp; </span>值得信赖 送十项金牌服务<span></span></p>\n<p class=\"MsoNormal\" align=\"left\">太平洋<span> 3</span>分钟投保 全国通赔<span></span></p>\n<p class=\"MsoNormal\" align=\"left\">中华<span>&nbsp; </span>服务升级 一对一专享顾问<span></span></p>\n<p class=\"MsoNormal\" align=\"left\">中银<span>&nbsp; </span>车险分期付 还享多种好礼<span></span></p>\n<p class=\"MsoNormal\" align=\"left\">阳光<span>&nbsp; 24h</span>快速理赔 快易免服务<span></span></p>\n<p class=\"MsoNormal\" align=\"left\">安盛<span>&nbsp; </span>好司机省更多 理赔省心<span></span></p>\n<p class=\"MsoNormal\" align=\"left\">保骉<span>&nbsp; 0</span>息分期 众安平安联合车险<span></span></p>\n<p class=\"MsoNormal\" align=\"left\">国寿<span>&nbsp; </span>服务全天候 网购超优惠<span></span></p>\n<p class=\"MsoNormal\" align=\"left\">大地<span>&nbsp; </span>服务更贴心<span>&nbsp; </span>理赔更安心<span></span></p>\n<p class=\"MsoNormal\" align=\"left\">永诚<span>&nbsp; </span>网罗好车主 投保更便捷<span></span></p>', '');
